INSERT INTO `series_episodes` VALUES("308906","1","1","1","Genesis","1","1","1159135200","79501","In+this+episode%2C+we+are+introduced+to+Peter+Petrelli%2C+a+young+man+who+dreams+of+flying%2C+and+his+brother+Nathan%2C+a+ruthless+politician+who+thinks+that+Peter+is+dreaming+his+life+away.+Meanwhile%2C+ordinary+people+from+all+around+the+world+are+starting+to+suspect+that+they+have+abilities+beyond+those+of+normal+humans.+Artist+Isaac+Mendez+believes+that+he+is+painting+the+future%2C+high+school+cheerleader+Claire+Bennet+is+suddenly+able+to+recover+from+any+wound+almost+instantly%2C+Japanese+businessman+Hiro+Nakamura+tries+to+convince+a+friend+that+he+can+bend+space+and+time%2C+and+single+mother+Niki+Sanders+starts+seeing+strange+things+in+mirrors.Upon+learning+of+his+father%27s+death%2C+genetics+Professor+Mohinder+Suresh+begins+to+look+into+his+research+for+a+clue+to+why+he+was+killed.+When+he+follows+his+father%27s+trail+to+New+York+City%2C+however%2C+Mohinder+learns+that+someone+else+is+on+the+trail+of+the+same+research.++Someone+who+may+kill+to+protect+the+secrets+of+the+next+step+in+human+evolution.","8","66");
