INSERT INTO `series_episodes` VALUES("308908","1","1","1","One+Giant+Leap","3","1","1160344800","79501","Claire%27s+romantic+interlude+with+the+football+quarterback+takes+a+tragic+turn.+Hiro+convinces+his+friend%2C+Ando%2C+that+it+is+their+destiny+to+travel+to+America+to+save+the+world.+Meanwhile%2C+Nathan+uses+Peter%27s+accident+for+his+own+political+gain.+Officer+Matt+Parkman%2C+Mohinder+Suresh%2C+and+the+FBI+are+all+on+the+trail+of+the+mysterious+Sylar.","7.6","58");
