INSERT INTO `series_episodes` VALUES("184645","1","1","1","My+Kingdom","19","2","1048719600","76156","Turk+takes+J.D.+up+to+surgery%2C+and+right+from+the+start+J.D.+steps+all+over+Turk+when+trying+not+to+be+the+geek+among+the+surgeons.+Paul+hears+Elliot+say+%22I+love+U2%22+while+she+was+rearranging+her+CDs+and+thinks+she+said+%22I+love+you+too.%22+Dr.+Cox+decides+to+get+even+with+Dr.+Kelso+by+telling+everyone+he%27s+dead%2C+revealing+what+people+really+think+of+him.%0A","7.5","41");
