INSERT INTO `series_episodes` VALUES("184648","1","1","1","My+Dream+Job","22","2","1050530400","76156","J.D.+and+Turk%27s+college+buddy%2C+Spence%2C+drops+by+for+a+visit%2C+and+accidentally+tells+Dr.+Cox+a+secret.+Too+much+partying+with+successful+Spence+causes+Turk+and+J.D.+to+show+up+late+and+drunk+for+work%2C+which+Dr.+Kelso+fully+reprehends+them+for.+Elliot%27s+feeling+low+since+she+can%27t+measure+up+to+Dr.+Kelso%27s+standards%2C+and+the+Janitor+starts+another+feud+%E2%80%93+this+time+over+paychecks+%E2%80%93+with+J.D.","7.6","38");
INSERT INTO `series_episodes` VALUES("184602","1","1","1","My+First+Day","1","1","1001973600","76156","John+Dorian%2C+%22J.D.%22+to+friends%2C+is+a+boyishly+handsome%2C+self-deprecatingly+funny%2C+likeable+guy+who+would+be+confident+if+he+only+realized+his+assets.+Four+years+of+medical+school+have+prepared+J.D.+for+his+first+day+as+an+intern+at+Sacred+Heart+Hospital+-+but+he+has+his+doubts.+As+J.D.+is+thrown+into+the+chaotic+world+of+hospital+life%2C+we+not+only+get+to+see+the+quirky+characters+that+he+encounters%2C+but+also+hear+the+humorous+commentary+of+thoughts+streaming+through+J.D.%27s+head.+By+J.D.%27s+side+is+his+best+friend+since+college%2C+the+handsome+and+confident+Chris+Turk.+As+a+new+surgical+intern%2C+Turk+struts+around+with+a+gregarious+and+cocky+demeanor+that+hides+a+terror+that+he+only+admits+to+J.D.+Both+guys+initially+have+the+hots+for+their+attractive+fellow+intern%2C+Elliot+Reid%2C+but+J.D.+quickly+finds+out+her+beauty+is+only+surpassed+by+her+hyper-competitive+attitude.+Guiding+the+interns%27+education+are+those+with+more+medical+experience.+Dr.+Robert+%22Bob%22+Kelso%2C+Chief+of+Medicine%2C+wants+the+interns+to+think+they+can+count+on+him.+On+the+other+side+of+the+personality+spectrum+is+Dr.+Percival+%22Perry%22+Cox%2C+a+steamroller+of+a+man+short+on+patience.+Watching+over+the+interns+with+a+caustically+teasing+but+caring+demeanor%2C+is+nurse+Carla+Espinosa%2C+a+woman+who+is+motherly+and+sexy+at+the+same+time+-+which+appeals+mightily+to+Turk.","7.6","85");
INSERT INTO `series_episodes` VALUES("184603","1","1","1","My+Mentor","2","1","1002146400","76156","J.D.+tries+to+persuade+a+smoker+patient+to+quit+smoking+in+order+to+impress+Dr.+Cox%2C+who+is+just+feeling+lonely+in+his+opinion.+Elliot%27s+attitude+towards+Carla+annoys+her%2C+thus+Turk+is+able+to+go+on+a+date+with+Carla%2C+when+he+convinces+her+to+forgive+Elliot.%0A","7.2","70");
INSERT INTO `series_episodes` VALUES("184604","1","1","1","My+Best+Friend%27s+Mistake","3","1","1002578400","76156","J.D.+begins+to+feel+distant+from+Turk%2C+when+he+leaves+him+abandoned+every+time+that+he+tries+to+talk+to+him.+Elliot+fights+with+Kelso+for+calling+her+%22sweetheart%2C%22+and+she+seeks+Dr.+Cox%27s+advice.+J.D.%27s+relationship+with+Elliot+goes+in+a+time+race%2C+when+he+has+48+hours+to+kiss+her+before+he+is+put+into+her+%22Friend+Zone.%22","7.4","55");
INSERT INTO `series_episodes` VALUES("184605","1","1","1","My+Old+Lady","4","1","1003183200","76156","The+three+interns+are+each+assigned+patients+with+various+illnesses.+Statistically+speaking%2C+one+of+the+three+is+going+to+die.+J.D.%27s+patient+is+86+year+old+Mrs.+Tanner%2C+who+is+in+renal+failure.+20+year+old+David+Morrison+is+Turk%27s+hernia+patient+and+Elliot%27s+patient+Mrs.+Guerrero+only+speaks+Spanish+and+might+have+lupus.%0A%0A","7.7","55");
INSERT INTO `series_episodes` VALUES("184606","1","1","1","My+Two+Dads","5","1","1003788000","76156","J.D.+points+out+what+seems+to+be+a+technical+mistake+to+Dr.+Kelso%2C+but+it+was+really+an+attempt+of+Dr.+Cox+to+save+a+woman+without+insurance+using+a+dead+guy%27s+insurance.+Dr.+Kelso+and+Dr.+Cox+show+J.D.+their+different+ways+of+looking+at+medicine.+Meanwhile%2C+the+Janitor+intimidates+J.D.%2C+Elliot+discovers+the+healing+powers+of+her+boobs+and+Turk+gives+Carla+a+pen+he+thought+he+took+from+the+Lost+and+Found+box.%0A","7.5","62");
INSERT INTO `series_episodes` VALUES("184607","1","1","1","My+Bad","6","1","1004396400","76156","Dr.+Cox+is+still+facing+the+threat+of+suspension%2C+and+coincidentally%2C+J.D.+is+assigned+to+a+special+patient%3A+Jordan+Sullivan%2C+an+important+board+member.+She+is+very+demanding+and+J.D.+ends+up+sleeping+with+her+after+he+confronts+her.+Only+he+didn%27t+know+that+she+is+Dr.+Cox%27s+ex-wife%2C+and+now+the+only+one+who+can+save+J.D.%27s+mentor+from+being+fired+by+the+evil+Dr.+Kelso.%0AMeanwhile%2C+Elliot+is+assigned+to+take+care+of+a+shrink+whose+jaw+has+been+wired+shut%2C+and+for+whom+she+ends+up+becoming+a+patient.+Carla%27s+mom+makes+a+scandal+after+Turk+spends+the+night+at+Carla%27s%2C+and+when+she+breaks+her+leg%2C+Carla+blames+Turk+for+it.%0A","7.4","56");
INSERT INTO `series_episodes` VALUES("184608","1","1","1","My+Super+Ego","7","1","1005001200","76156","J.D.+has+finally+earned+the+spot+as+brightest+student%2C+but+he%27s+got+competition%3A+Nick+Murdoch%2C+who+seems+to+be+nicer%2C+friendlier+and+has+a+better+butt+than+him.+But+even+J.D.+can%27t+hate+the+guy%2C+for+he+is+so+nice.+But+he+is+surprised+when+he+finds+Nick+sitting+in+a+corner+crying+because+he+can%27t+take+the+pressure+of+medical+internship.%0AMeanwhile%2C+Turk+is+having+problems+at+the+operation+table+and+doesn%27t+tell+Carla%2C+who+keeps+bothering+Dr.+Cox+about+it.%0AAnd+Dr.+Cox+gives+Turk+a+very+unique+suggestion+on+how+to+calm+down+before+surgery.","7.4","54");
INSERT INTO `series_episodes` VALUES("184609","1","1","1","My+Fifteen+Minutes","8","1","1005778800","76156","J.D.+and+Turk+become+heroes+after+saving+a+cameraman%27s+life+on+TV%2C+while+heading+to+a+strip+club.+But+Turk+quickly+becomes+the+target+of+a+new+publicity+campaign+led+by+Dr.+Kelso%2C+exploiting+the+hospital%27s+diversity.%0AMeanwhile%2C+J.D.+worries+about+his+evaluation.+Elliot+is+going+out+with+Carla%2C+but+in+the+last+minute+she+blows+her+off+and+later+Elliot+runs+into+her+in+a+bar.%0A","7.5","53");
INSERT INTO `series_episodes` VALUES("184610","1","1","1","My+Day+Off","9","1","1006210800","76156","J.D.+gets+to+see+the+hospital+through+the+eyes+of+a+patient+when+he%27s+admitted+for+appendicitis.+Elliot+examines+him+and+he+tells+everyone+how+cold+and+rough+she+is%2C+which+drives+her+crazy.+J.D.+doesn%27t+want+Turk+to+operate+on+him%2C+which+hurts+Turk%27s+feelings.%0AMeanwhile%2C+Dr.+Cox+is+trying+to+show+off+to+his+mentor%2C+Dr.+Benson%2C+the+ex-chief+of+medicine%2C+who+is+also+a+patient+at+the+hospital.+The+only+thing+in+his+way+is+Dr.+Kelso%2C+who+almost+dismissed+Dr.+Benson+prematurely.%0A","7.2","52");
INSERT INTO `series_episodes` VALUES("184611","1","1","1","My+Nickname","10","1","1006815600","76156","J.D.+begins+a+new+relationship+with+Carla.+J.D.+gains+a+new+nickname+-+%22Scooter%22+-+and+his+relationship+with+Nurse+Carla+evolves+as+he+begins+to+out-distance+her+medical+knowledge%2C+while+Turk+trembles%2C+when+he+learns+that+his+secret+lunch+spot+was+claimed+years+ago+by+the+territorial+Dr.+Kelso.%0AElsewhere%2C+Dr.+Cox+gives+Elliot+the+evil+eye+when+she+won%27t+discharge+a+troublesome+patient.%0A","7.3","56");
INSERT INTO `series_episodes` VALUES("184612","1","1","1","My+Own+Personal+Jesus","11","1","1008025200","76156","It%27s+Christmas%2C+and+even+though+J.D.+and+the+others+don%27t+really+feel+like+celebrating%2C+Turk+makes+a+huge+deal+about+it.+But+his+faith+and+happiness+are+gone+after+a+very+busy+night+at+the+hospital.%0ADr.+Cox+has+J.D.+videotape+the+birth+of+the+child+of+one+of+his+friends.%0A","7.4","55");
