INSERT INTO `series_episodes` VALUES("184620","1","1","1","My+Old+Man","19","1","1018303200","76156","An+assortment+of+moms+and+dads+descend+on+their+offspring+at+home+and+in+the+workplace.+J.D.%27s+father+is+a+gregarious+yet+lonely+divorcee+who%27s+desperately+trying+to+be+just+one+of+the+guys.+Elliot%27s+folks%2C+on+the+other+hand%2C+are+a+snooty+couple+whose+pompous+behavior+dismays+their+daughter.+Similarly+rattled+is+Turk%2C+unnerved+by+the+bonding+of+his+girlfriend%2C+Carla%2C+and+his+brassy+mother.+But+the+most+vexatious+parent+by+far+is+the+janitor%27s+dad.%0A","7.7","49");
