INSERT INTO `series_episodes` VALUES("432104","1","1","1","Webisode+1+-+Our+Intern+Class","1","0","1230764400","76156","Sunny%2C+a+new+intern+at+Sacred+Heart+Hospital+explains+that+she+thought+it+would+be+fun+to+document+her+first+year+at+the+hospital+with+a+video+diary.+She+double+majored+in+Pre-Med+and+Film+at+college%2C+so+she+promises+they+won%27t+be+boring.+Using+freeze+frames%2C+she+introduces+herself+and+explains+her+nickname%2C+Katie+as+possibly+two-faced%2C+Howie+as+snarky%2C+Ed+as+always+late%2C+and+Denise+as+her+new+Besty%2C+but+Denise+comes+off+as+kind+of+a+bully.%0A%0AIn+orientation%2C+Ted+tells+the+interns+that+lawsuits+are+bad+and+that+they+should+never+tell+a+patient+if+they+make+a+mistake.+Dr.+Cox+enters+the+orientation+and+tells+the+interns+that+it+will+not+be+a+fun+year+for+anybody%2C+and+when+Sunny+tells+her+camera+she+is+still+going+to+enjoy+it%2C+he+confiscates+her+camera.%0A%0ALater%2C+Sunny+tells+the+camera+that+a+Janitor+sold+her+her+camera+back%2C+and+pays+The+Worthless+Peons+to+perform+a+theme+song+for+her+video+diary.+","6.7","6");
INSERT INTO `series_episodes` VALUES("432105","1","1","1","Webisode+2+-+Our+Meeting+with+J.D.","2","0","1231282800","76156","Sunny+set+up+cameras+around+the+classroom+so+her+diary+would+be+exciting.+She+is+listening+to+Katie%27s+and+Denise%27s+conversation+about+their+sex+lives.+Katie+finds+it+hard+to+be+sexually+active+because+of+how+busy+she+is+at+Sacred+Heart.+She+then+rejects+Howie%27s+offer.+Denise+states+that+she+like+guys+with+some+meat+on+them+because+they+%22try+harder%22.%0A%0ADr.+John+Dorian+enters+the+room%2C+apologizes+for+having+to+leave%2C+and+continues+giving+a+lesson+about+hospital+vernacular.+He+explains+many+acronyms+such+as+CTD+%28circling+the+drain%29%2C+T.C.W.+%28tasty+coma+wife%29%2C+%22gomer%22+%28get+outta+my+emergency+room%29%2C+turfing+and+bouncing+%28send+patients+to+other+wards%29%2C+LGFD+%28looks+good+from+door%29+and+HFFA+%28hot+from+far+away%29.+He+then+ends+the+lecture+and+leaves.+Sunny+finds+a+strange+note+which+tells+her+%22Meeting+in+broom+closet+after+lecture.+Be+there.%22+which+none+of+the+other+interns+received.+","7","5");
INSERT INTO `series_episodes` VALUES("432106","1","1","1","Webisode+3+-+Our+Meeting+in+the+Broom+Closet","3","0","1231801200","76156","After+Sunny+received+her+mysterious+note+when+she+was+in+lecture+with+J.D.%2C+her+and+Howie%2C+Denise+and+Katie+visit+the+broom+closet.+There%2C+a+shelf+slides+away+revealing+a+man+sitting+at+a+desk.+The+man+is+Janitor.+He+lays+down+some+ground+rules+for+their+behavior+at+Sacred+Heart.+He+tells+them+that+they+are+not+allowed+to+wrong+him+or+enter+Brain+Trust+headquarters.+Janitor+asks+if+anyone+likes+Dr.+John+Dorian%2C+to+which+Katie+says+yes%2C+and+he+kicks+her+out+of+his+office.%0A%0ATed+enters+and+notifies+Janitor+that+his+next+appointment+-+a+man+with+a+raccoon+-+has+arrived.+Janitor+then+kicks+the+interns+out+of+his+office.+","6.7","3");
INSERT INTO `series_episodes` VALUES("432107","1","1","1","Webisode+4+-+Screw+You+with+Ted+and+the+Gooch","4","0","1233010800","76156","Sunny+has+her+day+off%2C+so+instead+of+presenting+a+regular+episode+of+her+video+diary%2C+she+shows+Ted+and+a+girl+playing+ukulele+presenting+a+song%2C+and+calls+the+episode%3A+%22That+Bald+Sweaty+Lawyer+%26+The+Girl+that+he%27s+Sweet+on%22.+","7.5","4");
INSERT INTO `series_episodes` VALUES("432108","1","1","1","Webisode+5+-+The+Late+Night+with+Jimmy+Show","5","0","1233615600","76156","While+Sunny+tells+us+about+her+upcoming+class+with+Dr.+Turk%2C+suddenly+Jimmy+comes+into+the+room.+And+once+again%2C+he+is+touching+everybody%2C+everywhere.+Denise+actually+enjoys+the+touching%2C+Howie+not+so+much.+And+Katie+even+kisses+Jimmy.%0A%0AAfter+that%2C+Sunny+suddenly+can%27t+find+her+video+camera+anymore.%0A%0AAs+it+turns+out%2C+Jimmy+has+taken+it+from+her%2C+to+film+a+fake+talk+show+called+The+Jimmy+the+Orderly+Show.+In+it%2C+he+impersonates+the+talk+show+host+and+several+well+known+actors+from+TV+and+cinema.%0A%0AThen%2C+Sunny+comes+into+the+room%2C+where+Jimmy+is%2C+and+sees%2C+that+he+took+her+camery.+But+he+says%2C+that+he+only+borrowed+it+for+the+Jimmy+the+Orderly+Show.+And+since+every+Jimmy+the+Orderly+Show+ends+in+a+dance+off%2C+Sunny+and+Jimmy+began+to+dance.+","5.3","3");
INSERT INTO `series_episodes` VALUES("434990","1","1","1","Webisode+6+-+Our+Meeting+with+the+Brain+Trust","6","0","1234220400","76156","As+Sunny+busily+works+in+the+ward+at+Sacred+Heart%2C+she+tells+the+audience+that+she+captured+some+secret+footage+of+a+Brain+Trust+meeting.%0A%0AAt+the+meeting%2C+Janitor+calls+the+meeting+to+order+with+a+hammer+as+a+gavel.+He+explains+that+Doug+is+not+present+because+he+may+have+looked+at+Janitor+wrong.+Janitor+denies+Todd%27s+motion+to+date+Sunny%2C+and+also+denies+his+motion+to+go+shirtless+for+the+rest+of+the+meeting.+Ted+is+upset+because+it+is+very+hot+in+the+meeting.+Janitor+states+that+Sunny%27s+cameras+are+not+only+important+because+they+will+capture+the+Brain+Trust+so+children+can+later+learn+from+it%2C+but+also+so+she+can+make+Legal+Custodians%2C+a+sitcom+featuring+Janitor+and+Ted+as+parents.+Todd+wants+to+be+in+the+series%2C+but+Janitor+tells+him+that+they+will+just+CGI+in+a+child+later.%0A%0AThey+record+the+theme+sequence%2C+but+when+it+comes+time+to+shoot+the+pilot%2C+Janitor+tells+Sunny+to+write+the+script.+Sunny+tells+the+viewers+that+next+week+will+feature+the+pilot+episode+of+Legal+Custodians.+","6.5","2");
INSERT INTO `series_episodes` VALUES("448961","1","1","1","Webisode+7+-+Outakes+from+Legal+Custodians","7","0","1237330800","76156","Sunny+can%27t+help+but+sing+the+theme+song+to+Legal+Custodians+as+she+introduces+some+outtakes+for+the+new+series.%0A%0AIn+the+outtakes%2C+Janitor+argues+with+Ted+who+can%27t+seem+to+remember+any+of+his+lines.+Ted+also+complains+about+his+sweater+being+very+itchy%2C+and+tries+to+take+it+off%2C+but+the+Janitor+won%27t+let+him.+The+Janitor+also+quizzes+Ted+as+to+what+%22jump+the+shark%22+means%2C+and+he+can%27t+answer.+Ted+also+explains+that+he+has+never+had+to+memorize+a+closing+statement+for+a+court+case+before.+In+the+end%2C+Ted+can%27t+stand+his+sweater+anymore+and+ends+up+pulling+it+over+his+face%2C+running+into+a+wall%2C+and+falling+to+the+ground.%0A%0AAt+the+same+time%2C+Todd+hides+behind+the+couch+and+the+counter+holding+the+%22child%22+in+the+sitcom.+","0","0");
