INSERT INTO `series_episodes` VALUES("682061","1","1","1","Unseen+Skins+S1%3A+I+Mostly+Do","2","0","1423091155","79773","Shortly+after+Cassie+returned+from+the+clinic%2C+she+meets+up+with+Michelle.+There%2C+Michelle+offers+Cassie+a+spliff%2C+but+she+informs+Michelle+that+she+doesn%27t+smoke+any+more+because+she+no+longer+does+anything+that+makes+her+hungry.+Then%2C+whilst+Cassie+and+Michelle+are+walking%2C+Michelle+asks+Cassie+to+do+a+favour.+Cassie%2C+without+knowing+what+the+favour+is%2C+agrees+to+it.+Michelle+then+tells+Cassie+that+Sid+is+in+love+with+her+and+the+she+really+needs+Cassie+to+shag+Sid.+They+then+walk+in+to+a+wedding+clothes+shop.+Where+Cassie+suggests+that+they+try+on+the+clothes%3B+Cassie+being+Tony+and+Michelle+herself.+At+which+point+the+shopkeeper+arrives+and+asks+them+to+leave.+Cassie+tell+the+shopkeeper+that+Michelle+is+pregnant+and+that+her+man+has+chosen+to+do+the+right+thing+in+marrying+her.+Cassie+then+tells+Michelle+to+faint%2C+and+for+the+shopkeeper+to+fetch+some+water.+She+does+this+to+get+rid+of+the+shopkeeper+and+so+that+they+can+try+on+the+wedding+clothes.+They+then+run+out%2C+to+the+sound+of+wedding+bells%2C+where+Michelle+complains+that+they+are+%22the+most+visible+fugitives+ever%22.+To+which+Cassie+replies+that+the+shopkeeper+was+a+nasty+person+and+that+her+New+Year%27s+resolution+is+that+%22nasty+people+don%27t+count%22+and+that+she+is+a+new+person.+Michelle+tells+Cassie+that+she+missed+her%2C+saying%2C+%22I+love+you%2C+you+know%3F%22+to+which+Cassie+responds%2C+%22Yeah%2C+I+mostly+do.%22","0","0");
