INSERT INTO `series_episodes` VALUES("1585751","1","1","1","Unseen+Skins+S1%3A+Shoot+%27Em+Up+Bang+Bang+Props+to+the+Hood","4","0","1423091155","79773","The+episode+opens+with+a+screen+that+states+that+Ace+and+Lynton+are+attempting+to+get+a+DJ+to+play+their+music.+It+is+written+twice%2C+once+above+in+Ebonics+and+below+in+%22proper%22+English.+Ace+and+Lyton+are+having+a+conversation+in+some+form+of+Ebonics+with+subtitles+in+%22proper+English%22.+They+mention+a+plan+to+see+Stuart+Elmore%2C+a+DJ+with+a+lot+of+connections.+They+then+mention+that%2C+when+they+arrive+at+the+station%2C+they+need+to+be+talking+%22proper+English%22.+When+they+arrive+at+the+station%2C+they+starting+in+%22proper+English%22%2C+there+are+now%2C+Ebonics+subtitles.+Ace+then+asks+Lynton+to+show+the+receptionist+the+mix+tapes+that+he+is+carrying.+Lynton+tells+Ace+that+the+bag+contains+a+pineapple.+They+once+again+mention+their+motto+-+%22Bang+bang+shoot+em+up%2C+props+to+the+hood%22+%28subtitled+in+Latin%29%2C+and+the+receptionist+responds+with+Ebonics+and+says%2C+%22Papoose%2C+he+is+truly+shower%22.+They+then+offer+to+perform+a+demo%2C+which+they+do.+The+receptionist+says+that+they+are+good+and+then+tries+to+get+them+on+air.+She+sends+them+up%2C+where+they+perform+a+very+long+intro+to+the+rap.+They+then+start+the+rap%2C+but+they+are+cut+and+thrown+out+because+of+the+use+of+a+swear+word.+Afterwards%2C+the+receptionist+expresses+sympathy+with+them+outside%2C+and+they+sign+Lyton%27s+hat+and+give+it+to+her.","0","0");
INSERT INTO `series_episodes` VALUES("1585761","1","1","1","Unseen+Skins+S1%3A+A+Friend+in+Need","5","0","1423091155","79773","Cassie+walks+up+to+another+student+and+asks+him+for+his+top%2C+explaining+that+it%27s+not+for+her+it%27s+for+a+friend.+Anwar+bets+Maxxie+%C2%A35+that+she+won%27t+get+it%2C+Maxxie+takes+up+the+bet.+She+eventually+does.+She+then+tries+to+get+his+jeans%2C+but+he+overhears+and+runs+off.+Then+George+walks+along%2C+Michelle+tries+to+get+his+jeans.+Maxxie+bets+%C2%A310+that+she+can%27t%2C+which+Anwar+takes+up.+George+decides+not+to.+Maxxie+says%2C+%22Double+or+quits%22+to+if+he+can+get+George%27s+jeans.+George+gives+up+his+jeans+and+then+Maxxie+kisses+George%2C+and+to+the+realization+that+George+is+also+gay%2C+Anwar+exclaims%2C+%22The+whole+fucking+world+is+gay%22.+The+rest+of+the+scenes+are+from+the+episode.","0","0");
INSERT INTO `series_episodes` VALUES("1585771","1","1","1","Unseen+Skins+S1%3A+Careers+Advice+II","6","0","1423091155","79773","Initially%2C+the+careers+adviser+is+working+on+her+own+application+form.+She+calls+Sid+for+help%2C+but+he+isn%27t+there.+Anwar+enters+the+careers+office+in+a+ninja+costume.+The+careers+adviser+shrugs+her+shoulder+and+Anwar+asks+is+it+because+%22a+brown+man+can%27t+be+a+ninja%3F%22+He+then+performs+a+routine+with+nunchucks.+The+careers+adviser+is+impressed%3B+Anwar+asks+which+gang+he+can+be+a+part+of.+The+careers+adviser+tells+him+that+she+can%27t+help.%0A%0ATony%27s+questionnaire+says+that+he+can+be+anything+that+he+wants+to+be.+The+careers+adviser+asks+what+he+wants+to+be%2C+to+which+he+replies+%22Elvis%22.+The+careers+adviser+says+that+she+%22just+wanted+to+make+a+difference%22.+Tony+asks+her+if+she+is+%22more+of+a+Beatles+fan%22%2C+leaving+by+calling+her+a+%22hippie%22.%0A%0AMichelle+then+enters%2C+at+which+point+the+careers+adviser+is+under+the+desk.+Michelle%E2%80%99s+questionnaire+says+that+she+is+very+good+at+languages.+They+then+start+talking+in+French.+The+careers+adviser+shows+prospectuses+and+Michelle+tells+her+that+she+wants+to+go+to+a+university+that+is+far%2C+far+away%2C+to+which+the+careers+adviser+suggests+The+University+of+Strathclyde+%28which+in+fact+does+not+have+a+specific+Languages+course%29.+It+instead+runs+individual+language+courses.","0","0");
