INSERT INTO `series_episodes` VALUES("189255","1","1","1","12%3A00+A.M.-1%3A00+A.M.","1","1","1005001200","76290","It+is+California+Presidential+Primary+Day+in+Los+Angeles+and+the+longest+day+of+Federal+Agent+Jack+Bauer%27s+life+is+about+to+begin.+Jack+has+just+patched+his+family+back+together+after+a+trying+separation.+Midnight+finds+Jack+playing+chess+with+his+teenage+daughter+Kim.+As+she+goes+to+bed%2C+Jack+gets+a+call+from+Nina+Myers%2C+his+coworker+at+the+Los+Angeles+Counter+Terrorist+Unit%2C+telling+him+to+come+in+for+an+emergency+meeting.+Jack+has+no+choice+but+to+report+in%2C+but+he+and+his+wife+Teri+learn+that+Kim+has+snuck+out+before+he+leaves.%0A%0AKim+and+her+friend+Janet+York+drive+to+an+empty+furniture+store+where+they+party+with+a+couple+of+college+guys+whom+they+recently+met.+Kim+enjoys+herself+at+first%2C+but+starts+to+become+suspicious+of+the+two+men+when+they+won%27t+take+her+home.%0A%0AAt+CTU%2C+Jack+learns+that+an+assassination+attempt+is+being+planned+against+Senator+David+Palmer%3B+the+first+African-American+presidential+candidate+with+a+serious+shot+at+the+White+House.+Jack%27s+boss+and+friend%2C+Richard+Walsh%2C+warns+him+that+people+in+their+own+agency+may+be+working+with+those+who+plan+to+kill+Palmer.%0A%0ASenator+David+Palmer+is+making+his+plans+for+Primary+Day+when+he+receives+a+strange+phone+call+that+puts+him+in+a+bad+mood.%0A%0AJack+shows+how+far+he%27s+willing+to+go+to+do+his+job+when+he+blackmails+District+Director+George+Mason+in+the+hopes+of+learning+information+about+the+Palmer+hit.%0A%0ATeri+receives+a+call+from+Janet%27s+father%2C+Alan+York%2C+and+the+two+decide+to+go+out+looking+for+the+girls.%0A%0AA+European+photographer+makes+pleasant+conversation+with+a+beautiful+woman+on+a+plane+bound+for+LA.+The+two+end+up+in+a+lustful+encounter%2C+but+more+sinister+plans+come+to+light+that+involve+a+stolen+wallet+and+the+destruction+of+the+airplane.%0A","7.3","99");
INSERT INTO `series_episodes` VALUES("189256","1","1","1","1%3A00+A.M.-2%3A00+A.M.","2","1","1005606000","76290","Jack%27s+plans+to+find+Kim+are+sidetracked+when+he+gets+a+call+from+Walsh%2C+who+is+being+stalked+by+assassins+connected+with+the+Palmer+hit.+Jack+comes+to+Walsh%27s+rescue+and+Walsh+gives+him+a+key+card+containing+valuable+information.%0A%0APalmer+learns+of+the+possible+threat+against+his+life%2C+but+slips+away+from+his+security+in+order+to+learn+more+about+a+damaging+story+that+is+about+to+hit+the+press.%0A%0ADan+and+Rick+start+to+become+violent+when+Kim+refuses+to+make+a+phone+call+for+them.%0A%0AMandy+meets+with+the+man+behind+the+Palmer+hit%2C+but+her+partner+holds+things+up+when+she+demands+more+money+for+the+ID.%0A","7.4","72");
INSERT INTO `series_episodes` VALUES("189257","1","1","1","2%3A00+A.M.-3%3A00+A.M.","3","1","1006210800","76290","Jack+learns+the+identity+of+the+agent+who+may+be+working+against+him.+He+acquires+Jamie%27s+help+to+get+evidence.%0A%0APalmer+finally+learns+of+the+damning+story+about+to+hit+the+press%2C+involving+his+son+and+a+possible+murder+several+years+ago.%0A%0AKim+and+Janet+manage+to+escape+their+captors.+Kim+is+able+to+get+a+message+to+Teri%2C+but+an+accident+results+in+her+recapture.%0A%0ATony+calls+for+outside+help+when+he+decides+that+Jack+should+be+relieved+of+his+command.%0A","7.6","63");
