INSERT INTO `series_episodes` VALUES("189262","1","1","1","7%3A00+A.M.-8%3A00+A.M.","8","1","1011049200","76290","Nina+and+Tony+discover+the+identity+of+the+mole+who+is+working+for+Gaines.%0A%0ATeri+and+Kim+are+finally+reunited.%0A%0AStill+under+Gaines%27+control%2C+Jack+goes+to+the+Palmer+breakfast%2C+where+he+learns+what+Gaines+has+planned+for+him.++Jack+manages+to+foil+the+assassination+attempt%2C+but+is+captured+by+Secret+Service+in+the+process.%0A","7.5","56");
