INSERT INTO `series_episodes` VALUES("189264","1","1","1","9%3A00+A.M.-10%3A00+A.M.","10","1","1012863600","76290","Teri+manages+to+call+CTU+using+a+stolen+cell+phone.+She+and+Jack+have+an+emotional+conversation%2C+but+her+signal+dies+before+the+call+can+be+traced.%0A%0ANina+and+Tony+find+themselves+facing+a+new+boss%2C+Alberta+Green%2C+as+they+continue+to+secretly+help+Jack.%0A%0APalmer%27s+political+associates+begin+to+sweat+as+Carl+plans+to+take+serious+action+against+Keith%27s+therapist.%0A%0AJack+uncovers+a+new+name+from+the+key+card+that+may+lead+him+to+Gaines.%0A","7.4","57");
