INSERT INTO `series_episodes` VALUES("303030","1","1","1","The+Detail","2","1","1023573600","79126","%22You+cannot+lose+if+you+do+not+play.%22+-+Marla+Daniels%0A%0AThe+witness+who+testified+against+D%27Angelo+winds+up+being+a+murder+case+for+%22Bunk%22+Moreland.+However%2C+McNulty+tells+Bunk+that+since+the+victim+testified+against+D%27Angelo%2C+this+murder+was+probably+ordered+by+Avon+Barkdsdale.+McNulty+and+Bunk+pick+up+D%27Angelo+for+questioning+and+convince+him+to+write+an+%22apology%22+to+the+victim%27s+family.+Just+as+he%27s+about+to+start%2C+D%27Angelo%27s+attorney+arrives+and+makes+him+leave.+Meanwhile+in+%22The+Pit%22%2C+Detective+Greggs+gets+some+inside+information+courtesy+of+Bubbles.+New+investigation+team+member+Prez+arrives+with+a+heavy+reputation+of+incompetence%2C+which+worries+Lieutenant+Daniels.+Daniels%27s+concerns+are+supported+when+Prez+teams+up+with+Herc+and+Carver+to+make+their+own+moves+in+the+case+by+going+to+the+projects+to+%22bust+heads%22+for+information.+Things+backfire+and+a+quasi+riot+ensues.","7.5","82");
INSERT INTO `series_episodes` VALUES("303031","1","1","1","The+Buys","3","1","1024178400","79126","%22The+king+stay+the+king.%22+-+D%27Angelo%0A%0AAfter+early+morning+%22field+interviews%22+conducted+by+Herc%2C+Carver+and+Prez+lead+to+a+minor+riot+and+bad+publicity+for+the+police%2C+Daniels+gets+called+in+by+the+Deputy+Commissioner.+McNulty+sends+Mahone+and+Polk+to+the+terrace+to+get+a+photo+of+Avon+Barksdale.+They+come+up+short+but+soft-+spoken+Freamon+comes+through+with+an+old+photo+from+Barksdale%27s+boxing+days.+McNulty+and+Greggs+visit+FBI+agent+Fitzhugh+to+try+and+obtain+some+surveillance+equipment.+D%27Angelo+delivers+the+daily+count+to+Stringer+Bell+who+in+turn%2C+gives+D%27Angelo+a+bonus.+Later%2C+while+Bodie+and+D%27Angelo+wait+for+the+new+supply+to+arrive%2C+D%27Angelo+offers+to+get+food.+While+he%27s+gone+Bodie%2C+Stinkum+and+the+crew+go+to+retrieve+the+new+supply+only+renegade+dealer+Omar+and+his+crew+get+there+and+steal+the+drugs+for+themselves.+The+next+day+D%27Angelo+gets+chewed+out+by+Wee+Bey+--+a+Barksdale+enforcer+--+for+not+being+around+when+the+incident+happened.+After+getting+chided+by+his+superiors%2C+Lieutenant+Daniels+mobilizes+the+team+to+raid+%22The+Pit%22.+Bodie+hits+one+of+the+detectives+while+getting+arrested+and+the+rest+of+the+officers+proceed+to+beat+Bodie.+McNulty+secretly+meets+with+agent+Fitzhugh+who+tells+him+to+watch+out+for+Lieutenant+Daniels+--+who+might+be+on+the+take.","7.6","66");
INSERT INTO `series_episodes` VALUES("303032","1","1","1","Old+Cases","4","1","1024783200","79126","%22It%27s+a+thin+line+%27tween+heaven+and+here.%22+-+Bubbles%0A%0ABodie+manages+to+slip+through+security+and+escape+from+lockup.+Meanwhile+Herc+and+Carver+continue+their+renegade+ways+by+travelling+to+Marlboro+to+find+Bodie+and+beat+him+into+giving+up+information+on+the+case.+Once+they+get+there%2C+Herc+has+a+change+of+attitude+after+meeting+Bodie%27s+grandmother.+Furious+at+being+robbed+of+his+product+during+the+%22re-up%22%2C+Avon+Barksdale+instructs+Stinkum%2C+Wee-Bey+and+Stringer+to+double+the+existing+reward+to+anyone+who+eliminates+Omar+and+his+crew.+When+Bodie+returns+to+the+pit%2C+he+explains+how+no+jail+can+hold+him+because+he%27s+too+tough.+He+further+challenges+D%27Angelo%27s+mettle+by+implying+that+D%27Angelo%27s+weak.+D%27Angelo+responds+by+telling+how+he+killed+one+of+Avon+Barksdale%27s+ex-girlfriends+after+she+threatened+to+give+Avon+up+to+the+police.+AFter+hearing+this%2C+Bodie+becomes+cautiously+impressed.+Sgt.+Landsman+tells+Major+Rawls+that+despite+all+the+screw+ups%2C+McNulty%27s+tenacity+and+obsession+with+getting+the+job+done+usually+results+in+closed+cases+and+that+the+Major+should+probably+cut+McNulty+some+slack.+Detective+Freamon+discovers+D%27Angelo%27s+pager+number+just+when+Greggs+and+McNulty+figure+out+a+cloned+pager+could+be+the+advantage+they+need.","7.6","63");
INSERT INTO `series_episodes` VALUES("303033","1","1","1","The+Pager","5","1","1025388000","79126","%22..a+little+slow%2C+a+little+late.%22+-+Avon+Barksdale%0A%0AAvon+becomes+more+and+more+suspicious%2C+he+orders+Wee-Bey+to+change+phone+lines+in+his+apartment+and+promotes+Stinkum+to+manage+a+new+territory.+He+gets+word+that+one+of+Omar%27s+crew+members+has+been+%22got%22.+Stringer+Bell+warns+D%27Angelo+that+a+snitch+may+be+in+his+camp.+The+detectives+get+their+affidavit+approved+for+a+cloned+pager+but+they+are+puzzled+when+the+numbers+they+receive+are+not+regular+Baltimore+phone+numbers..+Herc+and+Carver+catch+up+with+Bodie+and+attempt+to+interrogate+him.","7.7","67");
