INSERT INTO `series_episodes` VALUES("305872","1","1","1","Pilot","1","1","1127167200","75397","Today+is+the+first+day+of+the+rest+of+Earl+Hickey%27s+life.+After+coming+into+a+%24100%2C000+scratch-off+lottery+ticket+and+losing+it+just+as+fast+upon+being+hit+by+a+car%2C+Earl+has+an+epiphany+in+the+hospital--to+make+up+for+all+the+terrible+things+he%27s+done+in+the+past.+With+his+brother+Randy+and+a+motel+maid+named+Catalina%2C+Earl+writes+up+a+list+of+every+misdeed+he+was+a+part+of.+Earl+sets+out+to+do+just+that%2C+starting+with+%2364--Kenny+James%2C+a+boy+he+picked+on+in+elementary+school.%0A%0ARecap%0A%0AWhen+we+meet+Earl+Hickey%2C+he+describes+himself+as+%22that+guy+you+see+going+into+the+convenience+store+when+you+stop+off+in+that+little+town+on+the+way+to+Grandma%27s+house--sorta+shifty+looking+fellow+who+buys+a+pack+of+smokes%2C+a+couple+lotto+scratchers+and+a+tallboy+at+10+in+the+morning.%22+He%27s+a+petty+thief+who+proceeds+to+steal+some+CDs+and+a+flag+from+a+van+parked+outside+of+the+aforementioned+convenience+store.%0A%0AEarl%27s+narration+introduces+us+to+Joy%2C+his+unfaithful+wife+of%2C+presumably%2C+six+years.+He+also+introduces+his+two+children+%28neither+of+which+he+fathered%29%2C+Dodge+and+Earl+Jr%2C+and+his+brother+Randy.+The+narration+montage+also+introduces+Darnell%2C+an+employee+at+Ernie%27s+Crab+Shack+and+also+the+father+of+Earl+Jr.%0A%0AThis+all+brings+us+to+three+weeks+ago.+Earl+gets+his+due+in+the+form+of+a+%24100%2C000+scratch+off+ticket...+only+to+promptly+lose+it+when+he+runs+into+traffic+and+gets+hit+by+a+car.+He+wakes+up+in+a+hospital+with+an+injured+leg+and+neck%2C+a+morphine+drip%2C+and+divorce+papers+from+Joy.+While+flipping+channels+on+the+television%2C+Earl+stops+on+Carson+Daly%27s+late+night+talk+show.+Carson+recites+his+philosophy+on+karma+and+it+inspires+an+epiphany+in+Earl.+After+he%27s+released%2C+he+and+Randy+get+set+up+in+a+motel+room%2C+where+Randy+quickly+makes+nice+with+the+maid%2C+Catalina.+Earl+decides+that+he+will+write+out+a+list+of+all+of+the+bad+things+he%27s+done+and+sets+out+to+right+his+wrongs.+He+starts+with+%23136%2C+being+a+litterbug.+Right+after+throwing+away+garbage+in+the+motel+parking+lot%2C+the+winning+lottery+ticket+appears+at+his+feet.+%22Son+of+a+bitch%2C+it%27s+working%21%22%0A%0AEarl+makes+his+way+down+to+%2364%2C+Kenny+James.+He+had+picked+on+Kenny+relentlessly+in+elementary+school+and+has+set+out+to+make+it+up+to+him.+After+an+incident+with+Kenny%27s+parents%2C+Randy+finds+out+Kenny%27s+address+and+the+two+drive+off+to+see+what+they+can+do+for+him.+They+discover+that+although+he+has+%22a+good+job+as+an+assistant+manager+of+the+CopyHut%2C+a+powder+blue+LeCar+he+took+pride+in+and+the+nicest+house+on+the+block%2C%22+he+has+no+one+to+share+it+with.+Naturally%2C+Earl+sets+out+to+get+Kenny+laid.%0A%0AEarl+pays+Patty%2C+a+daytime+hooker%2C+to+go+to+Kenny%27s+house+and+have+sex+with+him.+Under+the+ruse+of+Greenpeace%2C+Patty+goes+to+work%2C+only+to+be+rejected.+Earl+and+Randy+go+inside+to+see+what+the+deal+is%2C+only+to+discover+that+Kenny+is+gay.+Earl+flees+from+Kenny%27s+house+and+marks+him+off+the+list+due+to+%22special+circumstances.%22%0A%0ARight+after+he+marks+Kenny+off+the+list%2C+his+ex-wife+Joy+hits+him+over+the+head+with+a+telephone+in+his+motel+room.+Joy+threatens+him%2C+demanding+half+of+his+%24100%2C000+prize+money.+Earl+writes+it+off+as+karma+again+and+decides+to+take+another+crack+at+helping+Kenny.+Earl+settles+on+taking+Kenny+to+a+gay+bar+in+the+city+to+boost+his+confidence.+Once+the+three+%28Randy+went+along+because+Earl+didn%27t+want+to+be+the+only+straight+guy+in+a+gay+bar%29+went+into+the+club+and+Kenny+saw+someone+he+liked%2C+he+realized+that+if+Earl%2C+the+one+person+he%27s+been+most+terrified+of%2C+will+accept+him+for+who+he+is+then+everyone+else+should%2C+too.+He+leaves+with+his+confidence+fully+intact+and+Earl+leaves+with+one+more+entry+marked+off+his+list.+%0A%0A","7.8","45");
INSERT INTO `series_episodes` VALUES("305873","1","1","1","Quit+Smoking","2","1","1127772000","75397","Earl+must+make+amends+to+Donny%2C+an+intimidating+thug+who+spent+two+years+in+jail+for+a+robbery+Earl+committed.+Oddly+enough%2C+the+only+way+he+can+do+this+is+by+helping+Donny%27s+mom+quit+smoking.%0A%0AMeanwhile%2C+Joy+discovers+she%27s+the+beneficiary+of+Earl%27s+will+and+decides+to+kill+him%21%0A%0A","7.6","36");
INSERT INTO `series_episodes` VALUES("299605","1","1","1","Randy%27s+Touchdown","3","1","1128376800","75397","Back+in+their+high+school+days%2C+Earl+ruined+Randy%27s+chance+to+score+a+touchdown+during+a+key+football+game%3B+now+Earl+must+figure+out+a+way+to+make+things+right.%0A%0ARecap%3A%0A%0AThe+third+episode+of+My+Name+Is+Earl+takes+a+different+approach+then+the+last+two.+Earl+adds+a+new+quest+to+his+list+and+that+is+getting+Randy+a+touchdown+in+High+school+football.+The+story+behind+it+is+that+Earl+bet+money+that+Randy%27s+team+would+lose+while+he+was+playing+football.+Randy+helped+out+by+playing+horribly%2C+but+the+last+play+of+the+game%2C+down+by+one+touchdown%2C+Randy+finds+he+has+the+ball+and+starts+running+to+the+end+zone.+He+realizes+he+could+actually+score+a+touchdown+but+chooses+to+fumble+the+ball+and+lose+the+game.+Earl+feels+so+bad+about+doing+that+he+gets+Randy+back+in+to+High+school+with+the+worst+football+team+in+the+area.%0AMeanwhile+Earl%27s+ex-wife+Joy+has+Earl%27s+car+towed%2C+along+with+his+money+hidden+under+the+driver%27s+seat.+When+Earl+and+Randy+go+to+question+Joy%2C+Randy+accidentally+reveals+where+the+money+is+hidden.+The+chase+is+on%21+Earl+gets+to+the+car+lot+first+but+the+people+working+there+wont+let+him+near+the+car+until+he+pays+the+%243%2C000+in+parking+violations+on+it.+Joy+soon+shows+up+and+gets+the+same+answer.+So+now+Earl+has+to+come+up+with+%243%2C000+to+get+his+car+and+lottery+money+back.+He+knows+there+is+no+way+to+get+that+much+money+so+he+has+to+break+in+and+steal+the+car.+His+plan+comes+to+him+when+Randy+is+studying+up+on+History.+The+Trojan+Horse%2C+but+instead+a+car+with+someone+hiding+in+the+trunk.%0AJoy+is+still+trying+to+get+the+money%2C+too.+She+pawns+a+bunch+of+things+and+gets+closer+to+the+%243%2C000.+Earl+gets+his+recently+redeemed+friend+Kenny+to+help.+Kenny%27s+friend+has+a+car+they+can+use+to+get+towed.+After+Earl+fails+to+fit+in+the+tiny+trunk%2C+Kenny+offers+to+do+it+for+him.+This+leaves+Earl+and+Catalina+free+to+go+to+Randy%27s+Football+game.+He+doesn%27t+score+a+touchdown+until+the+final+play+of+the+game%2C+in+the+huddle+of+the+team%2C+Randy+says+to+give+the+ball+to+him.+They+hike+and+hand+the+ball+off+to+him+and+he+starts+to+run+for+the+end+zone.+He+is+almost+there+and+he+tries+to+kick+the+ball+over+his+head+and+catch+it+as+he+walks+in+to+the+end+zone%2C+but+he+fumbles+and+the+other+team+recovers.+Earl+can%27t+believe+and+neither+can+Randy.+He%27s+so+depressed+he+walks+off+the+field+slowly.%0AAs+Earl+and+Catalina+try+to+find+Randy+and+wait+for+Kenny+to+return%2C+Joy+drives+by.+She+has+the+%243%2C000+and+is+on+her+way+to+get+Earl%27s+car.+Earl+tries+to+run+after+her+but+after+about+15+steps+stops.+Out+of+breath.+Things+look+bad+for+Earl+but+just+then+he+sees+his+car+driving+down+the+road+and+Randy%27s+driving+it.+Earl+is+dumbfounded.+Randy+explains+to+him+he+bet+%243%2C000+they%27d+lose+the+football+game.+So+he+had+purposely+fumbled%2C+losing+the+game.+He+used+the+money+to+get+Earl%27s+car+back.+Thing+is%2C+Earl+wanted+Randy+to+get+that+touchdown%2C+but+Randy+explains+he+cared+about+Earl+and+his+needs+more+then+a+touchdown.+Very+heart+filing+episode.+%0A","7.8","32");
INSERT INTO `series_episodes` VALUES("299606","1","1","1","Faked+His+Own+Death","4","1","1128981600","75397","When+Earl+meets+a+tough+biker+chick+at+a+Halloween+party%2C+it+looks+like+a+match+made+in+heaven--but+when+the+costumes+come+off%2C+the+mismatch+becomes+apparent+and+Earl+takes+drastic+measures+to+get+out+of+the+relationship.++Now%2C+years+later%2C+Earl+must+find+a+way+to+make+amends+for+deceiving+the+girl.%0A","8","27");
INSERT INTO `series_episodes` VALUES("299607","1","1","1","Teacher+Earl","5","1","1129586400","75397","Earl+decides+to+teach+English+as+a+Second+language+to+cross+%22Made+fun+of+people+with+accents%22+off+his+karma+list.+While+Ralph+an+old+friend+is+released+from+prison%2C+Earl+tries+to+convince+him+in+the+ways+of+karma+however+Ralph+ends+up+kidnapping+Randy+trying+to+get+his+hands+on+Earl%E2%80%99s+lotto+winnings.%0A%0A%0ARecap%3A%0A%0AEarl+loved+to+make+fun+of+people+with+funny+accents+and+because+of+Karma%2C+he+wants+to+pay+back+all+the+people+he+made+fun+of.+Scandinavian%2C+Hispanic+or+Asian%2C+he+laughed+at+them+all.+What+does+he+decide+to+do%3F+Teach+English+to+foreigners.%0A%0AWhile+Earl+and+Randy+are+getting+something+to+eat%2C+one+of+Earl%27s+old+friends%2C+Ralph+shows+up.+Turns+out+he+just+finished+up+18+months+in+prison.+Now+that+he%27s+out%2C+he%27s+eager+to+start+stealing+again.+Randy+and+Earl+tag+along+a+bit%2C+but+Earl+realizes+he+can%27t+do+this+anymore.+After+Ralph+steals+stuff+from+a+store%2C+takes+a+bridal+dress+and+throws+all+his+beer+cans+in+the+apartment+complex%27s+pool%2C+Earl+decides+he+has+to+tell+Ralph+about+the+List+and+his+changed+ways.+So+he+takes+all+of+Ralph%27s+stolen+stuff+and+cleans+up+the+pool.%0A%0AWhile+cleaning+the+pool%2C+Joy+shows+up+and+tells+Earl+he+can%27t+teach+English+anymore.+She+explains+that+one+of+Earl%27s+students+has+a+nail+business+next+door+to+Joy%27s+nail+business.+The+only+reason+people+go+to+Joy+is+because+she+speaks+English+so+she+doesn%27t+want+Earl%27s+students+to+learn.+Just+then+Ralph+walks+in+and+hears+them+talking+about+the+List.+Ralph+questions+Earl+and+he+has+to+explain+everything.+Ralph+doesn%27t+really+pay+attention+until+Earl+mentions+the+%24100%2C000+he+won.+Ralph+decides+to+give+Karma+a+chance+and+he+cleans+up.%0A%0ASoon+after%2C+Ralph+gets+a+job+and+an+apartment+room+next+door+to+Randy+and+Earl.+He+starts+working+at+a+Lamp+Store.+Earl+is+proud+of+Ralph+until+he+sees+that+he%27s+been+stealing+lamps+from+the+store.+He+decides+not+to+be+friends+with+Ralph+anymore+because+he+still+steals.+Randy+starts+to+hangout+with+Ralph+more+then+Earl+and+tells+him+that+it%27s+his+List+and+he+has+nothing+to+do+with+it.+Meanwhile%2C+Earl+teaches+his+that+%22One+block+right+then+two+blocks+left%22+is+how+to+get+to+his+house.+Back+at+Joy%27s+trailer+where+she+has+her+nail+business%2C+she+is+teaching+Earl%27s+student+to+speak+English.+Too+bad+she+is+really+teaching+her+to+say+disgusting+things+so+she+loses+all+her+customers.+When+Earl+is+back+at+his+room+he+gets+a+phone+call+from+Ralph+telling+him+that+while+Randy+and+him+were+stealing+from+a+house%2C+Randy+got+stuck+in+a+chimney.+Earl+goes+to+help+them+out%2C+but+it+was+just+a+trick+to+get+Earl+to+leave.%0A%0ARalph+hits+Randy+over+the+head+with+a+lamp+after+he+comes+out+of+the+bathroom+and+ties+him+up.+When+Randy+comes+to%2C+he+finds+himself+in+Earl%27s+room+with+Ralph+ripping+the+place+apart.+He+wants+Randy+to+tell+him+where+Earl+puts+his+money.+Randy+doesn%27t+tell+Ralph+until+he+drags+him+in+the+shower+and+sprays+hot+water+on+his+%22goods%22.+Randy+tells+him+that+the+money+is+in+a+safe+box+at+the+bank+and+Earl+has+the+only+key.+Just+then%2C+Earl+decides+to+head+back+to+his+room+because+he+can%27t+find+Randy+in+any+chimneys.+He+walks+in+his+room%2C+sees+Randy+tied+up+and+gets+smashed+in+the+head+by+a+lamp%2C+courtesy+of+Ralph.+When+Earl+regains+consciousness%2C+Randy+explains+that+Ralph+took+his+key+and+his+heading+to+the+bank+to+steal+his+money.%0A%0ARandy+apologizes+to+Earl+for+hanging+out+with+Ralph+even+after+he+stole+things+and+that+Karma+is+punishing+him+for+it.+He+tells+Earl+to+call+out+to+Karma+and+see+if+it+helps+them.+Earl+thinks+it%27s+silly+but+does+it+anyway.+After+calling+out+several+times%2C+his+door+opens+and+his+English+class+walks+in.+They+said+there+was+no+class+so+they+went+%221+block+right+then+2+blocks+left%22+and+came+to+Earl%27s+house.+Earl+quickly+calls+the+police+who+are+waiting+for+Ralph+when+he+shows+up+at+the+bank.+He+manages+to+run+away+from+them.+Earl+takes+his+class+out+to+eat+for+saving+him+and+Randy.+Another+check+off+the+List.+Just+then+Ralph+walks+in+and+gives+Earl+his+key+back.+He+apologizes+for+what+he+did+and+Earl+rightfully+forgives+him.+%0A","7.6","32");
INSERT INTO `series_episodes` VALUES("305874","1","1","1","Broke+Joy%27s+Fancy+Figurine","6","1","1130799600","75397","In+order+to+replace+a+fancy+figurine+that+he+broke%2C+Earl+lends+a+hand+to+help+Joy%27s+former+adversary+and+her+daughter+win+a+mother%2Fdaughter+beauty+pageant+.+However%2C+Joy+enters+the+pageant+also+with+her+%22dead%22+mother+trying+to+win+that+same+figurine%2C+hoping+to+trade+it+for+a+hot+tub.%0A%0ARecap%3A%0A%0AThe+episode+begins+with+Randy+sitting+down+at+the+bar.+Earl+walks+in+and+hands+a+cereal+box+to+Randy.+He+looks+very+happy.+Earl+tells+Randy+no+more+generic+cereal+for+him.+He+only+gets+the+best+now.%0A%0AWhen+Earl+and+Randy+get+back+to+the+apartment%2C+Joy+is+there+digging+through+all+of+their+stuff.+Earl+tells+Joy+she+isn%27t+getting+any+of+his+money.+She+tells+him+that+all+she+really+wants+his+a+hot+tub.+Earl+looks+on+his+list+and+sees+that+Joy+his+on+it.+He+tells+her+that+he+will+fix+that+so+she%27ll+leave+him+alone.+It+says+that+he+blew+up+Joy%27s+Trophy+but+he+can%27t+really+remember+what+it+was+for.+Later+that+night+he+dreams+about+it.+Randy+and+him+are+using+firecrackers+to+blow+stuff+up.+They+run+out+of+things+so+Earl+brings+Joy%27s+trophy.+It+is+a+little+girl+sitting+on+a+lawnmower+with+the+companies+name+on+it.%0A%0AThe+next+day+Earl+goes+to+the+company+and+asks+if+he+can+have+one+of+the+trophies.+The+lady+there+tells+him+that+the+trophies+are+given+out+to+the+winners+of+the+Lawn+Mower+companies+Mother+and+Daughter+beauty+pageant.+The+lady+remembers+when+Joy+won.+The+next+year+a+new+mother+and+daughter+entered+and+that+family+has+won+every+year+since.+Their+name+is+the+Stokers.+Earl+goes+to+the+mother+and+daughter+and+asks+if+he+can+have+one+of+their+trophies.+They+make+a+deal+that+if+Earl+helps+them+win+this+year%2C+they+will+give+him+the+trophy.+Earl+tells+Joy+he+is+going+to+enter+and+win+her+a+trophy.+She+doesn%27t+want+him+to+so+she+is+going+to+enter%2C+too.%0A%0AThe+beauty+pageant+is+also+has+a+talent+show+part.+The+reason+this+family+has+won+every+year+is+because+they+have+a+%22gift%22+in+which+they+can+throw+knives+with+amazing+accuracy.+Earl+is+placed+on+a+large+circle+which+spins+around+while+Ms.+Stoker+and+her+daughter+throws+knives+at+him.+Earl+finds+out+that+the+daughter%2C+Candy%2C+has+been+practicing+with+plastic+knives+and+she+hasn%27t+discovered+her+%22gift%22+yet.+This+greatly+worries+Earl.+Ms.+Stoker+gives+Candy+real+knives+and+has+her+try+it.+She+does+perfectly%2C+a+great+relief+to+Earl.%0A%0ALater%2C+when+Earl+is+alone+with+Candy%2C+she+tells+him+that+she+really+wants+to+become+a+doctor+and+not+enter+these+beauty+pageants.+Earl+convinces+her+that+she+has+to+do+it+for+him.+Meanwhile%2C+Joy+goes+out+and+tries+to+adopt+a+child%2C+with+little+luck.+So+she+calls+her+mother+and+asks+if+she+will+enter+with+her%2C+but+has+no+luck+either.+Joy+gets+an+idea.+Crabman+and+her+smoke+a+ton+of+cigarettes+and+fill+up+a+urn.+She+convinces+the+judges+at+the+pageant+it+is+her+mother%27s+ashes+and+they+allow+her+to+enter.%0A%0AWhile+all+this+is+going+on%2C+Randy+and+Catalina+hang+out+and+get+to+know+each+other+better.+The+pageant+begins+and+the+competition+is+fierce.+After+a+first+couple+of+groups+go%2C+Joy+comes+out.+She+is+wearing+a+skimpy+two-piece+swimsuit+carrying+her+mother%27s+urn.+She+sings+some+songs+and+even+starts+tap+dancing.+She+really+wants+to+win+this+pageant.+The+Stoker+family+is+about+to+come+out+and+Earl+is+getting+ready.+Backstage%2C+he+sees+Candy+and+she+looks+depressed.+He+talks+to+her+and+sees+that+she+is+unhappy.+He+tells+her+to+hit+him+in+the+leg+with+the+knife.%0A%0AThe+Stoker+family+comes+out+along+with+Earl.+Ms.+Stoker+goes+first+and+does+a+perfect+job.+Candy+steps+up%2C+throws+the+knife+and+it+flies+right+in+to+Earl%27s+leg%21+Earl+gives+Candy+a+thumbs+up+to+let+her+know+he%27s+ok%2C+aside+from+a+knife+in+his+leg.+He+tells+her+he+is+ok+and+that+he+has+been+stabbed+by+plenty+of+girls.+The+judges+come+out+and+announce+that+Joy+is+the+winner.+She+gets+a+trophy+and+Earl+realizes+that+he+did+the+right+thing.+Joy+got+her+trophy+back+and+he+can+cross+her+off+his+list.+%0A%0A","7.9","29");
