INSERT INTO `series_episodes` VALUES("299609","1","1","1","Joy%27s+Wedding","8","1","1132009200","75397","Darnell+and+Joy+decided+to+tie+the+knot+while+Earl+learns+thru+Randy%E2%80%99s+invitation+that+he+is+not+invited.++To+make+things+worse+Joy+has+scheduled+the+wedding+on+Earl%E2%80%99s+birthday+so+that+all+of+their+friends+will+be+unable+to+celebrate+with+him.+A+drunken+Earl+crashes+the+party+accidentally+breaking+Joy%E2%80%99s+nose+and+now+is+forced+to+add+%E2%80%9Cruined+Joy%E2%80%99s+wedding%E2%80%9D+to+his+list.%0A","7.6","34");
INSERT INTO `series_episodes` VALUES("299610","1","1","1","Cost+Dad+the+Election","9","1","1132614000","75397","Earl+tries+to+cross+of+number+four+off+his+list+%E2%80%9CBlew+dad%E2%80%99s+chance+to+be+elected+mayor%E2%80%9D.+Four+years+earlier%2C+Carl+Hickey+ran+for+mayor+to+redirect+a+proposed+airplane+traffic+route+over+his+house+and+away+from+the+wealthy+part+of+town.+Earl+unfortunately+ruins+any+chances+of+his+father+winning+when+caught+in+on+tape+assaulting+a+police+officer.++Earl+must+now+help+his+father+get+elected+and+mend+his+relationship+with+his+father.%0A%0A%0ARecap%3A%0A%0AIt+begins+with+hearing+Earl+talking+to+himself+that+he+is+not+too+eager+to+Cross+Number+86+off+his+list%2C+which+is%3A+%27Stealing+a+Car+from+a+%27One-legged+Girl%27+Well+but+he+overcomes+his+fear+and+goes+to+her+house.+He+tries+to+explain%2C+she+curses+at+him+and+then+her+no-legged%2C+but+fitted+with+prosthetic+legs%2C+boyfriend+runs+after+him%2C+and+as+we+know+the+Hickey+Boys+aren%27t+that+fast%2C+so+he+catches+up+with+him+and+beats+him+with+a+sign+which+he+takes+as+a+hint+from+%22Karma%22+that+he+should+be+somewhere+else+that+day.+He+thinks+about+that+while+getting+beaten+with+a+sign+which+says+%22Marty+Park+for+Mayor%22.+Which+brings+him+to+Number+4+on+his+list%3A+%22Blew+Dad%27s+Chance+to+get+elected+Mayor.%22+For+this+you+have+to+know+that+Earls+father+always+complained+about+things+and+never+did+anything+about+it.+But+when+they+put+the+airplane+route+right+above+his+neighborhood+he+decided+to+run+for+Mayor.+In+the+course+of+that+you+see+Earl+and+his+brother+always+getting+into+trouble%2C+first+as+children+and+then+as+young+adults+and+their+father+always+bailing+them+out+of+jail.+But+then+he+stopped+bailing+Earl+out.+But+his+opponent+used+the+bad+sons%2C+more+so+Earl+than+Randy+against+him+and+thereby+causing+him+to+lose+the+election.+They+didn%27t+talk+since+then.+Well%2C+so+much+for+the+past.+Now%2C+trying+to+make+things+right%2C+Earl+signs+him+up+to+run+for+Mayor+again.+And+even+finds+new+voters+to+register.+But+when%2C+due+to+Randy%27s+fault%2C+the+Voter+Registrations+are+flying+out+of+the+Car+and+due+to+a+misunderstanding+with+the+Police+while+trying+to+pick+up+the+voter+registrations+Earl+lands+himself+in+Jail.+All+this+is+caught+on+Tape+and+this+tape+is+later+used+by+his+opponent+which+causes+Earl%27s+Dad+to+lose+again.+Well+this+is+the+first+episode+with+an+open+end%2C+because+Earl+can%27t+cross+his+Dad+off+the+List.+But+at+the+end+of+the+episode+Dad+comes+to+Jail+and+when+they+get+out+of+the+Station%2C+his+Dad+%28excellent+performance+by+Beau+Bridges%29+says%3A+%22I+expect+you+to+pay+me+back+that+bail+money%22+and+Earl+is+happy+because+his+Father+hasn%27t+bailed+him+out+in+over+6+Years.+Then+at+the+very+end+of+the+episode+it+seems+they+will+be+a+family+again%2C+first+you+hear+a+short+monologue+by+Earl%2C+and+you+think+like+%22It%27s+not+gonna+work%22%2C+but+then+you+see+their+parents+at+home+again+%28which+you+did+a+couple+of+times+during+this+episode%29+and+Dad+says%3A+%22You+know+I+ran+into+John+Sheppard+down+at+the+Street+and+he+said+that+Earl+came+by+and+paid+for+a+Window+that+he+broke+15+years+ago%22+Mom+answers+%22Really%3F%22+and+Dad+goes+%22Ya%22.+Then+an+airplane+flies+over+the+house+again%2C+messing+all+the+picture+frames+hanging+on+the+wall%2C+as+it+happened+so+many+times+in+this+episode.+But+after+this+short+conversation+you+get+the+feeling+that+there+will+be+some+closure%2C+but+it%27s+gonna+take+a+lot+of+effort+on+Earls+Side.+After+this+you+see+Earl+and+his+brother+going+too+sleep%2C+but+Earls+brother+has+an+important+question+for+Earl%2C+which+is%2C+if+he+could+be+any+animal+in+the+world+which+would+he+be%3F+Earl+answers+him+that+he%27d+be+a+dog+because+they+are+allowed+to+be+inside+and+they+are+also+allowed+to+sit+on+the+couch.+Then+there+is+a+short+thing+about+cats+but+I+don%27t+wanna+get+into+that.+Randy%2C+by+the+way%2C+wanted+to+be+a+Monkey+but+decided+that+Earl+made+a+good+point+about+point+about+the+couch.+So%2C+what%27s+gonna+happen+to+Earl+and+his+parents%3F%0A%0A%0A","7.4","30");
INSERT INTO `series_episodes` VALUES("303118","1","1","1","White+Lie+Christmas","10","1","1133823600","75397","As+the+holiday+season+comes+under+way+a+few+secrets+are+exposed+when+Earl+attempts+to+cross+number+seventy-four+off+of+his+list%3A+%22always+ruined+Joy%27s+Christmas.%22+Earl%2C+Randy%2C+and+Catalina+enter+a+radio+contest+to+win+a+brand+new+car+for+Joy+to+make+up+for+all+of+the+thoughtless+Christmas+presents+Earl+gave+her+while+they+were+married.+While+Randy+and+Catalina+vie+over+the+car%2C+Earl+finds+out+that+Joy%27s+parents+believe+that+he%27s+still+their+son-in-law+and+that+he%27s+just+returned+from+the+war+in+Iraq.+Joy+is+afraid+to+tell+her+father%2C+an+alleged+racist%2C+that+she+is+now+married+to+Darnell%2C+so+Earl+plays+the+part%2C+afraid+of+ruining+another+one+of+her+Christmases.%0A%0A%0ARecap%3A%0A%0AOf+course+this+episode+is+again+about+doing+things+right%2C+but+with+a+little+difference%3A+This+time+there+are+other+people+too+who%2C+well+didn%27t+do+all+bad+things+BUT+they+all+have+secrets.%0AThis+episode+begins+with+a+contest.+The+contest+consists+of+the+following.+You+have+to+keep+at+least+one+hand+on+the+Car+which+you+can+win+at+all+times.+%28I+think+it%27s+a+Dodge+Neon..+but+I+am+not+sure%29%2C+Why+does+Earl+want+to+win+the+contest+when+he+got+a+perfectly+fine+%2773+Al+Camino+with+nice+%2777+Door+and+a+1987+Camero+Transmission.%3F+Of+course%21+It%27s+for+the+List%21+Number+74%3A+%27Always+ruined+Joys+Christmas%27.+You+see+a+few+examples.+2002%3A+He+gives+her+something+that+looks+like+empty+shell+casings+and+gets+asked%3A+What+shall+I+use+them+for%3F+And+he+says%3A+Whatever+you+like.%0A2003%3A+She+gets+flavored+condoms%0A2004%3A+She+gets+Keys+and+says%3A+%22Wait%2C+these+are+my+keys%3F%22+and+he+says%3A+%22Yes%2C+I+found+them%22+%28Very+funny+moment+in+this+episode%29.%0AWell%2C+we+are+back+at+the+contest.+His+brothers+asks%3A+%22What+does+she+need+a+new+car+for%2C+she+already+has+one%22+After+that+you+see+a+extremely+funny+scene+%28and+a+little+sad%29+where+she+and+Darnell+get+out+of+the+car+..+and+you+see+the+two+children+in+the+back+in+the+middle+of+the+rain.+And+that+kinda+makes+the+point+for+earl.+Back+at+the+contest.+Just+when+it+began+Earl+shakes+Randy%27s+hand%2C+and+as+this+was+his+only+hand+on+the+car%2C+Earl+is+out.+But+just+moments+before+Catalina+showed+up%2C+so+there+are+supposedly+two+people+working+for+Earl.+Earl+remarks+that+he+has+to+do+something+anyway.+Once+again+%28as+you+so+often+do%29+you+see+a+flashback.+You+see+Earl+and+Randy+in+front+of+the+TV+with+a+LOT+and+I+mean+A+LOT+of+Beer+Cans.+They+talk+about+that+they+have+no+more.+Then+Joy+comes+out+and+asks+if+the+Kids+Bikes+are+already+assembled.+Well+since+they+both+%28Earl+and+Randy%29+decide%2C+that+they+are+too+wasted+to+drive+they+decide+to+drive.+So+they+take+the+kids+bikes.+Earl+monologues%3A%22I+learned+a+valuable+lesson+this+night%3A+If+you+try+to+fly+a+big+you+better+make+sure+that+E.T.+is+on+the+back+and+not+a+12-pack+of+Beer%22.+On+the+next+day+of+the+flashback+you+see+the+kids+with+their+broken+bikes+and+Earl+remarks+%22You+must+have+been+bad+this+year%22%22+and+receives+a%2C+well+let%27s+call+it%2C+not+very+nice+look+of+Joy.+Back+at+present+time.+Earl+went+over+to+Joy+wanting+to+ask+what+color+the+kids+might+like+for+the+bikes+and+when+he+opened+the+doors+he+gets+greeted+by+Joys+Parents%3A+Buzz+and+Connie+Darville+and+as+Earl+remarks%3A+Business+owners.+Then+you+see+a+cheap+commercial+about+them+selling+their+water+beds%2C+but+I+am+not+gonna+go+into+that+now.+%28That+would+take+too+much+time%29.+Well+then+something+strange+happens%3A+First+Buzz+says%3A+%22Welcome+back+Soldier%22+and+then+as+Joy+appears+and+sees+Earl+she+jumps+him+and+says%3A+%22Coming+back+from+Iraq%2C+just+in+time+for+the+Holidays%22.+She+lets+herself+be+carried+in+the+Bedroom.+There+she+explains+that+her+father+is+a+racist+%28he+wouldn%27t+even+let+her+go+to+some+school+show+with+a+black+boy%29+and+that%2C+if+he+knew+she+would+be+disinherited.+And+she+explains+that+her+mother+is+in+a+wheelchair+because+she+has+advanced+arthritis+and+kidney+failure%2C+so+she+has+to+get+dialysis.+Well+since+Earl+doesn%27t+want+to+ruin+her+Christmas+again.+While+this+was+going+on+Randy+and+Catalina+were+the+only+two+people+left+in+the+competition.+But+Catalina+makes+it+clear+that%2C+if+she+wins+this+car..+She%27s+gonna+keep+it.+On+this+day+Earl+goes+to+Joy%27s+asking+what+color+the+kids+bike+should+be+like+and+he+catches+Joy%27s+mother+walking..+That%27s+the+second+lie+he%27s+uncovered+so+far.+She+explains%3A+First%2C+that+she+has+a+gambling+problem.+She+is+faking+her+Kidney+failure+to+get+money+for+her+gambling.+And+as+for+the+wheelchair%3A+She+had+a+little+accident+and+got+used+to+being+pushed+in+the+wheelchair%2C+then+she+remarks%3A%22Don%27t+you+judge+me%22+And+don%27t+ruin+Christmas.+And+that+gets+him+every+time.+So+he+is+keeping+her+Secret.+Back+to+the+contest%3A+Catalina+and+Randy+are+the+last+two+contestants.+Finally+Catalina+wins+and+her+secret+is+revealed%3A+She+is+not+a+U.S.+citizen%2C+so+Randy+wins+by+default.+But+folks%2C+the+episode+is+far+from+over+but+it+seems+that+all+the+pieces+are+falling+into+place.+Well+almost%2C+next+you+see+Earl+decorating+the+tree+and+then+you+see+Connie+%28Joys+Mother%29+%2C+getting+into+the+newly+won+car+%28Which+is+supposed+to+be+Earls+gift+for+Joy+and+to+make+this+possible+Randy%27s+gift+for+Earl%29.+Earl+catches+up+with+her+and+she+says%3A+%22I+am+going+to+the+Indian+Casino%2C+don%27t+you+judge+me%22.+Earl+takes+one+of+the+bikes+again+and+just+catches+up+to+her+on+her+way+back+where+she+tells+him+that+she+bet+on+the+whole+car+on+no.+seven+%28in+Roulette%29.+And+she+tells+him+once+again+not+to+judge+her.+When+they+arrive+at+hom+Joy+and+her+father+are+catching+them.+So+she+tells+everything.+Like+that+she+used+the+dialysis+money+for+gambling+or+the+whole+money+of+the+business+and+then+the+whole+card+house+begins+to+crumble.+Darnell+appears+and+Earl+tells+the+father+to+call+Darnell+Son+%28which+the+father+takes+literally+and+believes+he+is+one+of+his+sons+until+told+otherwise%29...+It+unfolds+that+Joys+father+LOVES+African-American+people.+Which+was+the+reason+he+didn%27t+want+Joy+to+go+out+with+an+African-American+back+in+her+schooldays..+He+was+her+half-brother.+They+argued+the+rest+of+the+night%2C+everyone+thinking+everyone+others+secret+is+worse+than+their+own.+But+in+the+morning+when+the+children+came+and+saw+their+presents+and+were+happy+the+family+went+back+to+be+happy+too.%0AIt+seems+that+they+all+only+kept+their+secrets+because+they+didn%27t+want+to+lose+everyone+else.+No+there+were+no+more+secrets+and+Joy+had+her+first+happy+Christmas+in+years.+So+Earl+can+cross+another+thing+of+his+list+and+move+on.+%0A","7.5","32");
INSERT INTO `series_episodes` VALUES("299611","1","1","1","Barn+Burner","11","1","1136415600","75397","When+trying+to+enroll+her+children+into+the+Right+Choice+Ranch+for+troubled+youth%2C+Joy+is+denied+enrollment+because+of+a+barn+burning+incident+at+the+hands+of+a+younger+Earl.+Earl%2C+Randy+and+Catalina+travel+to+the+camp+to+make+amends+for+the+barn+burning+by+building+a+pen+for+the+camp%E2%80%99s+ostrich.++Earl+learns+the+real+reason+behind+the+barn+burning+incident+and+decides+that+every+incident+on+his+list+after+the+fire+should+be+shared+by+Randy.%0A%0A%0ARecap%3A%0A%0AThe+episode+begins+as+we+find+Randy+playing+the+crane+game+in+the+Crab+Shack.+There+is+a+live+rat+inside%2C+and+Randy+wins+it.+Unfortunately%2C+he+gets+bitten+as+it+was+having+it%27s+way+with+Grover+when+Randy+so+rudely+pulled+it+out.+Joy+complains+to+Darnell+about+the+kids%2C+saying+they+are+even+too+bad+to+visit+the+%22Right+Choice+Ranch%22%2C+a+place+where+Earl+and+Randy+went+as+kids.+Darnell+says+he+is+busy%2C+but+Joy+reminds+him+that+he%27s+only+delivering+crabs%2C+not+doing+a+transplantectomy.%0A%0AEarl+doesn%27t+want+to+deal+with+the+kids+and+tries+to+avoid+Joy%2C+but+the+Ranch+is+on+his+list+-+he+burned+a+barn+down+throwing+away+a+cigarette.+He+decides+to+go%2C+and+tries+to+keep+it+a+secret+because+Randy+is+afraid+of+birds.+When+asked+where+they+are+going%2C+Earl+only+offers+that+%22they+do+not+have+funnel+cakes.%22+Upon+arrival%2C+Randy+cunningly+tries+to+avoid+the+birds+at+the+Ranch+%28but+ends+up+playing+dead+and+begs+two+children+to+call+the+cops%29+while+Earl+volunteers+to+help+build+an+ostrich+pen.%0A%0AAfter+seeing+how+much+the+kids+enjoyed+seeing+his+good+example+%28and+Catalina%29%2C+Earl+realizes+that+if+he+hadn%27t+burned+down+the+barn%2C+Randy+would+probably+have+a+better+life.+Earl+decides+to+add+Randy+to+the+list%2C+but+Randy+isn%27t+happy+about+that.+After+some+arguing%2C+a+mishap+lands+a+nail+through+Earl%27s+hand.+We+remember+Randy%27s+fear+of+blood%2C+and+he+admits+that+it+was+his+fault+the+barn+burned+down.+Turns+out+he+dropped+an+oil+lamp+by+the+still+lit+cigarette+after+a+bird+scared+him.%0A%0AEarl+realizes+that+Randy+is+responsible+for+everything+-+including+all+the+bad+things+on+the+list+that+Earl+did+since+1982.+The+list+is+now+his.+While+Randy+starts+to+do+Earl%27s+list+-+including+trying+to+return+a+stolen+birdbath%2C+sleeping+with+two+of+a+man%27s+wives%2C+and+stealing+donuts+from+a+bank+-+Earl+relaxes+as+he+feels+he+is+on+vacation.%0A%0ABut+then+Randy+comes+up+with+one+he+can%27t+do+-+Earl+promised+Joy%27s+kids+that+he+would+take+them+to+Mystery+Fun+Land.+Randy+can%27t+sign+the+kids+out+of+%22Bad+Kid+Camp%22%2C+so+Earl+has+to+do+it%2C+while+he+makes+Randy+begin+to+scrape+chewed+gum+from+under+every+table+he+ever+sat+at.+But+Earl+finds+out+that+Mystery+Fun+Land+is+now+gone.+He+doesn%27t+know+how+to+fix+the+problem%2C+but+the+kids+forgive+him.+This+inspires+Earl+to+forgive+Randy+for+burning+down+the+barn%2C+and+he+takes+his+list+back.+%0A","7.2","31");
INSERT INTO `series_episodes` VALUES("303120","1","1","1","O+Karma%2C+Where+Art+Thou%3F","12","1","1137020400","75397","When+Earl+and+Randy+try+to+return+a+stolen+wallet+they+find+out+taking+the+money+had+cost+two+newlyweds+their+honeymoon.+In+an+attempt+to+make+things+right+Earl+takes+over+for+the+groom+at+his+fast+food+restaurant.+After+time+Earl+finds+out+the+boss+is+a+jerk+and+Earl+wonders+how+such+a+man+with+a+luxurious+house+and+beautiful+wife+could+not+be+affected+by+the+only+thing+he+believes+in%2C+Karma.%0A%0A%0ARecap%3A%0A%0AEarl+and+Randy+wake+up+one+cold+morning+at+the+hotel%2C+Catalina+alludes+to+the+fact+that+they+may+be+being+carbon+monoxide+poisoned+and+leaves+the+room.+Randy+discovers+that+Earl+was+right+when+he+said+Randy+%22wasn%27t+ready+for+a+pet%22+after+discovering+dead+%22Mr.+Fishy%22+%28the+goldfish%29+in+a+sealed+plastic+bag+in+his+pocket.+Earl+however+discovers+number+202+on+his+list%2C+%22stole+a+wallet+from+a+guy+at+a+gas+station.%22+%0A%0AWe+flash+back+to+%22a+few+years+ago%22+when+Earl+was+%22hanging+out+in+a+gas+station+bathroom%2C+waiting+for+some+guy+to+drop+his+pants+and+provide+me+with+an+opportunity.%22+Earl+screams+a+little+too+loud+and+a+little+too+enthusiastically+when+he+discovers+just+how+much+money+is+in+the+wallet+and+has+to+cover+by+announcing+to+the+bathroom+that+%22they+have+my+favorite+brand+of+toilet+paper+in+here%2C+soft+stuff.%22%0A%0AEarl+admits+to+having+stolen+a+lot+of+wallets+in+his+day%2C+but+also+admits+that+this+particular+one+was+the+mother+load.+And%2C+it+seems+when+you+find+yourself+with+a+lot+of+money+you+go+to+Jasper%27s.+What+is+Jasper%27s+you+may+well+ask%3F+%22Jasper%22s+is+kind+of+like+the+mall%2C+only+it%27s+in+a+storage+unit+and+everything+there+was+stolen+from+the+mall.%22+The+gang+spends+the+thousand+dollars+they+had+on+many+things+that+day+and+according+to+Earl%2C+they+were+living+like+kings.+But+back+to+today%2C+when+faced+with+the+reality+of+having+to+give+up+his+helmet+bought+that+day+long+ago%2C+Randy+asks+Earl+why+he+can%27t+just+give+the+guy+back+his+wallet+with+a+thousand+dollars+of+his+lottery+money+stuffed+in+it.+Earl+explains+to+Randy+that+the+items+were+bought+with+stolen+money+and%2C+as+such%2C+have+bad+Karma+all+over+them.+%0A%0AThe+slushee+machine+represents+one+small+hurdle%2C+since+it+now+home+to+Darnel%27s+turtle.+But+typical+%22Crabman%22+accommodation%2C+Darnel+decides+to+allow+the+turtle+to+simply+go+%22free+range%22+on+the+carpet+of+the+trailer.+Joy+barely+looks+up+from+her+magazine+when+announcing+%22if+that+thing+starts+begging+at+the+table%2C+its+going+to+become+an+outside+turtle.%22+%0A%0ABack+at+Jasper%27s+to+return+the+items%2C+Randy+and+Earl+discover+that+Jasper+has+gone+%22high-tech%22+complete+with+taking+orders+online+and+a+mail-order+Russian+wife.+With+the+money+in+hand+%28and+we+never+quite+learn+how+they+are+able+to+get+back+all+their+money%2C+even+though+the+items+have+been+well+used%29%2C+Randy+and+Earl+track+down+the+owner+of+the+wallet.+The+intention+of+course%2C+is+to+return+the+wallet+and+then+Earl+can+simply+cross+the+item+off+his+list.+%0A%0AAs+with+every+item+so+far+from+Earl%27s+list%2C+nothing+is+quite+so+simple.+The+scene+where+the+wife+of+the+man+whose+wallet+was+stolen+opens+her+tanning+bed+calling+the+boys+thief%27s+is+hilarious+as+Randy+recoils+from+her+over-tanned+stick+like+figure+asking+%22what+is+that+Earl%2C+what+is+that%3F%22+When+the+wife+wants+to+call+the+police%2C+Randy+cuts+the+phone+cord%2C+briefly+making+the+wife+feel+that+she+and+her+husband+will+die.+After+some+explaining%2C+Earl+finally+manages+to+calm+them+down.+It+seems+however+that+the+money+stolen+was+for+the+young+couple%27s+honeymoon.+And+so+simply+returning+the+money+will+not+be+enough+for+Earl+to+cross+them+off+the+list.+%0A%0AEarl+agrees+to+cover+for+Jeff+at+his+job%2C+while+he+and+his+wife+go+off+on+their+%22do-over%22+honeymoon.+The+fast+food+restaurant+is+run+by+a+Mr.+Patrick+who+we+quickly+come+to+find+is+a+real+tyrant+to+work+for.+Earl+has+never+done+well+with+authority+and+in+the+past+when+faced+with+this+type+of+person%2C+the+answer+was+simple%2C+Earl+would+just+punch+him+in+the+face+and+feel+much+better.+We+even+get+to+watch+via+a+flash-back+as+Earl+quits+four+past+jobs+using+this+very+method.+Alas%2C+with+Karma+now+dictating+his+actions%2C+Earl+is+not+able+to+vent+the+way+he+would+like+and+even+winds+up+eating+a+disgusting+french-fry+which+was+used+to+wipe+the+groove+on+a+counter+Earl+had+supposedly+cleaned.+What+Earl+won%27t+do+for+Karma%21+He+isn%27t+made+to+feel+much+better+by+the+co-worker+who+tries+to+console+him+by+saying+%22that%27s+ok%2C+I+had+to+eat+a+hamburger+patty+he+wiped+on+a+toilet+seat.%22%0A%0AEarl+has+to+endure+more+humiliation+from+Mr.+Patrick+and+he+bears+up+well%2C+fully+firm+in+his+belief+that+Karma+will+make+sure+this+terrible+manager+will+get+what%27s+coming+to+him.+Just+when+you+think+Earl+has+put+up+with+enough%2C+Joy+and+Darnel+pull+up+to+the+drive-thru+window.+Joy+decides+this+situation+is+far+too+much+fun+to+enjoy+from+the+car+and+decides+to+park+and+come+on+in.+%0A%0AIt+starts+the+minute+Joy+walks+up+to+the+counter+and+says+to+Earl+%22well+look+at+you+all+dressed+up+in+that+cute+uniform+and+they+even+had+your+extra+dorkey.%22+Earl+may+no+longer+punch+abusive+managers+in+the+face%2C+but+he+will+fire+back+at+Joy%2C+and+does+%22welcome+to+Stars%2C+may+I+take+your+order%3F+And+your+clothes+look+stupid+too.%22+Joy+convinces+the+manager+to+give+her+the+food+she+ordered+for+free%2C+claiming+Earl%27s+hair+had+fallen+into+it.+Earl+allows+himself+to+be+compelled+to+wear+a+hair+net+on+his+head+and+one+for+his+moustache+that+crosses+his+face.+While+totally+not+enjoying+the+experience%2C+he+reminds+himself+that+Karma+will+look+after+the+bad+people+in+this+world.%0A%0AWhile+loading+Star%27s+paid+for+toilet+paper+to+drive+over+to+Mr.+Patrick%27s+house+for+his+own+personal+use%2C+Earl+meets+again+with+a+female+co-worker+%28Zeena%29.+While+trying+to+explain+the+%22uncontrollable%2C+driving+force%22+behind+Karma%2C+Zeena+misunderstands+where+he+is+going+with+this%2C+and+in+a+very+awkward+moment+blurts+out%2C+%22I+love+you+too+Earl%21%22+and+while+taking+out+her+retainer+adds%2C+%22you%27ll+be+my+first.%22+%0A%0AEarl+first+begins+to+question+what+Karma+is+doing+when+observes+that+Mr.+Patrick+has+a+beautiful+house+in+a+beautiful+neighbourhood+and+a+beautiful+wife%2C+all+of+which+he+clearly+didn%27t+deserve.+Once+inside+the+house%2C+the+situation+is+only+made+more+frustrating+for+poor+Earl.+Mr.+Patrick+seems+to+have+it+all.+O+Karma%2C+where+art+thou%3F%0A%0ABack+at+the+hotel+with+Randy%2C+Earl+tries+to+make+sense+of+it+all.+When+Catalina+suggests+that+maybe+Mr.+Patrick+is+nice+outside+of+work%2C+Earl+announces+%22even+if+he+pulled+his+face+off+and+underneath+was+that+guy+from+U2+who+does+all+that+charity%2C+he+still+wouldn%27t+deserve+a+wife+that+hot%21%22+Earl+spends+the+next+day+at+work+looking+for+some+sign+that+Karma+is+on+the+job%2C+but+all+he+finds+are+more+and+more+incidents+where+Mr.+Patrick+clearly+violates+all+Karma%27s+principles+with+apparently+no+repercussions.+In+one+totally+hilarious+moment%2C+Earl+decides+that+Mr.+Patrick+must+be+being+punished+by+Karma+in+a+way+that+requires+%22up+close%22+observation.+Earl+recounts%2C+while+standing+beside+Mr.+Patrick+at+the+urinal+%22I+didn%27t+want+to+check+there%2C+but+I+had+to.%22+From+Earl%27s+reaction+we+can+quickly+ascertain+that+Karma+has+not+punished+Mr.+Patrick+%22there%22+either.+You+will+have+to+watch+the+episode+to+see+the+scene+where+Earl+says+he%27s+%22having+a+little+trouble+working+up+a+stream%22+and+how+Mr.+Patrick+%22helps%22+him.+Too+funny+to+try+and+write+about.%0A%0ABack+on+the+job%2C+dressed+as+a+hamburger+for+child%27s+birthday+party%2C+Earl+complains+%22I+could+see+that+Karma+wasn%27t+punishing+Mr.+Patrick%2C+what+I+didn%27t+get+was+why+it+was+punishing+me.%22+The+children+and+Mr.+Patrick+plague+Earl%2C+but+Mr.+Patrick+really+berates+Earl+and+through+it+all%2C+Earl+tries+to+simply+%22power+through+it%22+and+not+respond+as+he+dearly+wants+to.+Just+when+you+think+that+Earl+might+actually+stay+calm%2C+he+unleashes+the+fury+of+his+punch+and+drops+Mr.+Patrick+to+the+floor+with+a+punch+to+his+eye.+I%2C+for+one%2C+jumped+up+and+yelled+in+appreciation.+When+Zeena+gets+in+the+action+and+starts+to+kick+Mr.+Patrick+on+the+floor%2C+Earl+intervenes+and+tells+her+to+take+it+easy.+One+of+the+best+lines+of+the+show+is+Zeena%27s+%22oh+god%2C+your+hands+on+my+body%2C+feel+so+right.%22+%0A%0AEarl+says+he+%22felt+bad+for+sending+Mr.+Patrick+to+the+emergency+room%2C+but+when+I+found+what+I+started%2C+I+felt+even+worse.%22+One+by+one%2C+all+the+things+in+Mr.+Patrick%27s+world+unravel+and+a+man+who+once+had+pride+in+his+collection+of+%22world%27s+best+%E2%80%A6%22+mugs%2C+is+found+in+a+prison+cell+with+a+tin+mug+labelled+%22world%27s+best+bottom.%22+It+is+a+bad+turn+for+a+bad+man%2C+but+Earl+feels+guilty+since+it+was+his+fists+that+brought+the+punishment%2C+not+Karma%27s.+Randy+accurately+points+out+that+%22Karma+doesn%27t+have+fists%22+and+goes+on+%22Karma+doesn%27t+have+hands+at+all%2C+or+feet%22+he+pauses%2C+then+asks+tentatively+to+Earl+%22does+Karma+have+feet%3F%22+Earl+decides+that+maybe+Karma+did+use+him+to+do+the+dirty+work%2C+especially+since+a+bad+man+%28Mr.+Patrick%29+got+what+he+deserved+and+a+good+man+%28Jeff%29+got+promoted+to+manager.+%0A%0A%22In+the+end%2C+everyone+got+what+they+deserved+and+I+was+able+to+cross+number+202+off+my+list.%22+%0A%0A","7.6","28");
INSERT INTO `series_episodes` VALUES("299612","1","1","1","Stole+P%27s+HD+Cart","13","1","1137625200","75397","Earl+crosses+another+number+off+the+list+when+he+returns+Pops%E2%80%99+Weiner+Hot+Dog+cart+he+and+Ralph+%28Giovanni+Ribisi%29+stole+in+his+youth.+The+good+deed+does+not+last+long+as+Ralph%2C+who+works+for+a+competing+franchise+sets+fire+to+Pops+cart.+Earl+now+must+set+things+right+with+a+bizarre+plan+while+recruiting+Randy%2C+Joy%2C+Catalina+and+Darnell+to+assist+him.%0A%0A%0ARecap%3A%0A%0AAfter+going+out+to+eat%2C+Earl+remembers+that+he+and+Ralph+stole+Pop%27s+Wiener+Hot+Dog+cart+because+the+competing+fast+food+restaurant+manager+pay+then+to+do+it.+So+he+decided+to+take+it+of+his+list.+%0AEarl+when+to+the+place+where+he+hide+the+cart+and+went+to+Pop%27s+house+to+returned+and+ask+for+forgiveness%2C+Pop+agree+to+forgive+him.+But+it+was+not+enough+because+now+people+are+used+to+go+to+the+fast+food+restaurant+and+nobody+goes+to+Pop%27s+anymore.+Earl+decided+to+advertise+Pop%27s+to+get+him+back+to+business+and+he+succeeds.%0ABut+after+Pop%27s+got+back+to+business+Ralph+burns+Pop%27s+cart+because+once+again+he+got+paid+by+the+competing+franchise.%0AEarl+decided+that+now+he+owe+Pop+a+new+cart+so+now+he+had+to+get+money+to+buy+one.+He+decided+to+get+the+gang+together+once+more+to+plan+for+a+new+hit.+While+planning+Ralph+came+up+with+the+idea+of+cutting+his+finger+and+put+it+in+the+food+of+a+restaurant+and+sue+them%2C+Earl+dismiss+the+idea.%0AHe+planned+to+get+them+all+work+in+a+company+and+steal+all+they+could+from+it+to+get+the+money.+Thanks+to+Kenny%2C+Earl+makes+all+the+gang+look+qualify+for+the+job+%28Kenny+exchange+his+test+with+them+making+him+look+bad+and+them+good%29.+After+all+got+the+job%2C+they+hide+and+wait+for+the+night+to+act.%0AAt+night%2C+they+started+to+steal+everything+but+then+Ralph+came+up+with+stealing+a+huge+copy+machine+everybody+didn%27t+wanted+to+do+it+but+Earl+thought+that+the+machine+would+make+the+money+quicker+and+decided+to+go+for+it.+%0AThey+went+inside+the+room+with+the+huge+machine+and+try+to+carry+it+through+the+door+but+it+was+to+big+to+fit%2C+Ralph+insisted+in+pushing+it+harder+but+it+got+them+trap+inside+the+small+room.+The+next+morning+they+all+were+fired.%0AEarl+was+about+to+give+up+when+Ralph+again+brings+up+the+idea+of+the+finger%2C+but+this+time+he+brought+the+finger+too%2C+so+Earl+decided+to+go+for+it.+Joy+was+in+charge+of+finding+the+finger+and+sue+the+restaurant%2C+she+quickly+got+the+money+and+give+it+to+Earl%2C+she+didn%27t+care+about+the+money%2C+she+was+happy+that+the+gang+was+together+again%2C+Pop%27s+got+his+cart+again+and+Earl+could+write+it+off+his+list.+%0A%0A%0A","7.7","27");
