INSERT INTO `series_episodes` VALUES("4457898","1","1","1","The+Face+of+Change","14","9","1360191600","73762","Competition+heats+up+as+several+of+the+doctors+fight+to+become+the+new+face+of+Seattle+Grace%3B+April+brings+in+an+emergency+case%2C+and+Jackson+and+Alex+work+with+a+transgender+teen+couple.+Meanwhile%2C+the+hospital+implements+new+policies+which+test+the+patience+of+the+staff.","7.3","56");
INSERT INTO `series_episodes` VALUES("378490","1","0","0","My+First+Adventure","1","1","","82643","The+first+chapter+of+the+Young+Indy+series+begins+in+his+home+town+of+Princeton%2C+where+we+get+a+snapshot+of+the+life+of+the+Jones+family+--+father+Henry%2C+mother+Anna%2C+and+the+tireless+Henry+Walton+Jones%2C+Jr.%2C+better+known+to+us+as+Indiana+Jones.+Before+long%2C+nine-year+old+Indy+has+joined+his+family+on+a+trip+around+the+world%2C+starting+in+Oxford+where+they+bring+aboard+Indy%27s+no-nonsense+tutor%2C+Helen+Seymour.+%0A%0A%28Egypt%2C+May+1908%29+Their+first+exotic+destination+is+Egypt%27s+Valley+of+the+Kings%2C+where+Howard+Carter+is+currently+excavating+a+newly+discovered+tomb.+Intrigue+abounds+as+a+murder+mystery+takes+place+on+the+campsite%2C+which+Indy+must+help+solve+with+the+help+of+T.E.+Lawrence%2C+the+legendary+Lawrence+of+Arabia.+%0A%0A%28Tangiers%2C+May+1908%29+The+next+leg+of+Indy%27s+journey+takes+him+to+Tangiers%2C+Morocco%2C+where+his+family+stays+with+Walter+Harris%2C+correspondent+from+the+London+Times+%28and+eventual+author+of+the+famous+Morocco+That+Was%29.+There+Indy+meets+Emily+Keene%2C+Sharifa+of+Wazan%2C+and+befriends+a+young+Moroccan+slave+named+Omar.+An+ill-advised+trip+to+a+dangerous+marketplace+results+in+Young+Indy+and+Omar+being+kidnapped+by+slave-trading+brigands.+Dragged+on+a+terrifying+journey+across+the+burning+sands+of+North+Africa+to+the+slave+markets+of+Marrakech%2C+Indy+finds+that+he+must+rely+on+his+courage+and+wits+to+survive+the+brutal+ordeal.+","10","1");
INSERT INTO `series_episodes` VALUES("378491","1","0","0","Passion+for+Life","2","1","","82643","Young+Indy+and+his+family+meet+Theodore+Roosevelt%2C+former+President+of+the+United+States%2C+who+is+on+safari+in+British+East+Africa+%28now+known+as+Kenya%29.+Roosevelt+is+on+an+official+expedition+sponsored+by+the+Smithsonian+Institution+to+collect+specimens+for+the+National+Museum+in+Washington.+One+particular+specimen+eludes+him%2C+though%3B+the+Fringe-Eared+Oryx%2C+which+at+one+time+was+plentiful%2C+now+seems+impossible+to+find.+Indy+is+determined+to+help+the+awe-inspiring+Roosevelt.+He+befriends+a+Massai+boy%2C+Meto%2C+and+learns+about+the+ecology+chain+from+a+Maasai+elder.+Indy+discovers+the+essential+balance+that+connects+all+living+things+in+the+African+savanna%2C+and+is+troubled+by+the+early+20th+Century+practice+of+killing+animals+for+display+in+museum+as+a+means+of+conservation.+%0A%0ALater%2C+Indy+then+travels+to+Paris%2C+to+study+the+new+artistic+movements+radically+reshaping+the+artist+scene.+While+the+Louvre+offers+all+sorts+of+staid+classics%2C+the+%22real%22+artists+can+be+found+living+in+some+of+the+seamier+--+and+danger-filled+--+corners+of+Paris.+A+young+Norman+Rockwell+takes+Indy+into+a+bohemian+caf%C3%A9+in+Montmartre%2C+where+they+see+hot-headed+artist+Pablo+Picasso+and+his+quieter+companion+Georges+Braques+butting+heads+with+an+aging+Edgar+Degas.+Picasso+is+determined+to+prove+to+the+old+guard+Degas+that+he+can+paint+as+well+as+the+former%2C+and+not+single-handedly+destroying+the+art+scene+as+Degas+claims.+%0A","10","1");
INSERT INTO `series_episodes` VALUES("378492","1","0","0","The+Perils+of+Cupid+","3","1","","82643","In+beautiful+Vienna%2C+Indy+falls+for+the+lovely+young+daughter+of+soon+to+be+assassinated+Archduke+Franz+Fredinand+of+Austria.+But+the+course+of+true+love+does+not+run+smoothly+and+he+must+seek+advice+from+two+of+the+founding+fathers+of+psychology%2C+Sigmund+Freud+and+Carl+Jung.%0A%0A%0ARomantic+complications+of+another+kind+turn+up+in+Florence%2C+Italy+when+Indy+and+his+mother+meet+the+great+composer+Giacomo+Puccini.+Dismayed+to+find+his+lovelyl+mother+succumbing+to+the+sensuous+charms+of+the+charismatic+Puccini%2C+Indy+frantically+looks+for+a+way+to+reunite+his+parents+and+rekindle+their+love.","8","1");
INSERT INTO `series_episodes` VALUES("378493","1","0","0","Travels+with+Father+","4","1","","82643","The+world-wide+trip+that+Henry+Jones%2C+Jr.+embarks+upon+in+the+early+1900s+next+takes+him+and+his+family+to+Russia.+A+fit+of+clumsiness+lands+Junior+into+hot+water+with+his+father.+Not+bearing+any+more+punishment%2C+Indy+runs+away+into+the+Russian+countryside.+He+encounters+an+odd%2C+cantankerous+old+man+named+Leo+Tolstoy%2C+who+is+in+full+agreement+that+hell+is+other+people.+Both+are+running+away+to+seek+a+simpler+life.+They+cross+the+countryside%2C+encountering+colorful+Gypsies+and+avoiding+fierce+Imperial+Cossack+troops.+The+hardships+of+the+journey+make+Indy+homesick%2C+but+he+won%27t+soon+forget+his+journey+with+the+stubborn+old+man.+%0A%0AIndy%27s+next+destination+is+Greece%2C+where+his+mother+Anna+realizes+that+father+and+son+need+to+spend+more+time+together.+The+two+bristle+at+each+other%27s+company+as+they+explore+the+sites+of+ancient+Greece%2C+but+Henry+finally+reaches+past+Indy%27s+impudence+and+stubbornness+when+the+topic+turns+to+philosophy+and+the+teachings+of+Aristotle.+A+series+of+misadventures+lead+them+to+an+isolated+monastery+perched+high+on+the+peak+of+a+mountain.+While+studying+in+the+library%2C+Indy+meets+Nikos+Kazantzakis%2C+the+writer+who+would+some+day+write+Zorba+the+Greek.+Lessons+on+causality+come+in+handy+on+the+harrowing+trip+in+a+tiny+cage+reeled+up+a+thousand-foot+mountainside.+%0A","0","0");
INSERT INTO `series_episodes` VALUES("378494","1","0","0","Journey+of+Radiance+","5","1","","82643","In+Benares%2C+the+most+prominent+religions+of+the+worlds+gather+near+the+banks+of+the+Ganges.+Indy+is+there%2C+getting+a+first-hand+look+at+the+major+faiths+with+no+less+impressive+a+tour-guide+than+Jiddu+Krishnamurti%2C+a+young+boy+handpicked+by+the+Theosophy+movement+and+proclaimed+to+be+the+next+messiah.+Not+everyone+believes+such+a+weighty+claim%2C+least+of+all+Helen+Seymour%2C+who+has+misgivings+about+theosophists%2C+especially+their+hosts+Annie+Besant+and+Charles+Leadbeater.+Helen%27s+investigations+provide+her+a+lesson+in+skepticism%2C+tolerance%2C+and+preconceptions%2C+while+Indy+witnesses+the+divine+through+the+lenses+of+many+different+faiths.+%0A%0AThe+Jones+family+next+heads+to+Peking%2C+where+Indy%2C+Anna+and+Mrs.+Seymour+tour+the+Great+Wall+of+China.+Journeying+further+inland%2C+Indy+falls+ill%2C+and+Anna+is+desperate+to+get+him+help.+A+poor+Chinese+family+takes+in+the+travelers%2C+and+Anna+must+brave+new+customs+and+strangely+unfamiliar+medical+practices+--+the+kind+performed+by+Dr.+Wen+Chiu+--+if+Indy+is+to+survive+his+severe+sickness.+%0A","0","0");
INSERT INTO `series_episodes` VALUES("378495","1","0","0","Spring+Break+Adventure+","6","1","","82643","It%27s+1916%2C+and+high+school+student+Indiana+Jones+is+living+with+his+dad+in+Princeton%2C+New+Jersey%2C+working+as+a+soda+jerk.+Spring+break+is+fast+approaching%2C+and+all+Indy+can+think+of+is+taking+his+girlfriend+Nancy+%28daughter+of+cliffhanger+author+Edward+Stratemeyer%29+to+the+prom+in+a+slick+new+Bugati.+The+car%27s+foreign+engine+is+impossible+to+get+parts+for%2C+but+a+favor+from+a+professor+working+at+Thomas+Edison%27s+laboratory+raises+his+hopes.+His+plans+are+sidetracked+when+a+mysterious+break-in%2C+the+theft+of+an+electric+motor%2C+and+rumors+of+German+spies+result+in+a+mystery+that+only+Indy+and+Nancy+can+unravel.+%0A%0AIndy+and+his+father+then+head+to+the+southwest+to+visit+family+in+Albuquerque.+With+his+mischievous+cousin+Frank%2C+Indy+heads+to+Columbus%2C+New+Mexico+to+sew+some+wild+oats+when+the+town+is+suddenly+attacked+by+Pancho+Villa+and+his+riders.+Playing+hero%2C+Indy+follows+the+Villistas+into+the+desert+and+is+soon+taken+captive.+As+a+16-year+old+itching+for+a+good+fight%2C+Indy+is+stirred+by+Villa%27s+words%2C+and+joins+his+cause%2C+riding+with+the+Villistas+as+General+Pershing+chases+them+throughout+the+desert.+Indy+meets+and+befriends+the+Belgian+expatriate+Remy%2C+witnesses+the+intensity+of+a+young+George+S.+Patton%2C+and+also+finds+a+murderer+who+escaped+the+law+eight+years+earlier+in+Cairo+in+this+adventure+that+sets+the+teenage+Indy+on+a+path+that+will+lead+him+to+war-torn+Europe.+%0A","0","0");
INSERT INTO `series_episodes` VALUES("378496","1","0","0","Love%27s+Sweet+Song+","7","1","","82643","Disillusioned+after+riding+with+Pancho+Villa%2C+Indy+hops+the+ocean+where+he+figures+the+Great+War+currently+tearing+apart+Europe+might+offer+him+a+greater+sense+of+purpose.+With+Belgian+national+and+friend+Remy+Baudoin%2C+Indy+intends+to+enlist+in+the+Belgian+army.+Their+ship%2C+though%2C+first+stops+in+Ireland%2C+where+they+need+to+take+odd+jobs+to+save+up+the+money+for+the+next+leg+of+their+journey.+Indy+works+as+a+bartender+in+a+pub+frequented+by+struggling+playwright+Sean+O%27Casey%2C+who+is+desperately+trying+to+carve+out+a+new+Irish+identity+through+the+drama+of+the+stage%2C+though+the+old+guard+embodied+by+W.B.+Yates+has+different+ideas.+Identity+figures+prominently+in+this+tale%2C+as+Indy+adopts+the+guise+of+a+%22wealthy%22+American+to+impress+an+Irish+lass+named+Maggie+%28while+her+brother%2C+Sean+Lemass+keeps+a+wary+eye+on+Jones%29.+The+struggle+of+identity+for+Ireland+itself+causes+an+upheaval+in+the+form+of+the+bloody+Easter+Rebellion%2C+which+erupts+before+Indy+can+leave+for+London.+%0A%0ASurviving+the+violence+and+turmoil+in+Ireland%2C+Indy+and+Remy+arrive+in+London+and+enlist.+Knowing+that+his+life+will+soon+turn+to+deadly+combat%2C+Indy+clumsily+seeks+out+the+comfort+of+female+companionship%2C+stumbling+upon+a+suffragette+meeting+arranged+by+Sylvia+Pankhurst.+He+becomes+smitten+by+the+beautiful+bus+conductor+Vicky+Prentiss%2C+and+the+two+spend+a+brief+but+idyllic+time+together+in+the+English+countryside.+Indy+and+Vicky+also+visit+Indy%27s+old+tutor+Helen+Seymour%2C+who+invites+them+to+a+dinner+banquet+attended+by+none+other+than+Winston+Churchill.+%0A","0","0");
INSERT INTO `series_episodes` VALUES("378497","1","0","0","Trenches+of+Hell+","8","1","","82643","Having+joined+the+Belgian+Army+to+fight+in+the+Great+War+under+the+pseudonym+%22Henri+Defense%2C%22+Indy+witnesses+horrific+combat+in+Flanders+that+kills+all+of+the+commanding+officers+in+his+unit%2C+leaving+young+Jones+in+command.+The+9th+Belgian+Infantry+unit+is+assigned+to+the+French+14th+Company%2C+and+thrown+into+the+thick+of+the+Battle+of+the+Somme%2C+in+a+vivid+depiction+of+the+terrible+hell+of+trench+warfare%2C+including+flamethrower+and+gas+attacks.+%0A%0AOn+a+brief+leave%2C+Indy+meets+English+soldiers+and+poets+Siegfried+Sassoon+and+Robert+Graves+whose+words+crystallize+for+Indy+the+plight+of+the+soldier+in+World+War+I.+He+soon+returns+to+the+front%2C+where+he+and+his+fellow+soldier+Emile+are+taken+captive+by+the+Germans.+Indy+wastes+no+time+attempting+to+escape%2C+but+his+bold+efforts+only+land+him+sent+to+the+maximum+security+prison+at+Dusterstadt+on+the+Danube.+There%2C+Indy+meets+a+captive+Charles+de+Gaulle%2C+and+together%2C+the+two+conspire+a+clever+plan+to+escape+the+inescapable+fortress.+%0A","7","1");
INSERT INTO `series_episodes` VALUES("378498","1","0","0","Demons+of+Deception+","9","1","","82643","It%27s+September%2C+1916.+Indiana+Jones+--+posing+as+Belgian+Henri+Defense+--+has+joined+with+the+French+to+serve+as+a+motorcycle+courier+to+the+trenches+at+Verdun.+There+is+perhaps+no+greater+contrast+than+the+carnage+at+the+frontlines+compared+to+the+comfort+of+the+chateau+where+Generals+Robert+Nivelle%2C+Henri+Philippe+P%C3%A9tain+and+Joseph+Joffre+plot+out+their+next+moves.+On+a+dangerous+spy+assignment%2C+Indy+returns+with+news+of+deadly+German+artillery+being+brought+to+Verdun%2C+yet+such+reports+are+ignored+in+the+face+of+political+pressures+guiding+a+seemingly+futile+war.+%0A%0AIn+October%2C+Indy+gets+a+break+from+his+courier+duties+and+heads+to+Paris+on+leave+with+his+good+friend+Remy.+The+two+plan+to+look+for+girls+but+Indy+is+sidetracked+when+he+must+pay+a+visit+to+a+family+friend+and+spend+time+at+a+stuffy+dinner+party.+There%2C+though%2C+he+meets+the+beautiful+temptress+Mata+Hari.+The+attraction+is+instantaneous%2C+and+Indy+begins+a+torrid+love+affair+with+her.+But+in+all+this%2C+Indy+gets+an+eye-opening+lesson+in+honesty+and+self-deception%2C+and+learns+that+she+is+seeing+several+other+men+as+well%2C+most+notably+the+French+Minister+of+War.+In+addition+to+being+unfaithful%2C+Mata+Hari+is+suspected+of+being+a+spy.+%0A","0","0");
INSERT INTO `series_episodes` VALUES("378499","1","0","0","Phantom+Train+of+Doom+","10","1","","82643","Weary+of+the+carnage+of+the+Western+Front%2C+Indiana+Jones+and+his+friend+Remy+transfer+to+Africa%2C+each+receiving+promotions+to+the+rank+of+lieutenant+in+the+Belgian+Army.+A+few+missteps+put+them+on+the+wrong+train%2C+and+the+young+officers+end+up+hopelessly+lost+in+the+veldt.+Trying+to+get+back+to+their+unit%2C+Indy+and+Remy+come+across+a+colorful+group+of+soldiers+nicknamed+%22The+Old+and+the+Bold.%22+The+25th+Frontiersman+Battalion%2C+Royal+Fusiliers+are+led+by+Frederick+Selous%2C+the+famed+hunter+that+Indy+met+years+ago+while+on+safari+with+Teddy+Roosevelt.+Selous+sees+Jones%27+passing+knowledge+of+trains+as+good+luck%2C+and+orders+Indy+on+a+mission+to+destroy+the+Phantom+Train%3A+a+powerful+rail-mounted+German+artillery+gun+that+is+mysteriously+able+to+appear+and+disappear+at+will.+%0A%0AJones+is+the+youngest+of+the+lot+by+far+--+most+of+the+Frontiersmen+were+too+old+for+active+service%2C+so+they+formed+their+own+unit+--+and+this+adventure+causes+him+to+rethink+his+assumptions+about+age+and+experience.+%0A%0APleased+with+Jones%27+luck%2C+Selous+takes+the+unwitting+Indy+on+the+next+Frontiersman+caper%3A+the+capture+of+the+notorious+German+military+mastermind%2C+Colonel+Paul+Von+Lettow-Vorbeck.+Peasant+disguises%2C+a+hot+air+balloon%2C+a+pride+of+lions%2C+a+giant+termite+snack+and+angry+natives+all+figure+into+a+thrilling+chase+across+the+Africa+savanah+as+Indy+ends+up+unwilling+captor+to+the+opinionated+officer.+%22It%27s+like+we+kidnapped+my+father%21%22+remarks+Indiana+Jones.+%0A","7","1");
INSERT INTO `series_episodes` VALUES("378500","1","0","0","Oganga%2C+The+Giver+and+Taker+of+Life+","11","1","","82643","In+a+war-torn+country%2C+Indiana+Jones+finds+a+wellspring+of+hope+in+the+presence+of+one+remarkable+man.+On+a+vital+military+mission+for+the+Allies%2C+Indy+comes+across+a+disease-ravaged+African+village+and+is+able+to+rescue+one+small+child+from+certain+death.+The+presence+of+the+child+endangers+the+mission%2C+leaving+Indy+in+a+moral+quandary%2C+forced+to+fight+his+conscience%2C+his+sense+of+duty%2C+his+own+men+and+the+enemy+as+he+battles+his+way+across+country.+Depressed+by+the+turmoil+around+him%2C+Indy+reaches+his+lowest+point.+Hope+appears+in+the+presence+of+Albert+Schweitzer%2C+a+profoundly+inspiring+and+committed+doctor%2C+philosopher+and+musician.+Helping+out+at+Schweitzer%27s+jungle+hospital%2C+Indy+finds+his+faith+in+humanity+restored+and+his+outlook+on+life+forever+changed+in+this+beautiful+and+moving+film.+","0","0");
INSERT INTO `series_episodes` VALUES("378501","1","0","0","Attack+of+the+Hawkmen+","12","1","","82643","Indy+returns+from+Africa+with+a+changed+perspective+thanks+to+his+time+with+Albert+Schweitzer.+Rather+than+wage+war+on+bloody+battlefields%2C+he+sees+an+opportunity+to+help+end+the+great+conflict+by+joining+French+Intelligence.+His+plan+succeeds+almost+too+well%2C+as+he+is+instantly+assigned+to+the+Lafayette+Escadrille+as+a+reconnaissance+photographer+--+a+position+with+a+notoriously+short+lifespan.+The+legendary+flying+unit+consists+of+American+volunteers+flying+under+the+French+flag%2C+engaging+in+daring+dogfights+against+the+enemy.+In+Indy%27s+time+with+the+unit%2C+he+comes+face+to+face+with+German+Ace+Manfred+von+Richthofen%2C+better+known+to+history+as+the+infamous+Red+Baron.+%0A%0AIndy%27s+next+intelligence+assignment+is+again+rooted+in+air+superiority.+The+aviation+genius+Anthony+Fokker%27s+loyalty+is+reportedly+for+sale%2C+and+it%27s+up+to+Indy+to+contact+the+designer+and+make+him+an+offer.+Outfitted+with+plenty+of+spy+gear%2C+Indy+goes+behind+enemy+lines+to+intercept+Fokker%2C+who+is+about+to+unveil+a+diabolical+new+air+weapon.+%0A","0","0");
INSERT INTO `series_episodes` VALUES("378502","1","0","0","Adventures+in+the+Secret+Service+","13","1","","82643","Indy+finds+that+he+must+enlist+the+help+of+Habsburg+royalty+when+he+embarks+on+a+dangerous+diplomatic+mission+through+enemy-held+Europe+into+the+palace+of+Emperor+Karl+of+Austria.+Endangering+his+life+and+the+lives+of+his+royal+charges%2C+Indy+gambles+all+in+a+desperate+attempt+to+bring+the+war+more+quickly+to+an+end.+Then%2C+in+chaos-ridden+Russia%2C+Indy+finds+his+espionage+work+once+again+threatening+lives+when+he+infiltrates+a+group+of+young+Bolsheviks+and+begins+to+sympathize+with+their+plight.+As+the+country+lurches+toward+revolution%2C+Indy+finds+himself+torn+between+loyalty+to+his+friends+and+his+military+duty.+","0","0");
