INSERT INTO `series_episodes` VALUES("303911","0","0","1","The+One+With+Rachel%27s+New+Dress","18","4","891468000","79168","A+very+pregnant+Phoebe+is+asked+to+name+one+of+the+triplets.++Emily+offers+to+show+Susan+around+London.+Rachel+tries+to+prepare+the+perfect+evening+for+herself+and+Joshua.+Emily+loves+Susan.+Phoebe+decides+that+the+boy+will+be+named+either+Chandler+or+Joey.+Joey+accidentally+tells+Chandler+he+has+an+awful+name.+The+chick+and+duck+wander+over+to+Rachel%27s+apartment+and+freak+out+Joshua%2C+so+they+go+to+his+parents%27+house.+Ross+worries+about+losing+another+woman+to+Susan.++Joshua%27s+parents+come+home+unexpectedly.+Chandler+disowns+his+name+and+tries+to+find+himself+a+new+name.+The+girls+convince+Ross+not+to+let+what+happened+with+Carol+happen+with+Emily.+In+order+to+keep+Chandler+from+legally+changing+his+name%2C+Phoebe+decides+to+name+the+baby+Chandler.+Chandler+reveals+to+Joey+that+it+was+all+a+trick.","7.4","46");
