INSERT INTO `series_episodes` VALUES("4982851","1","1","0","Loser+Like+Me","1","6","1420758000","83610","%0AFollowing+the+epic+failure+of+the+very+first+episode+of+her+semi-autobiographical+live+TV+series%2C+a+humiliated+%E2%80%93+and+now+unemployed+%E2%80%93+Rachel+flees+Hollywood+and+returns+home+to+Lima%2C+Ohio+looking+for+moral+support+and+a+reboot.+Unfortunately%2C+things+at+home+aren%E2%80%99t+any+better%2C+as+she+quickly+discovers+her+two+dads+are+in+the+midst+of+getting+a+divorce+and+their+family+home+is+being+sold.+Misery+loves+company%2C+and+Rachel+reconnects+with+Blaine%2C+who%2C+following+his+breakup+with+Kurt+and+being+cut+from+NYADA%2C+has+also+returned+home+to+Lima+to+lick+his+wounds%2C+and+has+taken+a+position+as+the+coach+of+the+all-male+Dalton+Academy+Glee+Club%2C+the+Warblers.+Also+back+home+is+Sam%2C+who+has+given+up+his+modeling+career+for+the+lower+stress+position+as+McKinley%E2%80%99s+assistant+football+coach%2C+and+proud+poppa+Will+has+taken+a+job+coaching+McKinley%E2%80%99s+bitter+rivals%2C+Vocal+Adrenaline.%0A%0AIn+the+interim%2C+Sue%2C+McKinley%E2%80%99s+new+principal%2C+has+remade+the+school+in+her+own+image%2C+disbanding+the+Glee+Club+and+ridding+the+school+of+every+last+remnant+of+New+Directions+%E2%80%93+and+all+arts+classes+and+clubs+in+general+%E2%80%93+and+turning+it+into+a+sports+powerhouse.+Meanwhile%2C+in+New+York%2C+Kurt+tries+to+move+on+with+his+post-Blaine+life+but+finds+himself+second-guessing+his+decision+and+getting+a+rude+awakening.+Back+at+McKinley%2C+following+an+attitude+intervention+by+her+friends%2C+Rachel+sets+her+sights+on+a+new+goal...+reinstating+the+arts+and+reviving+the+Glee+Club+at+McKinley...+but+it+comes+with+a+catch%2C+and+a+whole+new+set+of+challenges.","0","0");
