INSERT INTO `series_episodes` VALUES("351985","0","0","0","Sketch","2","2","1203289200","79773","Maxxie+has+a+creepy+feeling+that+someone+is+watching+him.+Someone+close+by.+A+hot+boy+maybe%3F+No+such+luck.+Sketch+is+Maxxie%E2%80%99s+stalker.+A+weird+loner%2C+who+spends+most+days+shut+up+in+a+poky+flat+looking+after+their+disabled+Mum.+So+their+attentions+turn+to+the+fit+blonde+boy+who+lives+on+the+estate.+Soon+everything+in+their+life+is+about+Maxxie+%E2%80%93+If+only+he+would+even+notice+them.+Meanwhile%2C+the+sixth+form+college+production+of+%E2%80%98Osama%3A+The+Musical%E2%80%99+is+teetering+towards+disaster+under+the+heavy-handed+guidance+of+lecherous+drama+teacher+Bruce.%0A%0ABut+Sketch+is+prepared+to+do+anything+to+get+leading+man+Maxxie%2C+and+if+they+can%E2%80%99t+have+him%2C+they%E2%80%99re+going+to+make+sure+nobody+can+-+and+especially+not+his+current+leading+lady+Michelle.+","7.7","24");
INSERT INTO `series_episodes` VALUES("352279","0","0","0","Sid","3","2","1203894000","79773","Sid+hasn%E2%80%99t+coped+at+all+well+with+the+fact+that+his+best+friend+Tony+is+a+shadow+of+the+man+he+was.+And+his+%E2%80%98girlfriend%E2%80%99+Cassie+moving+away+to+Scotland+hasn%E2%80%99t+helped+either%2C+particularly+when+he+catches+her+looking+like+she%E2%80%99s+having+the+time+of+her+life+with+a+pair+of+tartan-clad+boys.+So+his+mood+is+not+improved+much+when+his+Grandad%2C+a+notorious+Glaswegian+hard+bastard+arrives%2C+dying+of+cancer%2C+to+say+his+final+goodbyes.+He+has+never+liked+his+son+and+he+likes+his+Grandson+Sid+even+less.+So+his+arrival+makes+Sid%E2%80%99s+Dad%E2%80%99s+life+a+misery+too.%0A%0AEspecially+as+he%E2%80%99s+brought+Sid%E2%80%99s+Uncle+Sandy+and+his+two+weird+cousins+along+for+good+measure+too.+Multiply+all+this+by+ten+when+Sid%E2%80%99s+estranged+Mum+joins+in+to+play+happy+families.+So+it%E2%80%99s+Jenkins+family+meltdown.+And+when+Sid+comes+down+for+breakfast+he+ends+up+making+a+discovery+that+nothing+could+have+prepared+him+for.+Sometimes+life+is+just+too+sudden%2C+just+too+cruel.+So+Sid%E2%80%99s+life+crisis+deepens+into+a+chasm+of+despair%2C+what+he+really+needs+now+is+his+best+mate%2C+he+needs+Tony.+","8.3","23");
INSERT INTO `series_episodes` VALUES("355084","0","0","0","Michelle","4","2","1204498800","79773","So+Michelle%E2%80%99s+Mum+Anna+has+gone+and+done+it+again.+Married+another+new+husband.+And+worse%2C+Michelle+has+to+move+in+with+them+into+their+new+house.+But+even+worse%2C+this+time+Michelle+has+to+contend+with+a+new+big-titted%2C+emotionally-manipulative+step+sister+called+Scarlett.+Before+she+knows+what%E2%80%99s+happening%2C+Scarlett+is+invading+her+life%2C+co-opting+her+friends+and+offering+unwanted+advice+about+what+to+do+about+her+still+incapacitated+ex-boyfriend+Tony.%0A%0ASo+when+Scarlett+inveigles+herself+onto+Michelle%E2%80%99s+birthday+camping+trip+to+the+Gower+and+starts+to+move+in+on+the+emotionally+fragile+Sid%2C+Michelle%E2%80%99s+got+to+do+something.+Sid+needs+Michelle%2C+he%E2%80%99s+her+friend%2C+so+she+does+the+only+thing+she+knows.+But+who%E2%80%99s+that+arriving+back+from+Scotland+and+full+of+hope+for+Sid%3F+Now+that+is+bad+timing.step+in.+Sid+needs+a+friend%2C+Michelle.+But+Sid+has+always+had+a+thing+for+her+so+she+does+the+only+thing+she+knows.+Now+they+have+to+live+with+the+consequences.++Are+they+going+to+tell+Tony%3F+And+who%27s+that+arriving+back+from+Scotland+and+full+of+hope+for+Sid%3F+Now+that+is+bad+timing.","8","24");
INSERT INTO `series_episodes` VALUES("355085","0","0","0","Chris","5","2","1205103600","79773","Chris%E2%80%99+college+career+has+been+a+long+road+full+of+tribulations%3B+drugs%2C+petty+theft%2C+non+attendance+and+resounding+failure.+So+when+the+CCTV+cameras+catch+him+shagging+Buck+Tooth+in+the+Science+corridor%2C+the+College+Director+calls+time.+Chris+is+out.+And+out+of+his+college+accommodation+as+well.+Homeless%2C+family-less%2C+Chris+is+going+down+hill+fast%2C+until+Jal+steps+in+with+a+challenge.+She%E2%80%99ll+try+to+unwind+a+little+so+long+as+he+gets+his+act+together+and+gets+some+focus.%0A%0ASo+Chris+gets+a+job%2C+several+jobs%2C+in+fact+every+time+he%E2%80%99s+fired+he+gets+another+one%2C+and+he+moves+into+the+smallest+bed-sit+in+Bristol.+So+Jal%E2%80%99s+got+to+chill+out%2C+and+wow+when+she+does+she%E2%80%99s+pretty+gorgeous%2C+and+talented%2C+and+cool%2C+and...Could+Chris+have+had+his+eyes+opened+wider+than+any+drug+could+do%3F","8","21");
INSERT INTO `series_episodes` VALUES("355974","0","0","0","Tony","6","2","1205708400","79773","Tony%E2%80%99s+world+is+a+strange+one.+Isolated%2C+alone%2C+he+is+desperate+to+find+the+way+back+to+himself.+Since+the+accident+he+lives+in+a+world+of+half+understood+dreams.+He+tries+to+act+normal%2C+but+bumping+into+Sid+and+Michelle+at+a+club+sends+him+spiralling+again.+Nobody+understands+how+the+world+looks+to+him%2C+nobody+except+the+strange+beautiful+girl+he+meets+when+trying+to+escape+from+his+so-called+best+friend+and+ex-girlfriend.%0A%0AThe+next+day+Tony+heads+off+to+a+University+open+day+and+runs+into+her+again.+Who+is+she%3F+His+head+tells+him+that+she+is+an+angel.+But+can+he+ever+trust+his+head+again%3F","8","22");
INSERT INTO `series_episodes` VALUES("358202","0","0","0","Effy","7","2","1206313200","79773","What+is+it+about+Effy%3F+The+mysterious+one+had+a+lot+to+deal+with.+The+Stonem+family+home+is+in+disarray%2C+while+Dad+Jim+is+working+abroad%2C+Mum+Anthea+is+also+away%2C+with+the+fairies%3B+and+Tony+is+moping+after+Michelle.+On+top+of+this%2C+Effy+has+her+GCSE+art+coursework+deadline+looming.+So+solving+all+her+family%E2%80%99s+problems%2C+planning+her+academic+future%2C+as+well+as+sorting+out+the+%E2%80%98Tony+and+Michelle%E2%80%99%2C+%E2%80%98Sid+and+Cassie%E2%80%99+dilemma+is+all+she+needs+right+now.+And+then+on+top+of+this%2C+whilst+also+trying+to+maintain+her+reputation+for+being+the+wildest+kid+on+the+block%2C+she%E2%80%99s+lumbered+with+the+new+girl%2C+spoddy+Pandora.%0A%0ASo+how+weird+when+suddenly+Pandora+turns+out+to+be+best+friend+material.+Maybe+the+future%E2%80%99s+bright+after+all%2C+Effy+and+Pandora%E2%80%99s+future+at+least.","7.9","23");
INSERT INTO `series_episodes` VALUES("359574","0","0","0","Jal","8","2","1206914400","79773","Jal%E2%80%99s+got+a+secret+so+big+she+can%E2%80%99t+tell+anyone+until+she+works+out+what+the+hell+she%E2%80%99s+going+to+do+about+it.+But+Spanish+A-level+revision%2C+music+school+auditions%2C+and+needy+best+friends+are+pressing+down+on+her%2C+all+while+the+%E2%80%98secret%E2%80%99+is+starting+to+leak+out.+What%E2%80%99s+more%2C+Chris+has+asked+her+to+move+in+with+him+into+his+pokey+love+nest.+Jal+needs+someone%2C+but+will+a+visit+from+her+estranged+Mum+make+everything+better%3F+What+Jal+doesn%E2%80%99t+know+is+that+Chris+has+been+hiding+a+secret+all+of+his+own.","7.8","22");
