INSERT INTO `series_episodes` VALUES("424708","0","0","0","Everyone","1","3","1232578800","79773","It%E2%80%99s+the+first+day+of+term+at+Roundview+College+and+a+new+gang+is+forming.+Best+friends+Freddie+%28Luke+Pasqualino%29%2C+JJ+%28Ollie+Barbieri%29%2C+and+Cook+%28Jack+O%E2%80%99Connell%29+are+en-route+to+college.+Their+world+collides+with+Effy%E2%80%99s+%28Kaya+Scodelario%29%2C+and+Cook+is+intrigued+%E2%80%93+this+trouble+maker+has+met+his+match.+However%2C+both+Freddie+and+JJ+are+equally+smitten.%0A%0AIdentical+twin+sisters%2C+Katie+%28Megan+Prescott%29+and+Emily+%28Kathryn+Prescott%29%2C+prepare+for+their+first+day%3B+as+per+usual%2C+Katie+walks+all+over+her+sister+Emily.+Once+at+college%2C+Effy+and+Katie+clock+one+another+immediately%2C+whilst+Effy%E2%80%99s+best+mate+Pandora+%28Lisa+Backwell%29+tells+Effy+she+wants+to+lose+her+virginity+%22asap%22.%0A%0AAt+college%2C+Cook+tries+to+charm+the+girl+sitting+next+to+him+but+instead+winds+her+up.+Naomi+%28Lily+Loveless%29+doesn%E2%80%99t+suffer+fools+gladly+and+grasses+Cook+up.%0A%0AEffy+issues+smitten+Freddie%2C+JJ+and+Cook+with+a+challenge+to+be+completed+by+the+end+of+the+day.+The+winner+will+get+to+%E2%80%98know+her%E2%80%99+better.%0A%0AAnd+so+the+first+day+at+college+begins...+","7.1","25");
INSERT INTO `series_episodes` VALUES("427776","0","0","0","Cook","2","3","1233183600","79773","It%E2%80%99s+Cook%E2%80%99s+%28Jack+O%E2%80%99Connell%29+17th+birthday%2C+and+half+the+college+have+been+invited+to+his+uncle%E2%80%99s+pub+to+witness+a+night+Cook+believes+will+go+down+in+history.+The+girls+get+are+about+to+leave+when+Freddie+%28Luke+Pasqualino%29+gets+a+phone+call+from+his+sister+Karen+%28Klariza+Clayton%29.+She%E2%80%99s+at+her+best+friend+Kayleigh%E2%80%99s+%28Amy+Burnett%29+engagement+party+and+they+want+to+get+the+party+started.+The+gang+head+off+uninvited.%0ACook+attracts+the+attention+of+Kayleigh%E2%80%99s+dad%2C+notorious+local+gangster+Johnny+White+%28Mackenzie+Crook%29.+The+party+is+a+timid+affair%2C+so+-+ignoring+Freddie%E2%80%99s+warnings+about+Johnny+White+-+Cook+decides+to+do+as+the+Cookie+monster+does+and+up+the+tempo%2C+and+the+evening+takes+a+turn+for+the+worst.+The+gang+manage+to+escape%2C+but+split+up+afterwards+after+Cook+tries+to+come+onto+the+girls.+Freddie+tells+him+he+is+tired+of+looking+after+him+and+leaves+Cook+and+JJ+to+go+to+a+local+stripclub%2Fprostitute+agency%2C+where+JJ+refuses+to+go+further+than+kissing+and+Cook+overhears+Johnny+White+in+the+next+room.+He+plans+to+blackmail+him%2C+and+the+gangster+antagonises+him+until+JJ+has+to+forcibly+restrain+Cook+from+beating+him.+Cook+realises+what+he%27s+done+when+Johhny+tells+him%3A+%22The+next+time+I+see+you...you%27re+dead.%22+He+leaves+and+ends+up+outside+Freddie%27s+house+at+six+in+the+morning%2C+and+the+two+share+an+intense+heart-to-heart+about+their+friendship%2C+while+Freddie+agrees+to+look+after+him+again.+","7.2","24");
INSERT INTO `series_episodes` VALUES("427777","0","0","0","Thomas","3","3","1233788400","79773","In+this+episode%2C+Thomas+%28Merveille+Lukeba%29+arrives+alone+in+the+UK+from+the+Congo.+His+family+are+due+to+join+him+in+a+few+days%2C+and+he+has+to+find+somewhere+for+them+to+live.+He+finds+an+abandoned+flat+on+an+estate%2C+but+little+does+he+know+that+local+gangster+Johnny+White+%28Mackenzie+Crook%29+is+his+new+landlord%2C+and+there%E2%80%99s+no+way+Johnny%E2%80%99s+going+to+let+him+live+there+for+free.+Thomas+has+to+fend+for+himself%2C+but+a+chance+encounter+at+a+bus+stop%2C+and+a+mutual+love+of+doughnuts+brings+him+together+with+Pandora+%28Lisa+Backwell%29+and+Effy+%28Kaya+Scodelario%29.+They+head+to+Effy%E2%80%99s+house%2C+where+they+find+Effy%E2%80%99s+mum%2C+Anthea+Stonem+%28Morwenna+Banks%29%2C+has+a+surprise+visitor%2C+her+husband%E2%80%99s+boss%2C+Steve+%28David+Baddiel%29.+It%E2%80%99s+fate+for+Pandora+and+Thomas%2C+who+hit+it+off+immediately%3A+she+takes+him+to+see+her+Aunt+Elizabeth+%28Maureen+Lipman%29%2C+who+just+might+have+the+answer+to+Thomas%E2%80%99s+insolvency%2C+with+a+rather+unconventional+money-making+scheme.%0AThis+episode+was+written+by+Daniel+Kaluuya%2C+the+former+Posh+Kenneth+in+the+two+first+series+of+Skins+and+Bryan+Elsley.+","7.5","21");
INSERT INTO `series_episodes` VALUES("427778","0","0","0","Pandora","4","3","1234393200","79773","With+the+first+and+only+boy+Pandora%E2%80%99s+ever+fancied+having+been+deported%2C+Pandora+is+desperate+for+some+fun+and+decides+to+throw+a+party.+Unknown+to+Pandora%2C+Katie+has+used+some+special+ingredients+in+the+chocolate+brownies%2C+which+take+the+party+to+another+level.+Effy+knows%2C+but+hasn%E2%80%99t+warned+Pandora+or+her+mum+Angela+%28Sally+Phillips%29%2C+who+is+munching+happily+on+the+choccie+treats.+Effy+can+only+look+on+while+her+best+friend%E2%80%99s+mum%E2%80%99s+behaviour+gets+increasingly+bizarre.+Pandora+grabs+the+fun+where+she+can%2C+and+towards+the+end+of+the+evening+lets+her+heart+rule+her+head%E2%80%A6+but+will+she+regret+it+in+the+morning%2C+and+will+her+best+mate+forgive+her%3F+Also+guest+starring+%28David+Baddiel%29+as+Steve%2C+and+%28Harry+Enfield%29+as+Jim+Stonem.+","7.8","18");
INSERT INTO `series_episodes` VALUES("427780","0","0","0","Freddie","5","3","1234998000","79773","Freddie%E2%80%99s+the+black+sheep+of+his+family%2C+and+seen+as+a+waste+of+space.+His+big+sister+Karen+%28Klariza+Clayton%29+has+ambitions+-+she%E2%80%99s+reached+the+final+of+a+TV+talent+show+to+find+a+new+member+of+girl+group+Da+Sexxbombz.+Freddie+despises+her+lust+for+celebrity+but+is+emotionally+blackmailed+into+sticking+to+the+story+she+and+their+Dad%2C+Leo+%28Simon+Day%29%2C+are+spinning+about+their+dead+mother%2C+all+to+look+good+in+front+of+the+cameras%2C+and+thereby+increase+her+chances+of+success.+He+cringes+at+the+whole+thing.+If+this+wasn%E2%80%99t+bad+enough%2C+living+in+the+shadow+of+the+increasingly+reckless+Cook+is+becoming+too+much+to+bear.+When+Effy+turns+up+at+his+shed%2C+Freddie+doesn%E2%80%99t+know+what+to+do+with+himself.+There%E2%80%99s+a+connection+between+them%2C+there+always+has+been%2C+but+this+is+shattered+when+Cook+and+JJ+arrive.+He+feels+torn+between+his+family%2Chis+friends%2C+and+his+heart%2C+and+the+isolation+is+overwhelming.+Will+Freddie+start+to+put+himself+first%2C+or+will+he+retreat+to+his+shed%2C+and+beloved+skateboard%2C+as+he+always+has+before%3F+Featuring+a+special+guest+performance+from+DJ+Scott+Mills.","7.9","20");
INSERT INTO `series_episodes` VALUES("427781","0","0","0","Naomi","6","3","1235602800","79773","Naomi+%28Lily+Loveless%29+thinks+she+has+the+world+worked+out%2C+and+puts+people+in+their+appropriate+boxes.+There%27s+her+hippy+mum+%28Olivia+Colman%29%3B+the+adoration+from+Emily+%28Kathryn+Prescott%29%3B+Cook%27s+%28Jack+O%27Connell%29+insulting+misogyny%3B+and+her+politics+teacher%2C+Kieran%27s+%28Ardal+O%27Hanlon%29%2C+flattery.+She+thinks+she+has+them+all+sussed%2C+and+that+it%27s+only+her+who+can+see+the+truth.+However%2C+the+upcoming+student+elections+leave+her+at+a+loss%2C+and+her+insecurities+get+the+better+of+her.+The+trust+and+confidence+inspired+by+a+friend+encourages+her+to+stand+up+to+her+arch+rival%2C+the+antithesis+of+everything+she+stands+for%2C+as+her+and+Cook+go+head+to+head%3B+but+Naomi+learns+that+nothing+is+black+and+white+anymore.","7.9","20");
