INSERT INTO `series_episodes` VALUES("1247951","0","0","0","A+Culture+Show+Special","56","0","1185314400","71663","Not+long+before+the+anticipated+release+of+their+movie%2C+and+after+celebrating+the+400th+episode+and+20+years%2C+The+Culture+Show+paid+homage+to+the+great+success+of+The+Simpsons+with+this+special+half-hour+documentary+about+them.+Hosted+by+Lauren+Laverne+%28who+co-hosts+Culture+Show+along+with+the+great+film+critic+Mark+Kermode%29%2C+this+programme+basically+looked+back+from+their+first+appearance+on+The+Tracey+Ullman+Show+in+1987+and+episodes+gone+by+to+see+why+everyone+loves+this+cartoon+sitcom+so+much.+This+included+the+key+and+supporting+characters%2C+the+jokes%2C+the+celebrity+appearances%2C+the+writers%2C+the+mocking+of+everyday+things%2C+and+much+more%2C+a+great+one-off+documentary+with+plenty+of+clips%2C+information+and+opinion+to+keep+you+interested.+With+contributions+from+creator+Matt+Groening%2C+Ricky+Gervais%2C+Nick+Park%2C+Stephen+Hawking%2C+Phill+Jupitus%2C+Helen+Fielding+and+Johnny+Vegas.","0","0");
