INSERT INTO `series_episodes` VALUES("55708","0","0","0","Skinner%27s+Sense+of+Snow","8","12","977007600","71663","The+Simpson+family+goes+to+a+French+circus.++While+watching+the+show+a+freak+snowstorm+hits+the+circus+tent.++It%27s+a+relentless+snowstorm%3B+everything+closes%2C+except+for+Springfield+Elementary%3B+Principal+Skinner+doesn%27t+want+to+ruin+his+%22Cal+Ripken-like+streak+of+school+openage.%22%0A%0AWith+the+teachers+at+an+%22emergency+caucus%2C%22+Skinner+has+the+kids+sit+through+a+terrible+film.++When+they+go+to+leave+at+the+end+of+the+day%2C+they+find+that+the+school+is+snowed+in.++The+kids+start+to+revolt+against+Skinner%2C+so+he+gets+tough+with+them.+%0A%0AMeanwhile%2C+Homer+and+Flanders+go+to+save+the+kids%2C+but+get+stranded+in+a+snow+bank.++Skinner+loses+control+of+the+school+to+the+kids%2C+led+by+Bart+and+he+ends+up+trapped+in+a+bag.++The+kids+go+through+the+schools+records.++Skinner+sends+a+hamster+out+in+the+snow+in+an+attempt+to+save+himself.++%0A%0AHomer+and+Flanders+pass+out+due+to+carbon+monoxide+poisoning+and+Homer+has+bizarre+fantasies+about+ranch+dressing.+The+hamster+saves+them%2C+leaving+them+free+to+save+the+kids.++Skinner+and+Bart+agree+never+to+discuss+the+day+again.%0A","7.4","32");
INSERT INTO `series_episodes` VALUES("55709","0","0","0","HOM%D0%AF","9","12","978822000","71663","The+Simpson+family+goes+to+an+animation+convention.++Homer+falls+in+love+with+a+new+product+there+and+invests+the+family%27s+life+savings+in+a+company+that+soon+declares+super-duper+bankruptcy.++To+gain+their+life+savings+back%2C+he+sells+his+body+for+medical+testing.++The+doctors+find+something+odd+in+his+head+x-ray.++Homer+has+a+crayon+lodged+in+his+brain.++This+explains+why+he+is+such+a+moron.++He+thinks+it+is+because+he+shoved+crayons+up+his+nose+as+a+child.++When+the+doctors+remove+the+crayon%2C+he+gets+smarter.++This+allows+him+to+bond+with+Lisa.++In+fact+Homer+proves+to+be+even+smarter+than+she+is.++He+is+so+smart+that+he+accidentally+proves+there+is+no+God.++He+also+blows+the+whistle+on+the+plant%27s+nuclear+safety+violations.++So+the+nuclear+plant+has+to+close+and+everyone+hates+him.++He+can%27t+find+happiness+in+things+he+used+to+like+and+he+can%27t+fit+in+with+the+people+of+Springfield.++He+decides+to+have+Moe+%28a+licensed+surgeon%29+shove+another+crayon+into+his+brain+and+he+goes+back+to+being+a+blissful+idiot.++Lisa+understands+why+he+did+it+and+doesn%27t+hate+him+for+it.%0A","7.5","30");
INSERT INTO `series_episodes` VALUES("55710","0","0","0","Pokey+Mom","10","12","979426800","71663","The+family+attends+a+prison+rodeo+and+Marge+sees+artistic+potential+in+one+of+the+inmates+after+she+sees+some+of+his+work+hanging+in+the+prison+infirmary.+She+volunteers+to+teach+art+at+the+prison+and+then+vouches+for+her+artistic+inmate+at+his+parole+hearing.+Now+back+in+the+real+world%2C+the+inmate+needs+a+job+and+Marge+gets+him+one+at+the+school%2C+painting+a+picture+depicting+school+spirit.+His+take+on+school+spirit+and+Principal+Skinners+are+at+odds.+Meanwhile+Homer%2C+whose+back+was+injured+at+the+rodeo%2C+seeks+the+help+of+chiropractor.++He+soon+discovers+that+his+old+trashcan+is+just+as+effective+as+the+chiropractor%2C+so+he+dubs+it+%22Dr.+Homer%27s+Miracle+Spinal+Cylinder%22+and+goes+into+business+for+himself.+Until+the+chiropractors+take+their+revenge.%0A","7.1","22");
INSERT INTO `series_episodes` VALUES("55711","0","0","0","Worst+Episode+Ever","11","12","981241200","71663","Despite+being+banned+from+life+forever+from+the+comic+book+store%2C+Bart+and+Milhouse+take+over+its+management+when+the+Comic+Book+Guy+suffers+from+a+cardiac+episode%2C+%22the+worst+episode+ever%22.+Their+management+of+the+shop+is+fairly+successful%2C+until+they+discover+the+Comic+Book+Guy%27s+secret+stash+of+illegal+video+clips+and+begin+charging+admission+for+their+viewing.+Meanwhile%2C+the+Comic+Book+Guy+on+the+road+to+recovery+receives+tips+from+Homer+on+making+friends+to+no+avail.+Until+a+chance+meeting+with+Principal+Skinner%27s+mother+sparks+an+unusual+relationship.%0A","7.4","29");
INSERT INTO `series_episodes` VALUES("55712","0","0","0","Tennis+the+Menace","12","12","981846000","71663","The+Simpsons+go+to+an+old+folks%27+talent+show.++Homer+looks+into+getting+a+casket+for+Abe%2C+but+instead+decides+to+build+a+tennis+court.++He+doesn%27t+really+like+tennis%3B+he+got+it+confused+with+foxy+boxing.++All+the+locals+want+to+use+the+tennis+court.++The+Simpsons+are+the+L.A.+Clippers+of+tennis.++Everyone+mocks+them+behind+their+backs.++Marge+is+horrified+and+starts+to+become+competitive.++She+enters+Krusty%27s+tournament+without+Homer%2C+her+partner+is+Bart.++This+sets+up+a+situation+similar+to+that+of+Oedipus.++Homer+enters+the+tournament+with+Lisa+as+his+partner.++He+turns+her+against+Marge.++At+the+tournament%2C+there+are+a+number+of+tennis+pros+in+the+stands.++The+stakes+rise+when+Homer+recruits+Venus+Williams+and+drops+Lisa.++Marge+cries+foul%2C+so+she+is+allowed+to+have+Serena+Williams+as+a+partner.++Serena+then+dumps+Marge+and+successfully+recruits+Pete+Sampras.++Then+Venus+dumps+Homer+and+successfully+recruits+Andre+Agassi.+The+Simpson+family+then+makes+up.++With+the+tennis+court+in+their+backyard%2C+they+will+resume+playing+tennis+together%2C+right%3F%0A","7.2","21");
INSERT INTO `series_episodes` VALUES("55713","0","0","0","Day+of+the+Jackanapes","13","12","982450800","71663","Krusty+feels+pressure+from+the+network+to+change+his+show%2C+so+he+decides+to+retire+for+the+fifth+and+final+time.+Meanwhile%2C+in+prison+Sideshow+Bob+becomes+outraged+when+he+finds+out+that+Krusty+has+erased+his+past+by+taping+over+all+his+old+episodes.+He+gets+released+from+prison+and+begins+plotting+his+revenge.+First+he+gets+an+assistant+janitor+job+at+Springfield+Elementary+and+then+he+begins+turning+Bart+into+a+Krusty+killing+machine.+During+the+Krusty%27s+final+bow%2C+he+expresses+his+regret+for+what+he+did+to+Sideshow+Bob+just+a+Bart+is+about+to+kill+him%E2%80%A6%0A","7","27");
INSERT INTO `series_episodes` VALUES("55714","0","0","0","New+Kids+on+the+Blecch","14","12","983055600","71663","Homer+%22runs%22+in+the+Springfield+marathon%2C+but+when+Bart+crashes+the+end+of+the+race+an+unruly+mob+is+ready+to+lynch+him.+A+passing+stranger+rescues+him+and+offers+Bart+the+opportunity+to+join+a+new+boy+band+%22Party+Posse%22+as+the+bad+boy.+Other+members+of+this+new+band+include%2C+Milhouse%2C+Nelson+and+Ralph.+Using+NASA+technology+to+enhance+their+voices+they+might+just+make+it.+And+they+will%2C+until+it+is+revealed+that+their+videos+and+music+are+rigged+to+brainwash+people+into+joining+the+Navy.+Their+manager+goes+crazy+when+the+government+cuts+off+his+funding%2C+but+with+a+little+help+from+N%27+Sync%2C+the+boys+of+Party+Posse+try+to+save+the+staff+of+%22Mad+Magazine%22+from+certain+destruction.%0A","7.3","27");
INSERT INTO `series_episodes` VALUES("55715","0","0","0","Hungry+Hungry+Homer","15","12","983660400","71663","The+Simpson+family+goes+to+%22Blockoland%22.+When+Lisa+gets+ripped+off%2C+Homer+sticks+up+for+her+and+is+successful.++He+vows+to+start+helping+the+little+guy.++He+helps+Bart+get+a+girlfriend+and+helps+Marge+get+her+hair+streaked.++He+even+tries+to+help+Lenny+get+a+refund+from+the+Springfield+Isotopes%27+owner%2C+H.K.+Duff+VIII.++In+doing+so%2C+he+discovers+that+the+owner+is+moving+the+baseball+team+to+Albuquerque.++He+tries+to+tell+the+media+about+it%2C+but+they+don%27t+believe+him.++He+vows+to+go+on+a+hunger+strike+to+call+attention+to+the+situation.++This+seems+hopeless%2C+because+of+Homer%27s+voracious+appetite.++He+chains+himself+to+a+lawn+chair+and+starts+getting+a+lot+of+attention.++Then+management%2C+seizing+an+opportunity%2C+begins+exploiting+him+until+the+truth+finally+comes+out+about+the+Albuquerque+deal.%0A","7.2","29");
INSERT INTO `series_episodes` VALUES("55716","0","0","0","Bye+Bye+Nerdy","16","12","984265200","71663","A+new+kid+comes+to+Springfield+Elementary+and+Lisa+attempts+to+make+friends+with+this+new+girl%2C+but+for+all+her+trouble+she+just+winds+up+the+victim+of+this+female+version+of+Nelson.+Lisa+discovers+the+cause%3B+pheromones+given+off+by+nerds+are+what+attract+bullies+and+she+presents+her+findings+where+there+needed+most%2C+the+%2212th+Annual+Big+Science+Thing%22.+Meanwhile%2C+after+a+visit+from+a+baby+safety+consultant+gets+the+Simpson+home+safe%2C+Homer+decides+to+go+into+the+safety+industry%2C+making+Springfield+safe+for+all+children.%0A","7","25");
INSERT INTO `series_episodes` VALUES("55717","0","0","0","Simpson+Safari","17","12","986076000","71663","Maggie+eats+a+magazine+and+Marge+takes+her+to+the+hospital%2C+leaving+Homer+to+do+the+food+shopping.++Homer+abuses+a+bag+boy%2C+which+leads+to+the+bag+boys+going+out+on+strike.++With+them+on+strike%2C+the+family+does+not+go+grocery+shopping.++When+their+food+runs+out%2C+Homer+searches+the+house+for+food+and+he+finds+30%2B-year-old+animal+crackers.++When+he+opens+the+box%2C+he+finds+it+contains+a+golden+giraffe%3B+the+token%2C+which+indicates+the+recipient%2C+has+won+an+African+safari.++The+manufacturer+honors+the+prize+and+sends+the+Simpson+family+to+Africa.++Their+tour+of+the+African+wilderness+is+very+strange.++A+local+tribe+treats+them+to+a+concert.++Later%2C+when+a+hippo+tries+to+attack+Homer%2C+the+Simpson+family+escapes+on+a+makeshift+raft.++They+sail+down+river+and+end+up+having+to+fend+for+themselves+in+the+wilderness.++They+come+across+a+scientist+who+is+researching+monkeys.++When+poachers+come+to+take+the+monkeys%2C+the+Simpson+family+helps+him+to+fight+back.++Lisa+soon+discovers+that+the+researcher+actually+runs+a+chimp+diamond+mine+and+the+poachers+are+actually+Greenpeace.++The+Simpsons+fly+back+home.%0A","7.3","24");
INSERT INTO `series_episodes` VALUES("55718","0","0","0","Trilogy+of+Error","18","12","988495200","71663","Homer%27s+thumb+is+cut+off+following+breakfast+and+the+episode+follows+three+different+paths.+Homer%27s+day%3A+as+he+and+Marge+race+to+get+his+thumb+reattached.+Lisa%27s+day%3A+as+she+misses+the+bus+and+tries+to+get+to+school+so+that+she+can+win+the+science+fair%2C+but+finds+herself+at+one+point+at+West+Springfield+Elementary.+Bart%27s+day%3A+as+he+and+Milhouse+make+use+of+a+stash+of+fireworks+that+Fat+Tony+has+illegally+smuggled+into+the+country.+In+the+end+their+respective+paths+come+together.%0A","7.7","24");
INSERT INTO `series_episodes` VALUES("55719","0","0","0","I%27m+Goin%27+to+Praiseland","19","12","989100000","71663","When+he+can+stop+thinking+of+her+and+to+help+him+stop+living+in+the+past%2C+Ned+gets+the+Simpson+family+to+help+remove+all+the+reminders+of+Maude+he+has+around+the+house.++Only+one+item+misses+getting+thrown+into+the+chipper%2C+a+sketchbook+that+contains+Maude%27s+vision+of+a+Christian+amusement+park+called+%22Praiseland.%22++Ned+goes+on+a+quest+to+build+this+amusement+park%2C+which%2C+opens+to+lackluster+reviews%3B+describe+as+the+%22height+of+tedium%22.++When+suddenly+a+miracle+occurs%2C+as+a+Maude+mask+floats+in+front+of+the+Maude+statue.+It+is+quickly+discovered+that+anyone+who+stands+in+front+of+the+statue+has+visions.++Is+it+truly+a+miracle%2C+or+just+the+passing+of+gas%3F%0A","7.5","19");
INSERT INTO `series_episodes` VALUES("55720","0","0","0","Children+of+a+Lesser+Clod","20","12","989704800","71663","The+Simpsons+go+to+see+if+they+would+like+to+take+any+of+the+classes+at+the+YMCA.++Homer+tries+out+the+basketball+class+but+he+tears+the+ACL+in+his+knee.++He+can%27t+go+to+work+while+he+recovers+from+surgery.++He+is+bored+at+home.++He+tries+unsuccessfully+to+breed+the+dog+and+the+cat+to+each+other%2C+and+then+Homer+takes+care+of+Rod+and+Todd+one+evening.++When+he+finds+that+he+is+pretty+good+at+it%2C+he+starts+a+daycare+center.++He+still+neglects+Bart+and+Lisa%2C+making+them+jealous.++He+becomes+eligible+for+a+Good+Guy+award+for+his+service+to+the+community.++A+film+crew+follows+him+as+he+does+good+deeds.++Bart+and+Lisa+devise+a+plan+to+show+the+world+that+he+is+a+neglectful+father.++At+the+awards+ceremony%2C+they+show+home+movies+of+him.++When+he+ends+up+choking+Bart%2C+everyone+is+outraged.++Homer+flees+the+ceremony+with+the+kids+in+a+stolen+car.++The+police+catch+him+and+later+he+apologizes+to+Bart+and+Lisa+for+his+behavior.%0A","7.2","27");
INSERT INTO `series_episodes` VALUES("55721","0","0","0","Simpsons+Tall+Tales","21","12","990309600","71663","The+family+wins+a+trip+to+Delaware%2C+but+Homer+refuses+to+pay+the+tax+on+the+ticket%2C+so+they+ride+the+rails+and+meet+a+hobo+who+sings+and+tells+them+some+tall+tales.++The+first+is+the+tale+is+about+%22Paul+Bunyan%22+and+here+we+are+treated+to+Homer+playing+the+role+of+Paul+as+a+giant+doofus%2C+a+natural+role+for+him.++The+next+tale+shows+us+Lisa+as+%22Connie+Appleseed%2C%22+who+tries+to+convince+the+pioneers+to+eat+apples+instead+of+buffalo.++The+third+tale+isn%27t+really+tall%2C+it%27s+a+Mark+Twain+tale+about+Tom+Sawyer+%28Bart%29+and+Huckleberry+Finn+%28Nelson%29%2C+whom+go+on+the+run+when+Huck+won%27t+marry+Becky+%28Lisa%29.%0A","6.9","20");
INSERT INTO `series_episodes` VALUES("55722","0","0","0","Treehouse+of+Horror+XII","1","13","1005001200","71663","a%29.+%22hex+and+the+city%22%0A%0AThe+family+sees+a+gypsy%2C+but+Homer%27s+usual+ineptitude+causes+the+gypsy+to+seek+her+revenge+by+cursing+him+and+his+loved+ones.++In+an+effort+to+get+the+curse+lifted%2C+Homer+catches+a+leprechaun+and+releases+it+upon+the+gypsy+with+surprising+results.%0A%0Ab%29.+%22House+of+Whacks%22%0A%0AThe+family+home+obtains+an+upgrade%2C+the+Ultrahouse+3000%2C+a+computer+that+will+do+everything+for+them.++Everything+is+going+great+until+the+house+falls+in+love+with+Marge+and+tries+killing+Homer.%0A%0Ac%29.+%22Wiz+Kids%22%0A%0ABart+and+Lisa+are+attending+wizard+school.++The+evil+Lord+Montymort+and+Slithers+have+designs+on+capturing+Lisa%2C+so+that+Montymort+can+take+her+essence.++They+use+Bart%27s+rivalry+with+his+sister+as+the+means+to+get+at+her.%0A","7.2","39");
INSERT INTO `series_episodes` VALUES("55723","0","0","0","The+Parent+Rap","2","13","1005433200","71663","Abandoned+by+a+prize+seeking+Homer%2C+Milhouse+and+Bart+go+for+an+unintentional+joyride+in+Chief+Wiggum%27s+squad+car.++In+juvenile+court%2C+Milhouse+gets+his+case+dismissed%3B+however%2C+when+Bart+goes+up+before+Judge+Snyder+he+is+just+about+to+get+out+of+it%2C+when+the+judge%27s+vacation+starts.++The+replacement+judge+isn%27t+a+pushover+and+citing+Homer%27s+negligence+she+orders+that+Bart+and+Homer+be+tethered+together.++The+pair+attends+school%2C+work+and+Moe%27s+together+and+begin+bonding.++Frustrated+by+the+whole+situation+Marge+cuts+the+tether+and+is+caught.++Judge+Harm+decides+that+both+Bart%27s+parents+are+unfit%2C+so+she+has+Homer+and+Marge+put+into+stocks+and+put+on+public+display.++Homer+and+Marge+break+free+and+retaliate%2C+only+to+get+caught.++When+brought+before+Judge+Harm+they+are+about+to+have+the+book+thrown+at+them%2C+when+Judge+Snyder+returns+from+vacation+and+declares+that+boys+will+be+boys+and+dismisses+the+case.%0A","7.4","37");
INSERT INTO `series_episodes` VALUES("55724","0","0","0","Homer+the+Moe","3","13","1006038000","71663","Bart+is+digging+a+hole+in+the+backyard%2C+which+turns+into+Homer+telling+a+story+at+Moe%27s.+Moe+himself+is+feeling+depressed%2C+he+misses+his+bartending+school+alma+mater%2C+Swigmore+University.+The+guys+talk+him+into+going+back+and+Moe+leaves+Homer+in+charge+of+the+bar.+Back+at+school+Moe+meets+one+of+his+old+professors%2C+who+recommend+that+he+reinvent+his+%22crap-hole%22.+Upon+his+return%2C+the+reinvention+begins.+Now+called+%22M%22+it+becomes+an+exclusive+and+Duff-less+nightclub.+Feeling+like+outcasts%2C+Homer%2C+Lenny%2C+Carl+and+Barney+set+up+%22a+hunting+club%22+in+Homer%27s+garage%2C+where+there%27s+plenty+of+Duff+and+a+live+band%2C+REM.++Moe+decides+he+does+not+like+his+new+bar+and+tries+to+join+up+with+them+again.+Homer+goes+turkey+hunting+and+shoots+Moe+%28thinking+he+is+a+cougar%29%2C+renewing+their+friendship.++In+the+end%2C+the+Simpson+family%2C+Moe%2C+and+REM+all+celebrate+Thanksgiving+together.%0A","7.4","33");
INSERT INTO `series_episodes` VALUES("55725","0","0","0","Hunka+Hunka+Burns+in+Love","4","13","1007247600","71663","Homer%27s+foray+into+the+fortune+writing+business+leads+to+a+romance+for+Mr.+Burns.++Then+Burns+seeks+advice+from+Homer+when+he+starts+to+romance%2C+Gloria+his+new+found+love.++Things+look+good+for+Monty+who+proposes+marriage%2C+just+as+Gloria%27s+ex+arrives+on+the+scene%2C+Snake%2C+who%27s+just+recently+escaped+from+prison.++He+grabs+Gloria+and+Homer+and+takes+them+hostage%2C+leaving+Monty+and+the+police+to+affect+their+rescue.%0A","6.9","29");
INSERT INTO `series_episodes` VALUES("55726","0","0","0","The+Blunder+Years","5","13","1007852400","71663","Marge+falls+for+the+image+of+the+man+on+the+package+Burly+paper+towels.+Homer+and+Bart+scam+Marge+by+making+her+think+that+Chad+Sexington%2C+the+burly+paper+towel+model%2C+is+coming+to+dinner.++Who+shows+up+in+place+of+Chad%3F++A+shirtless+Barney.++To+make+up+for+her+humiliation%2C+Homer+takes+her+and+the+family+out+to+dinner+and+a+show.+A+featured+performer+on+the+bill+is+Mesmerino+and+Homer+offers+himself+up+for+hypnosis.+When+Homer+reverts+to+himself+at+12+years+old%2C+it+triggers+something+within+that+causes+him+to+start+screaming+incessantly.+With+the+use+of+some+Indian+Memory+Tea%2C+Homer+and+Moe%2C+recall+when+they+were+twelve+and+Homer+found+a+dead+body%2C+which+he+never+reported.+The+family+journeys+to+the+old+quarry+to+find+the+body%3B+which+they+do%2C+with+help+from+Chief+Wiggum+and+Burly+paper+towels.+They+follow+the+drainage+pipe+back+to+its+source%2C+The+pipe+leads+back+to+Burns%27+office+at+the+plant.+He+disposed+of+a+corpse+thirty+years+earlier.+It+was+the+corpse+of+Wayland+Smithers...+senior.+He+shows+an+old+film+to+prove+the+death+was+accidental.+Homer+and+Marge+journey+home%2C+with+Homer+feeling+satisfied.+Moe+visits+them+and+tells+about+how+he+cracked+the+case.%0A","7.1","31");
INSERT INTO `series_episodes` VALUES("55727","0","0","0","She+of+Little+Faith","6","13","1008457200","71663","Bart+orders+a+model+rocket+and+Homer+builds+and+tries+to+launch+it.++With+help+from+some+nerds+and+a+hamster+named+Nibbles%2C+a+new+rocket+is+built+and+launched%2C+but+results+in+the+church+being+destroyed.++The+church+looks+to+rebuild+and+Montgomery+Burns+offers+his+help%2C+but+only+if+he+can+run+the+church+like+a+business.++The+over+commercialization+of+the+rebuilt+church+puts+Lisa+off%3B+she+leaves+it+for+good+in+search+of+a+new+place+to+worship.++She+finds+Lenny%2C+Carl+and+Richard+Gere+at+a+Buddhist+temple.++Richard+gives+her+some+information+about+Buddhism+and+she+converts.++The+family+tries+to+use+Christmas+as+a+means+to+bring+Lisa+back+to+Christianity.++Realizing+what+they+are+doing+runs+to+the+temple+but+learns+from+Richard+that+Buddhism+allows+for+the+tolerance+of+other+beliefs.++So+as+Homer+puts+it%2C+she+can+%22pay+lip+service%22+to+Christianity+while+remaining+a+Buddhist.%0A","7.4","29");
INSERT INTO `series_episodes` VALUES("55728","0","0","0","Brawl+in+the+Family","7","13","1010271600","71663","The+family+is+going+through+problems.+A+social+worker+sets+out+to+fix+them+after+a+domestic+violence+charge.+He+is+horrified+at+Homer+when+the+vegas+wives+of+Homer+and+Ned+unexpectedly+come+to+Springfield.+Fed+up+with+vegas%2C+they+want+to+replace+Marge+and+Maude.+Ned%27s+new+wife+stays+with+him%2C+but+his+dorky+children+drive+her+crazy.+Homer+tries+unsuccessfully+to+get+an+annulment.+Homer%27s+vegas+wife+gets+him+kicked+out+of+the+house.+Marge+begins+to+feel+sorry+for+Homer%2C+so+she+devises+a+plan+to+get+rid+of+his+vegas+wife.+Homer+gets+her+drunk+and+marries+her+to+Abe.+She+is+so+distraught+over+being+Mrs.+Abraham+Simpson+that+she+and+Ned%27s+vegas+wife+flee%2C+running+down+evergreen+terrace.+Senile+as+ever%2C+grandpa+forgets+being+married+immediately.%0A","7.1","28");
INSERT INTO `series_episodes` VALUES("55729","0","0","0","Sweets+and+Sour+Marge","8","13","1011481200","71663","The+family+goes+to+the+library%27s+used+book+sale%3B+where+Homer+obtains+a+copy+of+Duff%27s+Book+of+World+Records.++When+he%27s+gone+through+all+the+records%2C+he+decides+to+set+one+of+his+own.++Duff+tells+him+that+all+the+personal+records+have+been+set.++He+needs+to+help+set+a+group+record.++The+town+tries+to+set+a+record+for+the+world%27s+tallest+human+pyramid%3B+but+when+they+fail%2C+they+inadvertently+set+the+record+as+the+world%27s+fattest+town%2C+which+they+celebrate.++Only+Marge+has+a+problem+with+this.++She+goes+to+the+Motherloving+Sugar+Company+to+lodge+her+complaint.++The+owner+Garth+Motherloving+is+less+than+cooperative%2C+so+Marge+files+a+class+action+lawsuit.++Professor+Frink+blows+the+whistle+on+%22big+sugar%22+and+the+court+rules+in+Marge%27s+favor+and+then+bans+all+sugar+from+Springfield+forever.++All+the+town%27s+sugar+products+are+burned+and+Apu%27s+store+shelves+are+empty.++Apu+brings+Homer+into+a+group+determined+to+smuggle+sugar+back+into+Springfield.++Homer+and+Bart+join+with+Apu%2C+Mr.+Burns%2C+Count+Fudgula+and+Garth+Mothelovering+in+a+scheme+to+smuggle+in+sugar+from+the+island+of+San+Glucose.++They+make+it+into+Springfield+Harbor%2C+but+are+intercepted+by+the+police.++Evading+Wiggum+and+Co.%2C+Homer+finds+himself+faced+with+the+decision+to+either+%22Dump+Cargo%22+to+make+Marge+happy+or+%22Obey+Bad+Guy%22+and+bring+sugar+to+Springfield.++He+chooses+the+former%2C+but+Judge+Snyder+realizes+that+he%27s+overstepped+his+authority+and+makes+sugar+legal+once+again.%0A","7.3","29");
INSERT INTO `series_episodes` VALUES("55730","0","0","0","Jaws+Wired+Shut","9","13","1012086000","71663","The+family+watches+the+gay+pride+parade+and+then+goes+to+the+movies.++Homer+loudly+protests+the+fact+that+the+movie+hasn%27t+started%2C+due+to+the+length+of+ads+and+previews.++When+the+ushers+chase+him+out+of+the+theatre%2C+Homer+runs+straight+into+the+glove+of+a+statue+of+fighter%2C+Drederick+Tatum%2C+and+breaks+his+jaw.++With+his+mouth+wired+shut+and+nothing+else+to+do%2C+Homer+becomes+a+great+listener+and+even+a+respectable+member+of+society%2C+which+delights+Marge.++After+his+jaw+has+healed%2C+Homer+continues+to+be+everything+he+never+was+before.++On+Afternoon+YAK+he+promises+to+not+revive+his+%22weckless%2C+weckless+ways%22.++Weeks+later+Marge+realizes+that+their+life+has+become+dull%2C+so+she+enters+the+family+car+in+a+demolition+derby+and+soon+finds+herself+in+trouble.++In+a+sequence+reminiscent+of+the+%22Popeye%22+cartoons%2C+Homer+sucks+down+a+can+of+Duff+and+comes+to+her+rescue.%0A","7.3","32");
INSERT INTO `series_episodes` VALUES("55731","0","0","0","Half-Decent+Proposal","10","13","1013295600","71663","Homer%27s+incessant+snoring+is+keeping+Marge+awake+and+the+cost+for+surgery+to+correct+the+problem+is+costly.++She+moves+in+with+Patty+and+Selma+to+get+some+sleep.++The+news+reports+that+Marge%27s+former+boyfriend%2C+Artie+Ziff%2C+is+the+5th+richest+man+in+America.++Patty+and+Selma+convince+Marge+that+she+should+contact+Artie%2C+so+they+send+an+e-mail+on+her+behalf.++Artie+receives+the+e-mail+and+reveals+his+20-year+obsession+with+Marge.++Artie+Ziff+flies+to+the+Simpson+home+and+takes+them+for+a+ride.++He+then+makes+an+indecent+proposal%2C+%241+million+for+Marge+to+spend+a+weekend+with+him%2C+so+they+she+might+find+out+what+life+would+have+been+like+with+him.++After+another+sleepless+night%2C+Marge+gives+it+serious+thought%2C+after+all+the+money+would+allow+them+to+pay+for+Homer%27s+much+needed+nasal+surgery.++Marge+goes+off+with+Artie+and+Homer+has+second+thoughts.++Artie+recreates+their+senior+prom+and+tries+to+kiss+Marge.++Marge+leaves+Artie+and+returns+to+home+find+out+that+Homer+has+left+town+with+Lenny.++On+the+road%2C+Homer+and+Lenny+get+a+job+at+oil+rig+in+West+Springfield%2C+which+is+%22three+times+larger+than+Texas%22.++Bart%2C+Lisa+and+Marge+figure+out+where+Homer%27s+at%2C+but+Marge+needs+help+from+Artie+to+find+out+exactly+where+he+is.++With+his+oil+rig+on+fire%2C+Homer+declines+rescue%2C+until+Artie+gives+up+on+Marge.++Artie+creates+a+solution+for+Homer%27s+snoring+problem%2C+which+at+a+subliminal+level+may+help+Artie+with+his+Marge+problem.%0A","6.8","24");
INSERT INTO `series_episodes` VALUES("55732","0","0","0","The+Bart+Wants+What+It+Wants","11","13","1013900400","71663","After+giving+up+the+Olympic+torch+that+Homer+has+stolen%2C+the+family+stops+in+at+a+carnival+being+held+at+a+private+school.++Bart+comes+to+the+aid+of+a+young+girl+being+bullied.++The+girl+is+the+daughter+of+Rainier+Wolfcastle+and+she+invites+Bart+to+come+to+her+house+sometime.++Bart+goes+to+Greta%27s+home+and+has+a+great+time.++The+Wolfcastles+come+to+the+Simpson+home+and+Greta+expresses+her+interest+in+Bart%2C+although+he+is+a+little+slow+on+the+uptake.++On+Bart%27s+next+visit+he+brings+Milhouse.++Greta+invites+Bart+to+her+school+dance%2C+only+Bart+finds+out+that+Skinner+is+going+to+be+performing+stand-up+comedy+and+he+can%27t+resist.++Skinner%27s+act+bombs%2C+much+to+Bart%27s+delight.++Working+with+the+theory+that+%22women+are+easy%2C+state+capitals+are+hard%22%2C+Bart+breaks+up+with+Greta.++For+revenge+Greta+starts+hanging+out+with+Milhouse.++She+then+joins+her+dad+for+a+film+shoot+in+Toronto.++Bart+asks+the+family+if+they+can+go+to+Toronto.++At+Paramountie+Studios+Bart+finds+Greta+only+to+find+out+that+she+interested+in+either+Bart+or+Milhouse%2C+so+they+both+join+the+Canadian+Olympic+Basketball+team.++Back+in+Springfield%2C+Skinner%27s+act+still+sucks.%0A","7.3","25");
INSERT INTO `series_episodes` VALUES("55733","0","0","0","The+Lastest+Gun+in+the+West","12","13","1014505200","71663","Bart+has+a+day+that+gets+better+and+better%2C+until+it+starts+really+sucking+when+a+crazy+dog+that+hates+him+for+no+known+reason+starts+stalking+him.++Bart+is+chased+by+the+dog+and+he+escapes+from+the+dog+by+climbing+a+fence+into+the+yard+of+Buck+McCoy%2C+a+former+star+of+western+films.++Bart+learns+more+about+Buck%27s+history+and+back+at+home+when+Bart+mentions+that+Buck+is+about+the+greatest+guy+who+ever+lived%2C+Homer+gets+jealous.++Buck+comes+to+the+Simpson%27s+home+for+dinner+and+Bart+brings+the+western+look+to+Springfield+Elementary.++Bart+and+Lisa+get+Buck+to+appear+on+%22The+Krusty+the+Clown+Show%22%2C+but+Buck+hasn%27t+appeared+on+live+television+in+years%3B+so+to+calm+his+nerves%2C+he+starts+drinking.++A+drunken+Buck+shoots+up+the+Krusty+the+Clown+set%2C+and+Krusty+himself.++As+a+result+Bart+has+lost+his+new+hero+and+Homer+who+should+feel+happy+about+it+isn%27t.++So+he+and+Marge+go+to+Buck%27s+to+try+sobering+him+up.++When+Snake+and+his+gang+are+robbing+Springfield%27s+National+Bank%2C+Homer+suggests+that+Buck+stop+the+robbery+to+help+restore+his+son%27s+faith+in+the+old+cowboy.++A+couple+of+twirls+of+Buck%27s+lariat+soon+put+an+end+to+the+robbery.%0A","6.9","20");
INSERT INTO `series_episodes` VALUES("55734","0","0","0","The+Old+Man+and+the+Key","13","13","1015714800","71663","Homer+is+anxiously+awaiting+the+start+of+the+new+XFL+season+when+the+Springfield+Retirement+Castle+calls+to+report+the+death+of+Abraham+Simpson%2C+but+the+report+is+a+mistake.++A+new+woman+moves+in+down+the+hall+and+Grandpa+decides+that+he+wants+to+be+able+to+drive+a+car+again%2C+one+so+that+he+can+feel+alive+again+and+two+so+that+he+can+impress+the+new+woman%2C+Zelda.++With+his+new+license+in+hand%2C+Grandpa+borrows+Homer%27s+car+for+a+series+of+dates+with+Zelda.++In+a+role+reversal%2C+Homer+has+to+lay+down+the+law+when+Abe+stays+out+with+the+car+all+night.++Abe+runs+into+trouble+at+the+Kwik-E-Mart+with+a+rival+gang+of+retirees+that+results+in+him+competing+in+a+death+race.++Abe+wins+the+race%2C+but+Homer%27s+car+is+ruined.++Homer+revokes+Abe+driving+privileges.++Zelda+has+a+reservation+in+Branson+and+she+goes+with+Abe%27s+rival.++Abe+steals+Marge%27s+car+and+goes+with+Bart+to+Branson+to+get+her+back.++When+they+get+there+Abe+actually+just+gets+back+at+her+and+calls+her+the+%22hootchie%22+everybody+said+she+was.%0A","6.9","20");
INSERT INTO `series_episodes` VALUES("55735","0","0","0","Tales+From+the+Public+Domain","14","13","1016319600","71663","Homer+gets+a+letter+from+the+library+telling+him+about+an+overdue+book.++He+checked+it+out+when+Bart+was+born+to+have+something+to+read+his+child.++Lisa+suggests+that+he+read+them+some+stories+from+it+now.++Homer+starts+by+telling+the+tale+of+the%E2%80%A6%0A%0Aa%29.+%22Odyssey%22%0A%0AHomer+is+Odysseus%2C+who+delivers+a+Trojan+horse+to+the+King.++After+his+troops+are+victorious%2C+Odysseus+ticks+off+the+gods+by+refusing+to+make+a+sacrifice.++They+take+their+revenge+upon+him+when+they+blow+him+and+his+crew+off+course%2C+where+they+almost+meet+the+Sirens+and+finally+Circe%2C+who+turns+his+men+into+pigs.++After+Odysseus+eats+his+men%2C+he+has+to+cross+the+river+Styx+to+return+home.++When+he+arrives+he+takes+out+the+trash.%0A%0Ab%29.+%22Joan+of+Arc%22%0A%0ALisa+is+Joan+in+this+retelling+of+the+story+of+Joan+of+Arc.++Joan+sets+out+to+help+lead+the+French+army+to+victory+against+the+English%2C+which+she+does%2C+until+she+is+captured.++Joan+is+found+guilty+and+is+about+to+be+burned+at+the+stake%2C+when+Marge%2C+not+much+for+tragic+endings%2C+changes+the+ending+so+that+Joan+lives.%0A%0Ac%29.+%22Hamlet%22%0A%0ABart+is+Hamlet+and+Homer+asks+him+to+avenge+his+death.++Moe+%28as+Uncle+Claudius%29+had+Homer+killed+so+that+he+could+marry+the+queen+%28Marge%29+and+take+over+the+kingdom.++Hamlet+discovers+the+king%27s+treachery+and+goes+to+avenge+his+father%27s+death.++When+he+kills+the+wrong+man%2C+he+must+duel+with+Laertes+%28Ralph%29.++When+Laertes+dispatches+himself%2C+Hamlet+kills+Uncle+Claudius%2C+then+himself.++Rather+than+clean+up+the+mess%2C+the+queen+also+dispatches+herself.++Everyone+is+dead.%0A%0ABart+can%27t+believe+how+boring+the+last+story+was%2C+but+Homer+reminds+him+that+is+also+became+a+great+movie+called+%22Ghostbusters.%22++The+family+dances+as+the+theme+to+that+classic+film+plays+in+the+background.%0A","6.9","28");
INSERT INTO `series_episodes` VALUES("55736","0","0","0","Blame+It+on+Lisa","15","13","1017529200","71663","The+family+receives+a+%24400+phone+bill+for+a+phone+call+to+Brazil.++Marge+and+Homer+go+down+to+the+phone+office+to+get+this+error+corrected%2C+they+didn%27t+make+the+call.++Their+visit+results+in+their+phone+service+getting+cut+off.++Homer+tries+to+steal+phone+service%2C+but+gets+electrocuted+for+his+trouble.++Lisa+confesses+to+making+the+call+and+tells+them+of+the+donations+she%27d+made+for+an+orphan+boy+named+Renaldo+in+Brazil%2C+with+whom+she%27d+lost+contact+with.++The+family+decides+to+make+a+trip+to+Brazil+to+find+him.++The+family+flies+down+to+Rio%2C+as+Maggie+takes+care+of+herself%2C+under+the+watchful+eyes+of+Patty+and+Selma.++They+split+up+with+Lisa+and+Marge+looking+on+one+side+of+town+and+Homer+and+Bart+on+the+other.++Homer+gets+kidnapped+when+he+gets+into+an+unlicensed+taxi.++The+kidnappers+take+Homer+up+the+Amazon.++Marge+reports+the+kidnapping+to+an+uncaring+police+department+and+Homer+tries+to+raise+the+%2450%2C000+on+his+own.++Lisa+finds+Renaldo+working+for+the+kids+show+that+Bart+has+watched+with+great+sexual+interest+since+arriving+in+Rio.++Renaldo+is+now+wealthy%2C+thanks+to+the+new+dancing+shoes+Lisa%27s+donation+purchased+for+him%2C+so+he+gives+Lisa+the+%2450%2C000+that+will+let+them+get+Homer+from+the+kidnappers.++The+transfer+is+made+and+Homer+is+returned%2C+but+as+we+leave+our+friends+in+Rio%2C+Bart+is+celebrating+Carnival+in+the+belly+of+a+snake.%0A","7.1","32");
INSERT INTO `series_episodes` VALUES("55737","0","0","0","Weekend+at+Burnsie%27s","16","13","1018130400","71663","Marge+plants+her+own+garden+and+when+the+crows+arrive+she+puts+up+a+scarecrow.++Homer+himself+is+scared+by+the+scarecrow%2C+so+he+sneaks+upon+it+and+destroys+it.++As+a+result%2C+the+crows+look+up+to+him+as+their+leader.++The+crows+hang+out+with+him+wherever+he+goes.++The+crows+eventually+overstay+their+welcome+and+Homer+tries+to+shoo+them+away%2C+the+respond+by+attacking+him.++At+the+hospital%2C+when+Homer+asks+Dr.+Hibbert+what+can+be+done+for+the+pain+in+his+eyes+Dr.+Hibbert+prescribes+medical+marijuana.++Homer+starts+getting+legally+high.++At+one+point%2C+in+his+high+state+of+mind%2C+Homer+allows+Flanders+to+read+the+entire+bible+to+him.++Flanders+is+also+gets+Homer%27s+signature+on+a+petition+to+get+a+ban+on+medical+marijuana+added+to+the+next+election%27s+ballot.++Being+high+at+work+also+does+a+wonder+for+his+career+at+the+power+plant%2C+because+when+Homer+laughs+at+all+of+Mr.+Burn%27s+jokes+he+is+given+a+promotion+to+executive+vice-president.++Homer+finds+out+about+the+ban+being+added+to+the+ballot+and+a+rally+is+organized+in+protest.++The+band+Phish+appears+at+the+rally%2C+but+the+attendees+%22have+spaced+on+the+date%22%2C+they+held+their+rally+one+day+after+the+election%3B+so+medical+marijuana+has+been+banned.++The+medical+marijuana+is+burned.++Homer%27s+medical+condition+was+long+since+cured%2C+Homer+promises+to+never+to+smoke+pot+again.++Mr.+Burns+calls+Homer+into+help+with+his+speech.++Mr.+Burns+need+to+raise+%2460+million+to+appease+his+investors.++Homer+tries%2C+but+Smithers+needs+the+use+of+Homer%27s+last+joint+to+think+any+of+Mr.+Burn%27s+speech+is+funny.++When+Mr.+Burns+appears+to+dead+from+drowning+in+his+bathtub%2C+Smithers+and+Homer+turn+him+into+a+marionette+so+that+he+can+still+appear+before+the+investors.++A+dance+performance+by+the+strung+up+Mr.+Burns+gets+his+heart+started+again+and+he+has+recovered+well+enough+to+learn+that+the+in