INSERT INTO `series_episodes` VALUES("55738","0","0","0","Gump+Roast","17","13","1019340000","71663","Our+story+begins+a+la+%22Forrest+Gump%22%2C+with+Homer+sitting+on+a+park+bench+waiting+for+the+rest+of+the+family+to+arrive.++While+Chief+Wiggum+initially+tells+him+isn%27t+interested+in+hearing+Homer%27s+life+story+initially%2C+he+becomes+intrigued+as+Homer+goes+right+into+it%2C+in+the+form+of+flashbacks+%28clips%29.++Homer+is+picked+up+and+brought+blindfolded+to+the+Springfield+Friar%27s+Club+where+emcee+Krusty+the+Klown+and+other+friends+and+family+roast+Homer+with+their+memories+%28more+clips+from+past+episodes%29.++Bart+and+Lisa+start+followed+by+Mr.+Burns%2C+Grampa+Simpson+%26+Agnes+Skinner%2C+Reverend+Lovejoy+%26+Ned+Flanders+%28a+la+%22The+Smothers+Brothers%22%29.++The+proceedings+are+interrupted+by+Kodos+and+Kang%2C+whom+rest+the+entire+fate+of+humanity+upon+one+human+being%2C+Homer+Simpson%3B+they+cite+him+as+%22the+fat+selfish+epitome+of+modern+man%22.++They+probe+him+revealing+more+clips%2C+which+helps+prove+to+them+that+humans+are+unfit+to+continue+existing.++Lisa+talks+them+into+probing+the+innocent+mind+of+a+child.++The+probing+of+Maggie%27s+mind+reveals+to+Kodos+and+Kang+the+most+important+thing+of+all+for+them%3B+Earth+is+where+there+favorite+celebrities+live.++Kodos+and+Kang+attend+the+%22People+Choice+Awards%22+and+the+episode+ends+with+a+wacky+little+ditty+celebrating+more+clips%2C+but+telling+the+viewers+%22not+to+fear%2C+they+have+stories+for+years.%22%0A","6.9","24");
INSERT INTO `series_episodes` VALUES("55739","0","0","0","I+Am+Furious+Yellow","18","13","1019944800","71663","Springfield+Elementary+finally+gets+a+career+day+speaker+that+keeps+the+children%27s+interest.++The+creator+of+cartoon+inspires+the+children+to+come+up+with+their+own+cartoon+characters.++Bart+makes+an+initial+comic+strip+of+%22Danger+Dude%2C%22+which+he+shows+to+the+Comic+Book+Guy+and+Marvel+Comics+creator+Stan+Lee+who+happens+to+stop+by+the+comic+book+shop%2C+but+never+leaves.++Their+feedback+leads+Bart+to+search+for+other+inspiration%2C+which+he+finds+in+his+own+father.++He+makes+Homer+the+main+character+in+a+comic+that+he+calls+%22Angry+Dad%22.++It+becomes+very+popular+and+an+Internet+company+wants+to+make+%22Angry+Dad%22+an+Internet+cartoon.++They+offer+Bart+stock+in+return+for+use+of+his+strip.++%22Angry+Dad%22+becomes+even+more+popular%2C+but+when+Homer+sees+it+at+work%2C+he+goes+home+very+angry.++The+citizens+of+Springfield%2C+who+see+him+in+his+car+angry%2C+try+to+make+him+angrier+to+see+what+he%27ll+do.++The+family+realizes+that+Homer+has+anger+management+issues.++Homer+resolves+to+take+it+easy%2C+leaving+Bart+without+any+material.++Bart+sets+an+elaborate+trap+to+anger+the+now+sedate+Homer.++Bart+finds+out+that+the+Internet+company+has+gone+bankrupt+and+doesn%27t+need+his+new+material%2C+just+as+Homer+takes+the+bait+for+the+trap.++Homer+gets+green+with+anger%2C+a+la+The+Incredible+Hulk+and+it+turns+out+Bart+has+saved+Homer%27s+life%3B+since+the+pent+up+rage+would+have+killed+him.%0A","7.1","24");
INSERT INTO `series_episodes` VALUES("55740","0","0","0","The+Sweetest+Apu","19","13","1020549600","71663","My+goodness+how+the+octuplets+have+grown%21++As+we+see+when+Manjula+has+brought+the+children+to+Kwik-E-Mart.++After+the+children+have+left%2C+Apu+believes+that+the+Squishee+delivery+lady+has+made+a+pass+at+him%2C+by+calling+him+handsome.++The+Simpson+family+is+participating+in+the+Civil+War+reenactment.++Homer+gets+Barney+%28playing+General+Grant%29+to+drink+a+mug+of+beer.++The+reenactment+is+%22ripe+with+inaccuracies.%22++Homer+goes+back+to+the+Kwik-E-Mart+and+discovers+Apu+making+out+with+the+Squishee+lady%2C+he+back+out+of+the+store+all+the+way+home+and+into+bed.++He+has+nightmares+about+the+encounter+and+tells+Marge+guesses+at+what+he%27s+seen.++They+both+have+difficulty+facing+Apu+and+Manjula+together.++They+confront+Apu+and+soon+Manjula+finds+out.++She+throws+him+out.++Marge+and+Homer+concoct+a+plan+to+bring+Manjula+and+Apu+back+together.++Apu+asks+for+forgiveness%2C+but+gets+divorce+papers+instead.++Apu+is+about+to+end+it+all%2C+when+Manjula+is+willing+to+take+him%2C+provided+he+meets+with+her+list+of+demands.%0A","7","25");
INSERT INTO `series_episodes` VALUES("55741","0","0","0","Little+Girl+in+the+Big+Ten","20","13","1021154400","71663","Lisa+is+failing+gym.++So+that+she+won%27t+fail+and+lose+the+Springfield+Elementary+the+only+accreditation+they+have%2C+Principal+Skinner+gets+Lisa+a+private+coach.++After+seeing+a+vision+of+President+Kennedy%2C+Lisa+is+inspired+to+give+gymnastics+her+best+shot.++While+Bart+is+spending+time+with+Grandpa+he+gets+bitten+by+a+Chinese+mosquito.++Lisa+finds+out+that+her+fellow+gymnastics+students+are+actually+college+age%2C+and+rather+than+be+embarrassed+by+her+real+age%2C+she+lets+them+think+she+is+college+age+as+well.++Bart+is+diagnosed+with+%22Panda+virus%22+which+makes+him+contagious%2C+so+Dr.+Hibbert+puts+him+in+a+plastic+bubble+for+a+week.++Meanwhile+Lisa+has+started+hanging+out+with+college+age+students+at+a+coffee+house+listening+to+Robert+Pinsky+read+his+poetry.++Bart+starts+using+his+plastic+bubble+to+rescue+nerds+from+the+bullies.++Some+of+those+nerds+follow+Lisa+when+they+think+she+is+up+to+something.++They+find+her+at+college+analyzing+%22Itchy+and+Scratchy%22+cartoons+and+Milhouse+exposes+her.++Embarrassed+she+leaves+and+back+at+home%2C+she+gets+in+trouble+for+going+to+college+%2816+credit+hours+worth%29+and+her+fellow+grade+school+students+won%27t+relate+with+her+anymore.++She+gets+advice+from+Bart+on+how+to+win+them+back%2C+which+she+does+by+making+a+splash+on+the+cake+created+for+Seymour+Skinner+Day.%0A","7.2","24");
INSERT INTO `series_episodes` VALUES("55742","0","0","0","The+Frying+Game","21","13","1021759200","71663","Homer%27s+ordered+Marge+an+anniversary+gift%2C+a+pond+for+the+backyard.++The+new+pond+attracts+a+screaming+caterpillar.++The+%22screamapillar%22+as+the+family+finds+out+is+an+endangered+species+and+by+law+they+are+responsible+for+its+well+being.++When+Homer+believes+he+has+killed+the+insect+he+tries+to+hide+that+fact.++The+%22screamapillar%22+is+okay%2C+but+Homer+is+found+guilty+of+%22attempted+insecticide%22+and+%22aggravated+buggery%22+and+is+sentenced+to+200+hours+of+community+service.++Homer+begins+delivering+%22Meals+on+Wheels%22+and+runs+scared+into+the+closet+when+one+of+his+elderly+clients+appears+to+be+threatening+him+with+an+axe.++It+turns+out+she+is+just+a+kindly+old+woman%2C+who+asks+Homer+to+join+him+for+some+company.++He+starts+lending+her+a+hand%2C+and+she+seems+to+be+taking+advantage+of+him.++Marge+goes+to+see+her+and+then+finds+herself+helping+the+old+woman+as+much+as+Homer+has+been.++When+the+old+woman+turns+up+dead%3B+Homer+and+Marge+are+considered+top+suspects%2C+when+they+are+named+beneficiaries+of+the+woman%27s+will.++They+suspect+the+%22man+with+braces%2C%22+who+they+saw+leaving+the+scene.++Everyone+suspects+them.++When+the+woman%27s+diamond+necklace+is+found+in+their+home%2C+they+are+arrested.++The+children+are+sent+to+a+yokel+foster+home+and+Marge+and+Homer+are+found+guilty+and+sentenced+to+the+electric+chair.++When+Homer+realizes+that+Marge+is+going+to+miss+the+children%2C+he+confesses+to+the+crime%2C+which+allows+for+her+release.++On+the+electric+chair+Homer+is+about+to+be+electrocuted+when+it+is+revealed+he+is+a+participant+on+a+new+reality+game+show+%22Frame+Up%22.++The+man+with+the+braces+is+the+host%2C+and+Homer%27s+murder+victim+is+actually+still+alive.++The+old+woman+is+actually+Carmen+Electra+in+disguise.++Homer+is+freed%2C+but+disgusted+that+people%27s+lives+are+toyed+with+for+TV+ratings%3B+this+he+says+while+looking+Carmen+Electra+directly+in+the+breasts.%0A","7.5","19");
INSERT INTO `series_episodes` VALUES("55743","0","0","0","Papa%27s+Got+a+Brand+New+Badge","22","13","1022018400","71663","Springfield+is+in+the+midst+of+a+heat+wave.++The+nuclear+plant+is+at+capacity+and+when+one+of+its+crack+employees%2C+Homer+Simpson%2C+plugs+in+just+one+appliance+too+many%2C+the+city+has+a+blackout.++Looting+begins+and+the+police+are+ineffective.++In+an+attempt+to+try+doing+something+right+for+a+change%2C+Homer+starts+his+own+security+company+to+help+keep+order.++Chief+Wiggum+finds+himself+without+a+job%2C+when+Mayor+Quimby+decides+that+%22Spring+Shield%22+security+should+become+the+city%27s+new+police+force.++Homer+shuts+down+one+of+Fat+Tony%27s+operations+and+with+that+crime+is+non-existent.++Fat+Tony+makes+a+public+announcement+that+he+is+going+to+gun+down+Homer+if+he+isn%27t+out+of+town+by+tomorrow+at+noon.++Homer+appeals+for+help%2C+only+no+one+of+importance+offers+to+help.++The+following+day%2C+Fat+Tony+and+New+Jersey+associates+a+la+The+Sopranos+go+to+the+Simpson+home.++Shots+ring+out%2C+effectively+wounding+Fat+Tony+and+friends.++Homer+decides+to+give+his+badge+to+the+next+person+he+sees%2C+which+happens+to+be+Clancy+Wiggum.++He+comments+that%27s+the+way+he+got+the+job+in+the+past%2C+he+also+disavows+any+knowledge+of+the+shots%3B+but+we+know+who+the+shooter+is%2C+it%27s+Maggie+Simpson.%0A","7.1","22");
INSERT INTO `series_episodes` VALUES("55744","0","0","0","Treehouse+of+Horror+XIII","1","14","1036278000","71663","The+family+%28along+with+Ned+Flanders%29+holds+a+s%C3%A9ance+which+brings+the+ghost+of+Maude+Flanders+back+from+the+grave.++With+her+presence+in+the+room%2C+she+opens+a+book+which+brings+us+these+three+tales.%0A%0Aa%29.+%22Send+in+the+Clones%22%0A%0AHomer+finds+that+his+new+hammock+is+capable+of+making+clones%2C+and+he+begins+making+and+using+the+clones+to+do+all+of+his+chores.++When+one+of+the+clones+permanently+takes+care+of+Flanders%2C+Homer+decides+to+get+rid+of+the+clones+and+the+hammock.++So+he+takes+them+both+out+to+cornfield+where+he+leaves+them.++Only+the+clones+begin+using+the+hammock+and+start+to+proliferate+themselves+at+an+enormous+rate%2C+soon+the+town+of+Springfield+is+under+invasion+by+an+army+of+Homer+clones.++It%27s+up+to+Lisa+to+give+the+army+a+suggestion+that+help+them+eliminate+the+clone+problem.%0A%0Ab%29.+%22The+Right+to+Keep+and+Scare+Harms%22%0A%0ALisa+finds+the+grave+of+William+Bonney+who+was+killed+by+gun+violence.++In+his+memory%2C+she+starts+a+gun+control+crusade%2C+which+makes+Springfield+totally+gun-free%3B+even+the+police+no+longer+have+guns.++Now+defenseless%2C+the+corpse+of+William+%22Billy+the+Kid%22+Bonney+and+his+cohorts+rise+from+the+dead+and+start+raising+havoc+in+town.++Professor+Frink+develops+a+time+machine%2C+which+Homer+uses+to+go+back+to+the+recent+past+to+stop+the+ban+on+guns.%0A%0Ac%29.+%22The+Island+of+Dr.+Hibbert%22%0A%0AThe+family+takes+a+trip+to+%22The+Island+of+Lost+Souls%2C%22+where+they+find+Dr.+Hibbert+is+running+the+island%27s+resort.++Marge+thinks+that+something+creepy+is+going+on+there%2C+but+when+she+goes+off+to+investigate+she+is+captured+by+Dr.+Hibbert+who+turns+her+into+a+cat+woman.++Homer+goes+in+search+of+a+cure+for+Marge%27s+condition+and+encounters+Ned+Flanders+%28who+needs+to+be+milked%29.++Flanders+takes+Homer+to+meet+the+others+who%27ve+been+converted+into+beasts.++While+initially+horr