INSERT INTO `series_episodes` VALUES("55747","0","0","0","Large+Marge","4","14","1038092400","71663","Marge+sees+Homer+flirting+with+two+women+and+later+tries+to+decide+whether+he+is+still+interested+in+her+or+not.++Homer%27s+response+is+to+fall+asleep.++Meanwhile%2C+Bart+and+Milhouse+are+watching+Krusty+playing+the+villain+%22Clownface%22+on+an+episode+of+the+old+Batman+television+series+and+are+inspired+to+recreate+the+carousel+sequence.++Marge+asks+Manjula+what+she+should+do+about+Homer+and+Manjula+responds+by+taking+her+to+a+plastic+surgery+clinic.++Marge+goes+in+for+a+liposuction+procedure+and+winds+up+with+breast+implants.++The+doctor+gives+her+48+hours+to+try+living+with+them+before+he+will+take+them+out.++At+school%2C+Bart+gets+Milhouse+spun+at+a+high+speed+on+the+carousel%3B+so+fast+that+he+spins+out+of+control%2C+resulting+in+his+knocking+over+the+flagpole+and+throwing+up+on+the+flag.++When+confronted+for+his+part+in+this+act+of+unpatriotic+behavior%2C+Bart+cites+Krusty+as+the+influence%3B+making+Krusty+a+very+unpopular+figure.++Homer+discovers+her+implants+and+at+dinner+the+next+night%2C+Homer+and+the+men+of+Springfield+sing+the+praises+of+her+new+endowment.++Marge+gets+offered+a+trade+show+modeling+job.++Marge+gets+into+her+new+image+until+the+extra+weight+up+front+of+starts+giving+her+back+problems.++At+the+trade+show%2C+Bart%27s+old+friend+Stampy+and+Marge%27s+gifts+are+used+to+help+Krusty+get+his+reputation+back.++Afterwards+surgery+is+preformed+to+reverse+Marge%27s+condition+and+the+Baha+Men+sings+the+praises+of+her+Jugs+with+a+little+help+from+Homer.%0A","6.9","28");
INSERT INTO `series_episodes` VALUES("55748","0","0","0","Helter+Shelter","5","14","1038697200","71663","When+Homer+is+injured+at+work%2C+his+compensation+is+use+of+a+luxury+sky+box.++The+family+enjoys+the+luxuries%2C+but+Lisa+is+bored+and+joins+the+masses+rink+side.++She+gives+one+of+the+players+some+score+tying+advice+and+is+rewarded+with+Kozlov%27s+hockey+%22tree%22.++The+stick+is+mounted+in+Lisa%27s+room+where+later+that+night+termites+break+out+of+the+stick+and+do+much+damage+to+the+family+home.++Until+the+Russian+no-wood-nick+termites+can+be+thoroughly+exterminated%2C+6+months+from+now%2C+the+Simpson+family+is+homeless.++The+family+tries+a+number+of+options+but+settle+upon+trying+out+for+a+home+where+they+are+required+to+live+like+its+1895.++They+pass+the+audition+and+start+living+the+lifestyle.++When+the+%221895+Challenge%22+sinks+in+the+ratings%2C+the+producers+try+to+stir+things+up+by+adding+Squiggy+from+Laverne+and+Shirley.++When+even+that+doesn%27t+work%2C+they+relocate+the+house+to+a+river+and+watch+it+float+downstream.++Eventually+the+house+comes+to+shore+and+falls+apart.++Now+the+family+finds+themselves+without+food+and+shelter+as+the+TV+crew+eats+away.++The+encounter+and+tribe+of+refugees+from+another+reality+program+and+together+they+fight+to+return+to+civilization%2C+where+they+can+find+quality+scripted+television.++When+even+that+fails+them%2C+they+start+to+entertain+themselves.%0A","7.1","27");
INSERT INTO `series_episodes` VALUES("55749","0","0","0","The+Great+Louse+Detective","6","14","1039906800","71663","The+family+receives+an+invitation+to+go+to+a+health+spa.++While+there+Homer+is+alone+in+the+steam+room%2C+when+some+unknown+person+locks+him+inside+and+turns+the+heat+up+to+the+%22MURDER%22+setting.++Homer+and+Marge+go+to+see+Chief+Wiggum+for+help+in+finding+Homer%27s+attempted+murderer.++Chief+Wiggum+decides+to+call+in+an+expert+on+the+twisted+mind+of+a+murderer.++He+takes+the+Simpson+family+to+Campbell%27s+Chunky+Soup+Maximum+Security+Prison+to+consult+with+Sideshow+Bob.++Chief+Wiggum+strikes+a+deal+Sideshow+Bob+that+will+allow+him+to+stay+with+the+Simpson+family%2C+which+makes+Bart+nervous.++A+device+is+hooked+to+Sideshow+Bob+that+will+allow+the+family+to+shock+him+if+he+gets+out+of+control.++Sideshow+Bob+follows+Homer+through+a+%22normal%22+day.++Sideshow+Bob+sets+up+a+Homer+dummy+as+a+trap+for+Homer%27s+potential+killer.++Everyone%2C+including+Homer+beats+the+dummy+up.++At+Moe%27s+someone+takes+a+shot+at+Homer.++Sideshow+Bob+recommends+that+Homer+stay+out+of+sight%2C+which+isn%27t+going+to+happen+when+Homer+is+elected+King+of+Mardi+Gras.++At+the+parade+Homer%27s+float+becomes+a+runaway+when+its+brake+line+is+cut.++Sideshow+Bob+launches+himself+out+of+cannon+and+saves+Homer+from+certain+death.++Then+Homer+and+Sideshow+Bob+go+after+and+corner+the+potential+killer%2C+Frank+Grimes+Jr.++Later+that+evening+in+Bart%27s+bedroom%2C+Sideshow+Bob+appears+and+he+tries+to+kill+Bart+quickly%2C+but+finds+he+can%27t+do+it%2C+as+he%27s+%22grown+accustomed+to+Bart%27s+face.%22%0A","7.2","26");
INSERT INTO `series_episodes` VALUES("55750","0","0","0","Special+Edna+%28a.k.a.+Love+and+Marking%29","7","14","1041721200","71663","Edna+looks+forward+to+the+apple+picking+trip+she+is+going+to+take+Seymour%2C+only+he+has+to+cancel+because+he+needs+to+take+care+of+his+mother.++Meanwhile%2C+Bart+looks+for+ways+to+keep+from+working+on+his+research+paper+for+WWI%2C+including+photocopying+his+butt+and+joyriding+in+a+Blackhawk+helicopter.++The+day+before+it%27s+due%2C+he+uses+Grampa+as+a+resource.++Bart+receives+F+for+his+effort+he+works+on+a+revised+version+of+the+paper+after+school.++When+Bart+sees+how+sad+Principal+Skinner+has+made+Ms.+Krabappel+when+he+cancels+a+date+with+her+in+favor+of+his+mother%2C+Bart+goes+out+with+her+for+the+evening.++At+Lisa%27s+suggestion%2C+Bart+decides+to+do+more+for+his+teacher%2C+he+nominates+for+the+%22Teacher+of+the+Year%22+award.++Knowing+who+she+has+to+put+with%2C+the+award+committee+selects+Ms.+Krabappel+as+their+nominee.++The+award+finals+are+held+in+Orlando%2C+Florida+at+%22Efcot+Center.%22++As+the+nominator%2C+Bart+%28and+his+family%29+gets+to+go+to+award+ceremony+as+well.++Who+isn%27t+going%2C+Seymour+Skinner+of+course%2C+that+is+until+he+changes+mind.++Of+course%2C+he+has+to+bring+mother+along.++At+the+award+ceremony%2C+Seymour+is+worried+that+he+will+lose+Edna+forever.++He+gets+Bart+to+sabotage+her+chances+at+winning%2C+but+when+it+comes+down+to+it+he+can%27t+let+Bart+go+through+with+it.++Edna+doesn%27t+win+the+award%2C+but+she+does+get+a+marriage+proposal+from+Seymour%2C+with+an+engagement+ring+from+Little+Richard.%0A","6.8","26");
INSERT INTO `series_episodes` VALUES("55751","0","0","0","The+Dad+Who+Knew+Too+Little","8","14","1042326000","71663","Homer+fails+to+get+the+birthday+present+that+Lisa+wanted.++The+gift+he+gets+her+instead+makes+it+obvious+that+he+knows+nothing+about+his+daughter+and+that+makes+her+disappointed+in+him.++To+win+Lisa+back%2C+Homer+hires+a+private+detective+to+find+out+everything+about+her.++The+private+detective+comes+through+with+information+that+restores+Homer%27s+relationship+with+Lisa.++Homer+refuses+to+pay+the+detective%27s+%241000+expenses%3B+to+get+even+the+detective+arranges+it+so+that+Lisa+is+framed+for+a+crime+she+didn%27t+commit.++When+the+police+arrive+outside+the+Simpson+home%2C+Homer+takes+Lisa+on+the+run.++While+they+are+holed+up+in+a+cabin%2C+Homer+confesses+what+he+did+to+learn+more+about+Lisa.++The+police+trace+them+there+and+Homer+and+Lisa%27s+subsequent+escape+leads+them+to+a+circus%2C+where+they+find+evidence+that+will+exonerate+Lisa+of+the+crime.++Only+first+together+they+must+deal+with+the+crooked+detective.%0A","6.8","20");
INSERT INTO `series_episodes` VALUES("55752","0","0","0","Strong+Arms+of+the+Ma","9","14","1044140400","71663","Marge+gets+mugged+outside+the+Kwik-E-Mart+and+she+starts+feeling+vulnerable+and+becomes+scared+to+leave+the+house.++Dr.+Hibbert+diagnoses+her+with+agoraphobia.++The+family+tries+to+help+her+get+back+out+of+the+house%2C+but+their+efforts+drive+into+living+in+the+basement.++In+the+basement+she+finds+their+unused+weight+set+and+she+begins+working+out.++Two+weeks+later+she+is+stronger+than+she+ever+was+and+realizes+that+she+can+leave+the+house.++In+fact+while+celebrating+her+release+from+her+fears%2C+she+confronts+and+beats+the+crap+out+of+her+mugger.++While+out+working+out%2C+Marge+runs+into+Ruth+Powers%2C+the+neighbor+she+once+went+on+the+lam+with.++Ruth+tells+her+about+how+steroids+can+help+her+to+get+bigger.++Marge+starts+taking+the+supplements+and+gets+into+a+women%27s+bodybuilding+competition.++She+takes+2nd+place%2C+which+only+entices+her+to+do+better+next+time.++At+Moe%27s+she+tears+the+place+apart+when+she+suffers+from+steroid+rage.++Homer+makes+her+realize+that+she+has+become+everything+that+she+can%27t+stand+and+she+destroys+the+weight+set.%0A","7","29");
