INSERT INTO `series_episodes` VALUES("55754","0","0","0","Barting+Over","11","14","1045350000","71663","Lisa+dreams+of+being+honored+as+one+of+three+great+Americans%2C+only+to+be+waken+by+Marge%27s+vacuum.++Marge+and+the+rest+of+the+family+have+begun+spring+cleaning.++Bart+finds+a+box+of+old+videotapes.++He+and+Lisa+start+watching+the+tapes+that+are+boring+them%2C+until+Lisa+finds+a+tape+labeled+%22BART+SAD.%22++They+put+in+the+tape%2C+which+features+an+episode+of+Perfect+Strangers+and+a+commercial+for+a+product+that+fights+bad+breath+for+babies.++The+baby+featured+in+the+ad+is+none+other+than+Bart%2C+leading+Lisa+to+realize+the+tape+should+have+been+titled+%22Bart%27s+Ad.%22++The+baby+in+the+ad+is+referred+to+as+%22Baby+Stinkbreath%2C%22+which+opens+Bart+up+to+name+calling+by+his+siblings.++Bart+confronts+his+parents+about+the+ad+and+Homer+tells+him+he+was+going+to+tell+him+on+his+%22death+bed.%22++They+tell+him+he+enjoyed+making+the+commercials+and+he+made+a+lot+of+money+that+Homer+invested+in+a+college+trust+fund.++Homer+confesses+that+he+used+the+money+to+buy+back+incriminating+photos.++Bart+demands+the+return+of+his+money%3B+Milhouse+suggests+that+he+get+a+lawyer.++He+finds+a+lawyer+and+tells+him+he+wants+a+divorce+from+his+parents.++In+court%2C+Judge+Harm+renders+her+verdict%2C+Bart+is+emancipated+and+half+Homer%27s+salary+is+to+go+to+Bart.++Bart+moves+out+and+into+a+loft+apartment.++His+first+night+alone+he+is+scared+by+a+rat+and+runs+to+the+elevator+that+takes+him+up+instead+of+down.++The+doors+open+to+a+loft+apartment+that+contains+skateboard+ramps%2C+%22skate+boarding+legend+Tony+Hawk%22+and+the+band+%22blink+-+182%22+playing+live+in+the+corner.++The+family+comes+to+visit+Bart+at+his+new+home%2C+where+Bart+appears+to+be+living+the+good+life.++Homer+makes+a+plea+for+his+return%2C+but+Bart+tells+them+he+is+taking+off+for+six+months+to+go+on+the+%22Skewed+Extreme+Sports+Tour.%22++At+the+Springfield+stop+of+the+tour%2C+Homer+talks+Tony+Hawk+into+losing+to+him+