INSERT INTO `series_episodes` VALUES("55755","0","0","0","I%27m+Spelling+as+Fast+as+I+Can","12","14","1045350000","71663","The+kids+are+getting+ready+to+go+back+to+school.++On+the+first+day%2C+Principal+Skinner+holds+an+all+school+Spelling+Bee%2C+which+Lisa+easily+wins%2C+allowing+her+to+go+to+the+state+spelling+finals.++If+she+wins+there%2C+she+can+then+go+Spellympics.++Meanwhile%2C+Homer+has+been+trying+Krustyburger%27s+new+%22Ribwich%22+and+enjoying+it+immensely.++At+the+state+Spelling+Bee+Lisa+wins%2C+but+is+disappointed+with+Homer+who+tells+her+that+%22very+serious+Daddy+business%22+is+going+to+keep+him+away+from+her+celebration.++Homer%27s+daddy+business+consists+of+getting+more+Ribwiches.++He+is+disappointed+when+the+Ribwich+is+no+longer+available.++Another+Ribwich+fan+%28and+member+of+Ribwich+Nation%29+informs+Homer+that+the+sandwich+is+going+to+be+tested+in+other+markets+and+he+shows+him+the+tour+schedule.++For+a+moment%2C+Homer+considers+joining+them+on+their+bus+tour.++For+her+spelling+efforts%2C+Lisa+is+rewarded+with+a+double-wide+locker+and+she+prepares+for+the+Spellympics.++At+the+Spellympics%2C+Lisa+makes+it+to+the+finals.++Homer+regrets+that+he+won%27t+be+able+to+attend+the+finals%2C+as+he+will+be+in+San+Francisco+for+the+last+day+of+the+Ribwich.++George+Plimpton+talks+to+Lisa+about+getting+her+to+throw+the+spelling+bee+so+that+a+more+popular+competitor+can+help+keep+spelling+a+viable+sport.++For+throwing+the+bee%2C+Lisa+is+offered+a+full+scholarship+to+one+of+the+seven+sister%27s+college+of+her+choice.++Lisa+wrestles+with+her+conscience.++In+San+Francisco%2C+Krusty+stops+by+and+tells+the+crowd+they+will+no+longer+be+making+the+Ribwich+and+he+tosses+them+the+last+one.++Homer+catches+it%2C+and+offers+are+made+to+him+for+the+last+one.++He+realizes+that+he%27s+forsaken+his+daughter%27s+big+day+for+a+sandwich+and+he+trades+it+for+a+car%2C+which+he+drives+off+to+Lisa%27s+big+event.++At+the+Spellympics%2C+Homer+arrives+just+in+time+for+Lisa+to+do+her+final