INSERT INTO `series_episodes` VALUES("55758","0","0","0","C.E.+D%27oh%21","15","14","1047769200","71663","On+St.+Valentine%27s+Day+Marge+is+too+tired+in+participating+in+the+lovemaking+that+Homer+was+so+looking+forward+to.++Dejected%2C+Homer+leaves+the+house+and+stumbles+across+a+billboard+for+some+extension+courses.++When+he+is+thrown+out+of+the+%22Strip+for+Your+Wife%22+class+led+by+Dr.+Hibbert%2C+he+stumbles+into+%22Successmanship+101%22+class.++He+gets+the+book+for+the+class+and+with+it+he+decides+to+change+the+direction+of+his+life.++Homer+goes+into+work+with+a+new+attitude%2C+but+when+he+presents+his+ideas+for+improvements+to+Mr.+Burns%2C+they+are+all+rejected+unread.++Later+when+Homer+overhears+that+Mr.+Burns+actually+has+a+canary+named+as+the+plant%27s+legal+owner.++With+this+information+and+some+encouragement+from+his+family+Homer+decides+upon+a+plan.++With+Bart%27s+help%2C+Homer+releases+the+bird%2C+which+leaves+the+plant+with+no+owner.++In+rare+sign+of+intelligence%2C+Homer+outwits+Mr.+Burns+and+is+able+to+take+over+the+vacancy+left+by+the+canary.++His+first+act+in+his+new+job+is+to+fire+Mr.+Burns.++Now+Homer+is+in+charge+of+the+power+plant+and+besides+learning+about+the+%22door+shutting+thing%22+he+soon+learns+how+difficult+it+is+to+be+at+the+top.++He+misses+out+on+quality+time+with+his+family.++Mr.+Burns+returns+for+a+visit+and+shows+Homer+the+people+he+missed+out+on+being+with+throughout+his+life%2C+Mr.+Burns+then+tries+to+kill+Homer+by+drugging+him+and+sealing+him+in+a+tomb.++He+isn%27t+fast+enough+as+Homer+recovers+and+easily+escapes.++As+a+wrap+up+to+his+latest+escapade+Homer+%28and+everyone%29+celebrate+%22HOMER%27S+305th+EVERYTHING+IS+BACK+TO+NORMAL+BBQ.%22%0A","7.3","27");
INSERT INTO `series_episodes` VALUES("55759","0","0","0","Scuse+Me+While+I+Miss+the+Sky","16","14","1048978800","71663","Principal+Skinner+introduces+the+students+of+Springfield+Elementary+to+Declan+Desmond%2C+a+documentary+filmmaker.++Desmond+is+there+to+do+a+documentary+on+the+school.++The+children+see+an+example+of+his+work+in+the+form+of+his+documentary+on+Krusty+Burger+called+%22Do+You+Want+Lies+With+That%3F%22++He+starts+filming+his+documentary+by+focusing+on+school+bullies.++Bart+is+being+featured+on+camera+for+his+role+as+a+school+bully%2C+when+he+is+humiliated+by+Nelson%2C+the+bigger+bully.++Principal+Skinner+tries+to+divert+Desmond%27s+attention+by+focusing+on+Lisa.++Desmond+easily+spots+the+ruse+and+gives+Lisa+some+advice+that+she+should+pick+a+path+and+follow+it.++Bart+searches+for+a+way+to+become+cool+again.++When+Nelson+shows+off+a+hood+ornament+he%27s+stolen%2C+Bart+decides+he+needs+to+do+the+same%2C+only+bigger.++Lisa+looks+for+career+direction+and+finds+inspiration+at+an+astronomy+exhibit.++Lisa+gets+Homer+to+buy+her+a+telescope%2C+only+she+soon+discovers+that+light+pollution+from+the+town+obscures+her+view.++Bart+tries+to+regain+his+position%2C+as+Desmond+watches.++He+then+finds+Lisa+is+circulating+a+petition+to+reduce+Springfield%27s+light+pollution.++It+works+and+lights+are+put+down%2C+yes+the+stars+have+come+out%2C+but+so+have+the+criminals.++Nelson+and+company+steal+more+hood+ornaments.++Bart+targets+the+ornate+%28Emmy+award+looking%29+hood+ornament+of+Fat+Tony%27s+car.++Mayor+Quimby+caves+into+pressure+from+the+townspeople+and+restores+the+lights+of+Springfield%2C+to+the+point+where+it%27s+daytime+at+night.++Bart+and+Milhouse+were+almost+able+to+steal+Fat+Tony%27s+hood+ornament%2C+when+the+lights+go+on.++24+hours+of+%22daylight%22+begin+to+take+their+toll+on+the+townspeople.++Bart+is+still+scoping+out+Fat+Tony%27s+hood+ornament%2C+he+only+needs+the+cover+of+darkness+to+pull+of+his+crime.++Since+he+and+Lisa+want+the+same+thing%2C+they+team+up+to+get+Homer+to+go+into+power+plant+and+overload+the+city%27s+lights.++Springfield+is+back+in+the+dark+when+the+townspeople+come+to+protest+the+lack+of+lights.++Fortunately+for+Bart+and+Lisa+a+meteor+shower+begins+and+that+distracts+everyone.++In+the+end%2C+Declan+Desmond%27s+documentary+%22American+Boneheads%3A+A+Day+in+the+Life+of+Springfield+Elementary%22+is+shown.%0A","7.3","30");
