INSERT INTO `series_episodes` VALUES("55761","0","0","0","Dude%2C+Where%27s+My+Ranch%3F","18","14","1051394400","71663","It%27s+Christmastime+and+the+family+is+out+caroling.++When+they+carol+outside+of+a+lawyer%27s+house%2C+he+informs+them+they+can%27t+sing+the+song+they%27re+singing+without+paying+a+royalty.++This+inspires+Homer+to+decide+to+write+his+own+Christmas+carol%2C+but+when+Flanders+tries+to+help+and+begins+annoying+him%2C+Homer+is+instead+inspired+to+write+an+anti-Flanders+song.++Homer+plays+his+new+song+at+Moe%27s+where+a+passing+David+Byrne+overhears+it+and+offers+to+produce+and+record+it.++The+song+%22Everybody+Hates+Ned+Flanders%22+becomes+a+national+hit+and+is+even+covered+by+William+Shatner.++To+get+away+from+the+over-exposure+of+the+hit+song%2C+the+family+decides+to+take+a+vacation+to+a+dude+ranch.++At+the+Lazy+I+ranch%2C+Comic+Book+Guy+looks+for+an+Internet+connection+and+Lisa+is+annoyed+to+find+out+that+the+ranch+was+built+on+cruelty+to+animals+and+oppression+of+indigenous+people.++Lisa+wants+to+go+home%2C+until+sometime+later+when+she+meets+Luke+Stetson%2C+a+junior+wrangler+who+shares+her+views.++Homer+and+Bart+meet+some+indigenous+people+who+tell+them+that+they%27ve+lost+their+land+to+a+natural+beaver+dam.++Homer+gets+them+to+agree+to+build+a+fair+casino%2C+if+he+helps+them+get+back+their+land.++Lisa+overhears+that+Luke+already+has+a+girlfriend+named+Clara+and+her+heart+is+broken.++Lisa+encounters+Clara+and+gives+her+false+directions+to+the+dance.++Homer+and+Bart+manage+to+outsmart+the+beavers+and+indigenous+people+are+able+to+reclaim+their+land.++At+the+dance%2C+Lisa+finds+out+that+Clara%2C+her+competition+is+actually+Luke%27s+sister.++Lisa+gets+Bart+to+help+her+find+Clara%2C+who+they+rescue+with+the+help+of+some+beavers.++The+family+is+set+to+return+to+Springfield%2C+when+they+hear+a+new+David+Byrne+produced+song+on+the+radio+%22The+Moe+Szyslak+Connection%22+and+decide+they+can+afford+another+week+at+the+ranch.%0A","6.9","23");
INSERT INTO `series_episodes` VALUES("55762","0","0","0","Old+Yeller+Belly","19","14","1051999200","71663","Bart%27s+tree+house+is+destroyed+and+the+Amish+are+called+in+to+rebuild+it.++Because+the+Amish+are+master+electricians%2C+Bart%27s+new+tree+house+catches+fire+at+its+grand+opening.++Everyone+makes+it+to+safety%2C+with+the+exception+of+Homer%2C+who+is+trapped.++He+looks+to+the+family+dog+for+help%2C+but+Santa%27s+Little+Helper+%28SLH%29+is+a+coward+and+only+saves+himself.++It%27s+up+to+Snowball+II+to+save+Homer%27s+life.++Snowball+II+is+made+a+hero+in+Homer%27s+eyes+and+SLH+is+thrown+out+of+the+house.++The+dog+park+is+turned+into+a+cat+park+and+renamed+for+Snowball+II.++SLH+doesn%27t+look+very+good+in+the+eyes+of+his+fellow+dogs+either.++Kent+Brockman+asks+Homer+about+his+cat+and+any+other+pets+he+may+have+and+Homer+makes+the+bold+statement+that+%22I+have+no+dog.%22++Bart+and+Lisa+look+to+help+SLH+regain+his+status+as+family+dog.++Their+efforts+fail.++A+passing+photographer+spots+SLH+drinking+beer+from+a+can+that+he+is+balancing+on+his+nose.++The+photo+appears+in+the+paper+and+the+owner+of+Duff+Brewery+decides+its+time+to+replace+Duffman+with+a+dog.++The+family+signs+a+contract+for+the+brewery%27s+new+spokesdog+%22Suds+McDuff.%22++The+new+campaign+is+a+hit.++The+family+stands+to+make+lots+of+money%2C+until+SLH%27s+original+owner+from+the+dog+track+comes+to+lay+claim+to+his+dog.++He+uses+a+tape+of+Homer%27s+own+words+against+him+as+proof+of+his+continued+ownership+of+the+dog.++SLH+is+being+exploited+by+his+original+owner.++The+family+comes+up+with+a+plan+to+get+their+dog+back.++They+find+the+actor+who+played+Duffman+%28Barry+Duffman%29+and+plan+to+have+him+rescue+a+drowning+Homer%2C+when+it+becomes+obvious+to+the+crown+that+%22Suds+McDuff%22+is+a+cowardly+dog.++The+plan+doesn%27t+work%2C+when+Duffman+turns+out+to+be+as+cowardly+as+his+replacement.++The+shark+that+tried+to+attack+Homer+becomes+%22wasted%22+on+the+Duff+beer+that+came+out+of+the+keg+that+Homer+was+floating+on.++As+a+result%2C+the+shark+becomes+the+company%27s+new+mascot.++With+his+gravy+train+at+an+end%2C+SLH%27s+original+owner+returns+the+dog+back+to+the+family.%0A","7.2","23");
INSERT INTO `series_episodes` VALUES("55763","0","0","0","Brake+My+Wife%2C+Please","20","14","1052604000","71663","At+the+Springfield+Aquarium%2C+Marge+accompanies+the+kids+on+a+school+field+trip.++Lisa+spots+penguins+flying+and+after+Bart+has+shown+off+his+%22flawless+pearls%2C%22+which+results+in+him+being+taken+the+hospital%2C+where+a+lack+of+insurance+card+keeps+him+prisoner.++Homer+has+the+insurance+card%2C+but+is+nowhere+to+be+found.++As+a+solution%2C+Homer+gets+a+mobile+phone+and+a+few+extra+unnecessary+accessories%2C+which+only+leads+to+him+not+paying+attention+to+where+he+is+driving.++That+is+until+it+is+much+too+late+and+he+drives+off+of+a+pier.++Judge+Harm+takes+his+license+away+and+Homer+is+no+longer+able+to+drive.++Marge+picks+up+the+slack+and+starts+becoming+%22Stresserella.%22++Homer+walks+to+Moe%27s%2C+but+much+to+Moe%27s+dismay+he+decide+to+keep+on+walking+and+starts+getting+healthy.++Homer+walks+to+work+and+is+the+only+employee+to+arrive%2C+everyone+else+is+caught+in+a+traffic+jam.++Marge+is+frazzled+from+all+her+driving%2C+meanwhile+Homer+sings+and+walks+about+the+virtues+of+walking+when+he+is+stuck+by+a+car%3B+the+driver+of+the+car+was+Marge.++Marge%2C+who+cares+so+much+for+Homer%2C+tries+to+help+in+his+recovery%2C+but+Homer+perceives+that+she+might+be+trying+to+kill+him.++It+leads+to+fight%2C+which+in+turn+leads+them+to+see+a+marriage+counselor.++After+Marge+leaves%2C+the+counselor+suggests+that+Homer+perform+one+unselfish+act+of+love+to+win+Marge+back%2C+in+other+words+take+her+to+dinner.++Homer+decides+to+one+up+that+suggestion+and+invites+everyone+in+Springfield+%28except+the+Flanders+family%29+to+a+backyard+barbeque+in+Marge%27s+honor.++Homer+joins+Jackson+Browne+in+a+duet+to+sing+his+praises+of+Marge.%0A","7.2","25");
INSERT INTO `series_episodes` VALUES("55764","0","0","0","The+Bart+of+War","21","14","1053208800","71663","When+Marge+sees+Bart+and+Milhouse+incited+to+violence+after+watching+an+episode+of+South+Park%2C+she+tries+to+turn+them+onto+some+good+television+on+the+PAX+television+network.++They+run+out+of+the+room+and+find+themselves+outside+and+bored.++After+tying+a+thread+to+a+housefly%2C+that+lands+itself+inside+of+the+Flanders+home%2C+Bart+and+Milhouse+find+themselves+inside+the+home%2C+unsupervised.++They+cause+some+damage+and+find+Ned%27s+collection+of+Beatles+memorabilia.++They+drink+from+cans+of+a+40-year-old+novelty+beverage+and+start+to+get+sick.++Ned+and+the+boys+return+to+their+home+to+find+the+house+%22slightly+askew%2C%22+and+they+flee+to+their+panic+room+and+call+the+police.++The+police+arrive+and+capture+the+boys+and+Bart+pleads+that+his+parents+not+be+called.++The+parents+are+called+and+as+part+of+Bart%27s+punishment+he+is+sentenced+to+spending+all+his+time+under+the+supervision+of+a+parent.++He+is+also+no+longer+allowed+to+play+with+Milhouse%2C+who+Marge+believes+incites+Bart+into+his+bad+behavior.++Bart+joins+the+%22Pre-Teen+Braves%22+and+Homer+becomes+the+tribe+leader.++When+Homer+fails+in+his+leadership+skills%2C+Marge+takes+over.++Marge+takes+the+boys+on+a+nature+walk+and+they+meet+a+Native+American+who+shows+them+a+field+that+is+in+need+of+restoration.++The+%22Pre-Teen+Braves%22+return+to+the+field+to+begin+their+clean-up+effort%2C+only+to+discover+that+the+%22Calvary+Kids%22+that+Milhouse+and+his+father+are+a+members+of+have+already+done+the+job.++The+two+groups+go+to+war+and+try+to+outdo+each+other+in+doing+good.++When+the+opportunity+to+become+batboys+at+an+Isotopes+game+is+on+the+line%2C+the+two+sides+redouble+their+efforts+for+their+candy+sales.++The+%22Pre-Teen+Braves%22+lace+the+%22Calvary+Kids%22+candy+bars+with+laxatives+and+believe+they+are+going+to+win.++Only+the+senior+citizens%2C+in+a+need+of+relief+from+constipation%2C+buy+the+%22Calvary+Kids%22+a+win.++At+the+Isotopes+game%2C+the+%22Calvary+Kids%22+are+delayed+from+arriving+and+the+%22Pre-Teen+Braves%22+take+their+place+singing+their+version+of+the+national+anthem.++The+crowd+becomes+angered+by+the+version+of+the+anthem+that+is+being+sung+and+when+the+real+%22Calvary+Kids%22+arrive%2C+a+fight+breaks+out+between+everyone+in+the+crowd.++When+the+image+of+Marge+crying+is+shown+on+the+Jumbotron%2C+the+fighting+ends+and+the+sweet+soothing+hymn+of+the+national+anthem+of+Canada+is+sung+by+all+present.++In+the+end%2C+Bart+and+Milhouse+sum+it+up+by+saying+that+they%27ve+learned+that%3A+%22War+is+not+the+answer--except+to+all+of+America%27s+problems.%22%0A","6.6","19");
INSERT INTO `series_episodes` VALUES("55765","0","0","0","Moe+Baby+Blues","22","14","1053208800","71663","The+family+goes+to+the+Springfield+Botanical+Gardens%2C+where+they+and+the+other+residents+are+there+to+see+the+blossoming+of+the+Sumatran+Century+Flower.++When+his+bar+is+empty%2C+Moe+finds+out+that+is+where+all+his+customers+have+gone+and+he+goes+to+join+them.++With+a+capacity+crowd+plus+one+on+hand%2C+Chief+Wiggum+has+to+send+someone+away+and+he+selects+Moe.++As+a+result%2C+Moe+is+one+of+the+only+ones+to+not+be+driven+out+of+town+by+the+obnoxious+and+somewhat+lethal+%28to+other+plant+life%29+smell+of+the+Sumatran+Century+Flower+when+it+finally+does+bloom.++The+mass+exodus+from+Springfield+results+in+a+huge+traffic+jam+on+the+Springfield+Bridge.++When+traffic+begins+to+move%2C+Homer+hits+the+accelerator%2C+only+to+have+to+immediately+slam+on+the+brakes%2C+because+traffic+didn%27t+move+that+far.++The+quick+stop+to+family+car+and+the+faulty+seat+restraint+that+was+holding+Maggie+in+the+backseat+causes+her+to+be+launch+through+the+sunroof+and+over+the+side+of+the+bridge.++She+lands+in+the+arms+of+Moe%2C+who+was+perched+on+the+side+of+the+bridge+ready+to+commit+suicide.++Moe+becomes+a+hero.++Moe+stops+by+to+see+Maggie+and+winds+up+watching+her+when+Marge+needs+to+care+of+Grampa%2C+who%27s+out+on+the+street+acting+crazier+than+normal.++Moe+becomes+Maggie%27s+fulltime+babysitter.++Moe+entertains+Maggie+by+telling+her+a+story%3B+of+course+it%27s+%22The+Godfather%22+saga.++Late+in+the+evening+after+Maggie%27s+birthday+party%2C+where+Homer+began+to+learn+that+Maggie+prefers+Moe+over+him%2C+Marge+and+Homer+hear+Maggie+crying.++They+go+to+her+room+only+to+find+Moe+already+there+calming+her+down.++They+forbid+him+to+ever+see+her+again.++The+next+day%2C+Moe+is+lonely+and+missing+Maggie.++That+night%2C+outside+her+window%2C+Maggie+overhears+Fat+Tony+and+his+boys+plan+to+take+out+the+Castellaneta+family.++She+crawls+out+her+window+and+begins+pursuing+them.++Marge+discovers+Maggie+is+gone+and+they+immediately+suspect+Moe.++When+Moe+doesn%27t+have+her+and+he+finds+out+she+is+missing%2C+he+offers+to+help.++Clues+outside+Maggie%27s+window+reveal+that+the+mob+was+gathered+outside+of+her+window+and+Moe+suggests+that+they+might+find+her+in+little+Italy.++At+a+restaurant+in+Little+Italy+Maggie+finds+she+is+in+the+middle+of+an+%22Italian-American+Mexican+standoff.%22++Moe+volunteers+to+go+in+and+rescue+her.++He+draws+the+mobster%27s+attention+to+Maggie+which+causes+them+to+all+go+soft.++Moe+returns+Maggie+to+Homer+and+Marge+and+prepares+to+leave%3B+only+Maggie+doesn%27t+want+him+to+go.++Homer+and+Marge+agree+that+Moe+can+have+the+occasional+play+date+with+Maggie%2C+provided+he+brings+along+his+ham+to+accompany+Homer.%0A","6.9","20");
INSERT INTO `series_episodes` VALUES("55766","0","0","0","Treehouse+of+Horror+XIV","1","15","1067727600","71663","%22Reaper+Madness%22+-+Death+becomes+Homer+and+our+hero+must+learn+to+reap+what+he+sows+%28and+pull+a+fast+one+on+the+almighty%29.%0A%0A%22Frinkenstein%22+-+Soon+to+be+Nobel-prize+winning+Professor+Frink+reanimates+his+father+for+some+gruesome+body+parts-swapping.+%0A%0A%22Stop+the+World%2C+I+Want+to+Goof+Off%22+-+A+parody+of+Clockstoppers%2C+starring+Bart+and+Milhouse.","7.4","38");
INSERT INTO `series_episodes` VALUES("55767","0","0","0","My+Mother+the+Carjacker","2","15","1068332400","71663","Homer+learns+of+his+mother%27s+whereabouts%2C+through+clues+that+she+leaves+in+the+newspaper.+When+Mother+Simpson+returns+to+Springfield%2C+she+is+quickly+recognized+by+police+and+Mr.+Burns%2C+and+is+taken+to+court+over+her+germ+warefare+sabotage+from+the+60s.+With+help+from+Homer%2C+she+is+acquitted%2C+but+when+she+reveals+that+she+used+false+names+when+visiting+national+parks%2C+she+is+booked+on+forgery+charges.+Homer+carjacks+a+bus+and+tries+to+help+her+escape%2C+but%2C+not+wanting+her+son+involved%2C+she+kicks+Homer+out+of+the+bus+and+drives+off.+When+the+bus+crashes%2C+Mother+Simpson+is+feared+dead.+But+another+subliminal+newpaper+message+reveals+otherwise.+Guest+stars+Tom+Kenny+and+Glenn+Close.","6.8","27");
INSERT INTO `series_episodes` VALUES("55768","0","0","0","The+President+Wore+Pearls","3","15","1068937200","71663","It%27s+Vegas+night+at+Springfield+Elementary%2C+where+Martin+is+school+class+president%2C+and+the+event+is+quite+a+success.++Homer+wins+big+and+wants+his+%24200%2C000%3B+but+when+he+and+everyone+else+find+out+they+aren%27t+going+to+win+any+real+money%2C+there+is+a+riot+and+Martin+is+forced+to+resign.++Lisa+runs+against+Nelson+for+class+president.++Lisa+struggles+to+fight+against+Nelson%27s+popularity%2C+she+of+course+all+about+the+issues%2C+while+he+isn%27t.++Lisa+sings+her+way+into+popularity+that+helps+her+win+the+vote.++The+administration+is+worried+about+having+a+popular+president%2C+whom+is+also+smart.++They+start+giving+her+distractions+to+keep+her+from+knowing+about+their+plans+to+remove+the+music%2C+gym+and+art+programs.++Lisa+is+identified+as+a+sellout%2C+but+as+her+last+act+as+president%2C+she+gets+all+the+students+to+go+on+strike.++After+several+days%2C+Chalmers+wants+action+and+he+gets+Skinner+to+transfer+Lisa+to+a+school+for+the+gifted+and+troublesome.++While+it%27s+Lisa%27s+dream+to+go+there%2C+Homer+isn%27t+going+to+pay+for+it.++Lisa+returns+to+Springfield+Elementary%2C+where+the+programs+have+been+restored+thanks+to+the+cancellation+of+flu+shots+and+the+selling+of+loose+cigarettes.%0A","7.2","25");
INSERT INTO `series_episodes` VALUES("55769","0","0","0","The+Regina+Monologues","4","15","1069542000","71663","Mr.+Burns+uses+his+ATM+card+and+gets+a+%241000+bill.++It+hits+him+in+the+chest+and+then+blows+away%2C+right+across+town+and+into+the+Simpson+living+room+window%2C+where+Bart+gets+a+hold+of+it.++His+parents+%28well+Marge+anyway%29+make+him+put+up+a+notice+so+that+the+owner+might+have+a+chance+to+claim+the+bill.++When+no+one+can+identify+the+bill%2C+Bart+wonders+what+he+can+do+with+his+new+windfall.++He+realizes+that+he+can+make+money+showing+off+his+bill%2C+so+he+opens+up+the+%22Museum+of+Modern+Bart%22+in+his+tree+house.++Mr.+Burns+makes+his+claim+for+the+bill%2C+but+all+is+not+lost.++Bart+has+made+over+%243000+in+admissions+to+his+museum.++To+make+use+of+the+money+the+family+decides+to+go+to+England%2C+where+Abe+recalls+having+a+memorable+night+with+a+beautiful+English+girl+named+Edwina.++In+merry+ole+England%2C+the+Simpsons+meet+Prime+Minister+Tony+Blair.++Abe+tries+to+find+Edwina%2C+meanwhile+the+rest+of+the+family+tours+London.++Everything+is+going+fine+until+Homer+slams+his+rental+Mini+into+the+back+of+the+Queen%27s+horse+drawn+carriage.++Homer+is+put+on+trial%2C+makes+an+ass+out+of+himself+in+court+and+is+thrown+into+the+Tower+of+London.++Lisa+finds+a+way+for+Homer+to+escape+his+tower+cell%2C+a+secret+tunnel+once+used+by+Sir+Walter+Raleigh.++Unfortunately+the+tunnel+leads+to+the+Queen%27s+bedroom.++Homer%27s+pathetic+plea+with+the+Queen+works+and+the+family+is+allowed+to+leave+the+country%2C+provided+they+take+Madonna+with+them.++Before+boarding+the+plane%2C+Edwina+calls+out+to+Abe%2C+and+introduces+him+to+her+daughter+of+58+years%2C+Abbie%2C+a+woman+who+looks+like+Homer+in+drag.++Abe+runs+on+board+the+plane+as+fast+as+he+can.%0A","6.8","26");
INSERT INTO `series_episodes` VALUES("55770","0","0","0","The+Fat+and+the+Furriest","5","15","1070146800","71663","It+is+Mother%27s+Day+and+Homer+goes+with+the+kids+to+Sprawl-Mart+to+buy+Marge+a+better+gift.++They+find+Abe+working+there+as+a+greeter+and+Lisa+asks+her+aunts+to+help+them+pick+out+a+gift.++Patty+and+Selma+recommend+the+Kitchen+Carnival%2C+which+makes+food+fun.++Marge+likes+the+gift%2C+which+can+deep+fry%2C+make+cotton+candy+and+caramelize+anything.++Later+that+night%2C+Homer+creates+an+85+lb.+sugar+ball+and+he+seems+to+fall+in+love+with+his+new+creation.++Marge+insists+that+he+get+rid+off+of+the+ball%2C+which+he+takes+to+the+dump.++At+the+dump+he+gets+attacked+by+a+bear.++He+returns+home+and+finds+that+his+attack+was+covered+by+the+media.++He%27s+been+labeled+a+coward+and+it+begins+to+affect+his+life.++Too+combat+his+fear+he+needs+to+attack+the+bear+that+bested+him%2C+and+he+constructs+a+bear+attack+proof+suit.++Marge+forbids+him+from+using+the+suit%2C+but+he+goes+anyway.++With+help+from+Lenny%2C+Carl%2C+and+Bart%2C+Homer+goes+out+into+the+woods+in+search+of+the+bear.++Of+course+when+he+actually+encounters+the+bear%2C+he+is+without+the+suit.++The+bear+takes+Homer+to+his+cave+and+Homer+removes+the+tag+from+the+bear+that+was+causing+it+discomfort.++He+bonds+with+the+bear+and+tries+to+keep+it+from+being+hunted.++He+lends+the+bear+his+bear+proof+suit+and+it+helps+to+get+him+to+the+wildlife+sanctuary%2C+where+the+bear+is+free+to+be+attacked+by+other+animals.%0A","7.2","25");
INSERT INTO `series_episodes` VALUES("55771","0","0","0","Today%2C+I+Am+a+Klown","6","15","1070751600","71663","Maggie+is+locked+in+the+bathroom+and+is+eventually+freed+when+Lisa+goes+against+the+norm+and+tries+their+rescue+solution+as+second+time.++Then+the+family+hears+the+doorbell.++They+find+Dr.+Hibbert+at+the+door%3B+it+seems+that+SLH+had+impregnated+his+poodle+and+he+is+turn+over+the+puppies+to+the+Simpson+family+and+making+them+their+problem.++Despite+a+book+that+says+that+Homer+was+taking+Homer+to+have+SLH+neutered%2C+Homer+was+never+able+to+complete+the+deed.++They+distribute+the+puppies+and+Lisa+and+Bart+stop+by+Krusty%27s+house+and+give+him+one+of+the+puppies.++Krusty+takes+the+dog+for+a+walk+and+finds+that+his+star+is+not+included+on+the+Jewish+walk+of+fame.++He+goes+to+complain+and+finds+out+that+he+was+never+Bar+Mitzvah%2C+which+means+he+is+technically+not+Jewish.++Bart+and+Lisa+take+Krusty+to+see+his+father%2C+who+agrees+to+help+Krusty+achieve+his+goal.++As+Saturday+is+the+Sabbath%2C+Krusty+gets+Homer+to+replace+his+show+on+that+day.++Homer%27s+replacement+show+is+a+talk+show%2C+with+Moe%2C+Lenny+%26+Carl+as+his+guest+panelists.++The+replacement+show+becomes+a+success%3B+meanwhile+Krusty+works+on+learning+his+Jewish+traditions.++Homer%27s+show+has+become+so+popular+that+the+network+decides+to+fire+Krusty.++Homer%27s+incredibly+popular+and+Lisa+wants+to+put+his+power+to+good+use.++Krusty+pitches+the+FOX+network+on+a+new+show+that+covers+his+Bar+Mitzvah.++Meanwhile%2C+Homer%27s+attempt+to+start+covering+topics+based+on+Lisa%27s+suggestions%2C+but+it+becomes+a+ratings+nightmare+resulting+in+his+cancellation.++Meanwhile%2C+on+FOX+Krusty%27s+Bar+Mitzvah+is+a+rating%27s+bonanza%2C+but+the+spectacle+disappoints+his+father.++Later+at+a+real+Jewish+temple%2C+Krusty+has+a+real%2C+almost+serious%2C+Bar+Mitzvah.%0A","7.4","19");
INSERT INTO `series_episodes` VALUES("55772","0","0","0","%27Tis+the+Fifteenth+Season","7","15","1071356400","71663","It%27s+Christmastime+and+at+the+power+plant+Mr.+Burns+passes+out+Christmas+bonuses%2C+a+%245+dollar+voucher+to+the+cafeteria.++For+reasons+unknown%2C+Mr.+Burns+gives+Homer+a+%22confectioner%27s+card%22+for+Bart+featuring+a+%22current+baseballer.%22++The+%22current+baseballer%22+is+Joe+DiMaggio+and+it+is+his+rookie+card+that+Homer+brings+to+the+Comic+Book+Guy%2C+where+he+gets+everything+he+has+in+the+register+for+the+card.++With+this+financial+windfall%2C+the+Simpson+family+goes+Christmas+shopping+at+the+Springfield+Heights+Promenade%2C+where+the+rich+people+shop.++Homer+spends+the+remaining+portion+of+his+share+of+the+money+for+a+gift+for+himself+%28a+personalized+talking+astrolabe%29+and+has+no+money+left+to+buy+the+family+a+nice+Christmas+tree.++Marge+and+the+kids+find+out+what+he%27s+spent+the+money+on+and+are+disappointed+in+him.++Spending+the+night+on+the+couch%2C+Homer+watches+%22Mr.+McGrew%27s+Christmas+Carol%22+and+the+story+works+its+magic+on+Homer%2C+and+Homer+wakes+with+resolve+to+be+good+and+unselfish.++Homer+starts+helping+the+less+fortunate+and+his+good+deeds+begin+to+make+Ned+Flanders%27+jealous.++To+combat+against+Homer%27s+good+reputation%2C+Ned+decides+to+give+everyone+in+Springfield+a+Christmas+present.++Homer+decides+to+outdo+Flanders%2C+but+on+advice+from+Lisa+and+her+Buddhist+view+of+the+world%2C+Homer+decides+to+take+everyone%27s+presents.++Homer+and+SLH+%28a+la+the+Grinch%29+sneak+into+everyone%27s+home+and+take+all+of+their+presents.++The+angry+mob+finds+Homer+in+downtown+Springfield.++Ned+tries+to+come+to+Homer%27s+rescue%2C+but+a+%22star%22+in+the+sky+saves+them+both+and+they+return+the+presents.++After+Moe%27s+failed+annual+suicide+attempt+the+whole+town+joins+in+a+rendition+of+%22Hark+the+Herald+Angels+Sing.%22%0A","7.3","27");
INSERT INTO `series_episodes` VALUES("55773","0","0","0","Marge+vs.+Singles%2C+Seniors%2C+Childless+Couples+and+Teens%2C+and+Gays","8","15","1073170800","71663","Bart+is+trying+to+watch+%22The+Gator+Baiter%2C%22+when+Lisa+turns+the+channel+to+%22Dollhouse+Do-Overs.%22++In+their+ensuing+scuffle+for+the+remote%2C+the+channel+is+changed+to+%22Roofi%2C%22+an+entertainer+that+appeals+to+very+small+children.++To+get+the+TV+back+Bart+suggests+that+Marge+buy+Maggie+a+%22Roofi%22+CD%2C+which+Lisa+tries+to+warn+him+against.++The+warning+doesn%27t+work%3B+Marge+fills+the+house+and+family+car+with+the+sounds+of+%22Roofi%2C%22+which+drives+Homer%2C+Bart+and+Lisa+crazy.++Marge+takes+Maggie+to+an+outdoor+%22Roofi%22+concert+being+held+at+Cletus%27s+farm.+++The+concert+turns+into+a+disaster+and+the+babies+begin+to+riot.++After+paying+%241+million+in+additional+taxes+to+help+pay+for+the+damage+the+babies+caused%2C+the+single+%28and+other+childless%29+adults+of+Springfield+join+SSCCATAGAPP+%28Singles%2C+Seniors%2C+Childless+Couples+And+Teens+And+Gays+Against+Parasitic+Parents%29+and+begin+to+revolt+against+children.++%22Children+are+the+future%2C+today+belongs+to+me.%22++Marge+takes+up+the+cause+on+behalf+of+the+children+and+works+to+get+voter+sponsored+initiative+proposition+on+the+ballot.++Marge+forms+PPASSCCATAG+%28Proud+Parents+Against+Singles%2C+Seniors%2C+Childless+Couples+And+Teens+And+Gays%29.++The+tobacco+lobby+tries+to+endorse+Marge%27s+cause%2C+but+she+won%27t+take+their+money%3B+however%2C+Mr.+Burns+signs+her+petition+and+others+soon+follow.++Her+%22Families+Come+First%22+proposition+%23242+gets+on+the+ballot.++Homer%27s+attempts+to+help+Marge%27s+initiative%2C+but+his+kind+of+help+might+only+hurt+it.++Bart+and+Lisa+%28well+Lisa+anyway%29+come+up+with+a+plan+to+get+Marge%27s+prop+242+passed.++It+seems+the+members+of+SSCCATAGAPP+have+no+immunity+against+children.%0A","6.7","23");
INSERT INTO `series_episodes` VALUES("55774","0","0","0","I%2C+%28Annoyed+Grunt%29-Bot","9","15","1073775600","71663","Milhouse+comes+over+with+a+Psycho+Cycle+bike+conversion+kit%2C+which+they+use+on+Bart%27s+bike+to+make+it+look+cooler.++While+riding+the+modified+bike%2C+they+are+hassled+by+older+boys+with+%22big+boy%22+bikes.++It+makes+Bart+wish+for+a+ten-speed+bike.++To+get+a+new+bike+Bart+sacrifices+his+old+bike+right+in+front+of+Dr.+Hibbert%27s+Mercedes.++As+Dr.+Hibbert+leaves+his+Mercedes+then+runs+over+Snowball+II+and+Lisa+is+devastated.++Bart+and+Homer+get+Bart+a+new+bike%2C+but+it+needs+to+be+assembled+and+Homer+tries+to+do+his+best.++The+bike+falls+apart+when+Bart+tries+to+show+it+off+to+the+older+boys.++Later+Bart+and+Homer+are+watching+%22Robot+Rumble%22+and+the+father+and+son+teams+inspire+Homer+to+try+building+a+robot+for+them+to+enter+in+competition+but+Bart+leads+Homer+to+believe+that+Bart+thinks+he+is+an+oaf.++Marge+and+Lisa+look+for+a+new+cat+and+Lisa+finds+a+new+one+that+she+calls+Snowball+III.++Homer+tries+to+build+a+robot%2C+but+his+result+is+a+failure.++Homer+looks+to+his+father+for+inspiration+and+becomes+a+robot+instead+of+building+one.++Bart+wakes+to+find+Homer%27s+robot+in+his+room%2C+which+is+actually+Homer+inside+of+large+metal+shell+powered+by+a+tricycle.++Lisa+finds+that+Snowball+III+has+drowned+in+the+fish+tank.++Bart+competes+on+%22Robot+Rumble%2C%22+with+the+robot+he%27s+called+%22Chief+Knock-A-Homer%2C%22+but+Homer+is+nowhere+to+be+found.++Homer%2C+hidden+inside+the+robot%2C+manages+to+win+his+first+match%2C+but+only+after+he+receives+numerous+cuts+and+bruises.++Lisa+gets+%28and+quickly+loses%29+a+new+cat+named+Coltrane.++Chief+Knock-A-Homer+quickly+works+his+way+into+the+finals%2C+but+Bart+is+sorry+that+his+father+hasn%27t+been+able+to+see+any+of+the+Chief%27s+victories.++The+Chief%27s+final+match+is+scheduled+to+be+against+Professor+Frink+and+his+son%27s+deadly+looking+robot.++Lisa%2C+depressed+about+her+propensity+to+kill+cats%2C