INSERT INTO `series_episodes` VALUES("55775","0","0","0","Diatribe+of+a+Mad+Housewife","10","15","1074985200","71663","Homer+compromises+the+power+plant%27s+security+system+and+as+a+result+gets+fired.++Marge+and+the+kids+go+to+a+bookstore+and+while+there+she+sits+in+a+on+a+book+reading+and+then+asks+the+author+if+anyone+can+write+a+book.++The+answer+gives+Marge+an+idea.++Meanwhile%2C+Homer+has+gotten+a+job+as+a+car+salesman%3B+but+there+is+an+ambulance+on+the+lot+that+seduces+Homer+into+quitting+that+job+and+becoming+an+ambulance+driver.++Marge+wants+to+start+writing+her+novel+and+Homer+agrees+to+watch+the+kids%2C+while+putting+in+his+night+shift+as+an+ambulance+driver.++Marge+completes+her+novel+and+lets+Lisa+read+it.++Seeing+one+of+the+characters+is+hard+on+her+father%2C+Lisa+suggests+that+Marge+let+Homer+read+the+novel.++Homer+makes+an+attempt%2C+fails+and+tells+her+that+he+did.++Marge+gets+her+novel+published+and+the+kids+worry+that+if+Homer+ever+reads+it+or+sees+it+as+a+MADtv+sketch%2C+he+will+be+heartbroken.++Marge%27s+novel+comes+out+and+everyone+in+Springfield+is+talking+about+it.++Homer+gets+the+book+on+tape+version%2C+as+read+by+the+Olsen+twins%2C+and+finds+out+what+everyone+is+talking+about.++Mad+Homer+chases+after+Flanders+to+do+something+he+should+have+taken+care+of+a+long+time+ago.%0A","7","21");
