INSERT INTO `series_episodes` VALUES("55777","0","0","0","Milhouse+Doesn%27t+Live+Here+Anymore","12","15","1076799600","71663","On+a+school+field+trip+to+the+Museum+of+Television+and+TV+Milhouse+shows+that+he+has+developed+a+new+attitude+where+he+just+doesn%27t+care.++Meanwhile+Mr.+Burns+has+moved+Homer%2C+Lenny+and+Carl+to+an+offsite+location+%28Moe%27s%29+so+that+they+don%27t+ruin+a+visit+by+the+plant%27s+board+of+directors.++Apu+and+Manjula+stop+by+celebrating+their+anniversary%2C+making+Homer+realize+he+hasn%27t+gotten+anything+for+his+anniversary+with+Marge.++He+gets+extremely+drunk+and+finds+himself+%E2%80%98dancing%27+on+the+street+where+people%2C+thinking+he+is+homeless%2C+start+giving+him+money.++Milhouse+reveals+the+secret+to+his+new+attitude+is+the+fact+that+he+and+his+mother+are+moving+to+Capitol+City%2C+where+they+are+going+to+get+a+fresh+start.++Both+Bart+and+Kirk+Van+Houten+are+going+to+have+to+learn+to+get+along+without+Milhouse+being+around.++Bart+tries+to+adapt+to+a+world+without+Milhouse%2C+especially+after+a+visit+to+Milhouse+in+Capitol+City+makes+him+realize+that+things+will+never+be+the+same.++In+the+meantime%2C+Homer+has+begun+begging+as+a+second+job+when+he+realizes+he+can+make+good+money+that+allows+him+to+buy+Marge+an+expensive+anniversary+gift.++With+Milhouse+out+of+his+life%2C+Bart+finds+himself+bonding+with+his+sister+and+she+is+enjoying+the+new+relationship+with+her+brother%3B+a+relationship+that+gets+tested+when+Kirk+gets+%22pity+custody%22+of+Milhouse+and+Marge+is+enlightened+by+the+homeless+on+Homer%27s+second+source+of+income.%0A","7.5","26");
