INSERT INTO `series_episodes` VALUES("55780","0","0","0","Co-Dependent%27s+Day","15","15","1079823600","71663","Homer%2C+Lisa+and+Bart+get+tickets+for+the+latest+chapter+of+%22Cosmic+Wars.%22++The+movie+wasn%27t+what+they+hoped+it+would+be.++Marge+suggests+that+the+kids+write+a+letter+expressing+their+dissatisfaction+to+creator+Randall+Curtis.++Two+weeks+later+when+they+get+a+stock+letter+in+reply+and+they+ask+if+they+can+go+to+the+%22Cosmic+Wars+Ranch%22+and+complain+in+person.++The+family+%28sans+Maggie%29+goes+to+Northern+California.++While+Marge+and+Homer+go+on+a+winery+tour%2C+Bart+and+Lisa+go+to+the+ranch+to+find+the+creator+and+make+their+feelings+known.++After+Bart+and+Lisa+have+their+meeting+with+Curtis+they+rejoin+their+parents%2C+who+they+find+are+both+drunk+on+free+samples+they+had+at+the+winery.++Marge+and+Homer+are+really+enjoying+their+wine+together%2C+but+following+one+their+nights+of+drinking+Marge+finds+her+with+a+hangover.++They+agree+that+she+can+stop+drinking+and+they+can+still+have+fun+together.++They+go+to+Oktoberfest+and+Marge+almost+gets+away+with+not+drinking%2C+but+drink+she+does+and+they+both+leave+the+drunk%2C+with+Homer+driving.++After+he+drives+their+car+off+the+road%2C+Homer+decides+to+make+it+look+like+Marge+%28who+is+somewhat+passed+out%29+was+behind+the+wheel.++The+police+arrest+Marge%3B+Homer+is+nowhere+to+be+found+at+the+time+and+he+later+bails+her+out.++Barney+suggests+a+rehab+clinic+for+Marge+to+start+attending.++Homer+finds+out+that+Marge+is+going+to+be+gone+for+a+month%2C+he+asks+Flanders+to+watch+the+kids+while+he+goes+to+break+her+out+of+rehab.++He+finds+her+and+confesses+his+guilt%2C+which+makes+her+angry+and+she+starts+drinking+again.++After+some+heavy+drinking%2C+Marge+realizes+that+it+isn%27t+drinking+that+she+liked%3B+it+was+being+together+with+Homer.++She+gets+Homer+and+together+they+leave%2C+after+Homer+promises+to+cut+out+drinking+all+clear+liquors.%0A","7","23");
INSERT INTO `series_episodes` VALUES("55781","0","0","0","The+Wandering+Juvie","16","15","1080428400","71663","The+family+is+at+a+downtown+department+store%2C+where+among+other+things+Lisa+looks+at+the+latest+in+fashion+for+young+girls%2C+Marge+gets+some+rejuvenating+cream%2C+Homer+uses+the+dressing+room+for+something+other+than+trying+clothes+on%2C+and+Seymour+and+Edna+are+selecting+some+wedding+china.++Bart+uses+the+wedding+gift+registry+to+sign+himself+and+his+bride+%22Lotta+Cooties%22+for+wedding+presents.++He+invites+a+number+of+people+to+attend+his+wedding+and+he+plans+to+return+all+the+unused+gifts+for+store+credit.++He+gets+all+the+gifts+delivered+but+he+gets+caught+by+Chief+Wiggum.++The+judge+sentences+Bart+to+six+months+of+juvenile+detention.++Bart+tries+to+find+his+way+at+the+center%2C+and+when+Homer+becomes+a+guard%2C+it+doesn%27t+improve+his+situation+at+all.++The+boys+and+girls+are+brought+together+for+dance+lessons%2C+but+Bart%27s+partner+Gina+decides+that+they+have+an+opportunity+for+escape+and+since+they%27ve+been+handcuffed+together%2C+she+brings+him+along.++Out+on+the+lam+together+they+become+attached%2C+even+after+they%27ve+gone+to+a+blacksmith+to+get+their+cuffs+removed%3B+because+when+Gina+is+own+her+own+she+knows+she+has+nothing+to+return+to%2C+whereas+Bart+has+a+family.++When+the+pair+is+found%2C+Gina+makes+a+confession+that+makes+it+so+Bart+is+free+to+return+to+his+family.%0A","6.8","24");
INSERT INTO `series_episodes` VALUES("55782","0","0","0","My+Big+Fat+Geek+Wedding","17","15","1082239200","71663","Principal+Seymour+Skinner+and+Ms.+Edna+Krabappel+are+finally+getting+married.++Edna+has+a+great+bachelorette+party+at+the+Simpson+house%2C+featuring+Duffman+and+a+top-less+Chief+Wiggum%3B+meanwhile+at+Seymour%27s+bachelor+party+at+Moe%27s%2C+he+confesses+to+Homer+the+fact+that+he+is+getting+cold+feet.++When+the+actual+event+is+about+to+occur%2C+Edna+has+second+thoughts%3B+feeling+that+Seymour+has+never+been+on+board+with+this+whole+idea+all+along.++Edna+runs+from+the+ceremony.++Unknowingly+both+Homer+and+Marge+are+each+with+the+pair+in+an+attempt+to+get+them+back+together.++The+attempt+fails+when+the+state+of+Homer+and+Marge%27s+own+marriage+gets+in+the+way.++Edna+returns+a+gift+to+the+Comic+Book+Guy.++She+becomes+charmed+by+his+banter+and+agrees+to+accompany+him+to+lunch.++Homer+tries+having+Seymour+serenade+Edna%2C+but+they+discover+she%27s+seeing+Comic+Book+Guy.++The+family+goes+to+Bi-Mon-Sci-Fi-Con+to+try+to+keep+Edna+from+making+a+big+mistake.++After+seeing+Futurama+creator+Matt+Groening%2C+they+find+Edna+being+proposed+to+by+a+Klingon+clad+Comic+Book+Guy.++Seymour+enters+wearing+a+Catwoman+outfit+and+begins+battling+Comic+Book+Guy.++Edna+stops+the+fight%2C+and+tells+the+pair+that+neither+man+is+for+her.++Now+Homer+must+make+some+amends+to+Marge+to+keep+his+marriage+together.%0A","7.1","20");
INSERT INTO `series_episodes` VALUES("55783","0","0","0","Catch+%27Em+If+You+Can","18","15","1082844000","71663","Bart+lectures+the+other+students+on+water+balloons+and+after+hitting+Lisa+with+one+he+gets+into+a+fight+with+her+all+the+way+home.++Marge+tells+the+pair+that+they+are+going+to+Dayton%2C+Ohio+to+celebrate+Uncle+Tyrone%27s+birthday.++Bart+and+Lisa+aren%27t+thrilled+with+the+idea+and+get+to+stay+home.++As+a+family+activity+they+rent+a+video%2C+%22Love+Story%22+and+Bart+and+Lisa+are+bored+by+it+such+that+they+ruin+any+moment+the+film+might+have+created+for+Homer+and+Marge.++Homer+and+Marge+look+forward+to+their+trip+without+the+kids+and+on+a+whim+they+decide+to+forgo+seeing+Uncle+Tyrone+and+get+on+a+plane+to+Miami.++Lisa+and+Bart+are+aware+that+the+hotel+in+Dayton+where+Marge+and+Homer+were+supposed+to+be+staying+was+wiped+out+by+a+tornado.++Bart+discovers+there+parents+are+in+Miami.++They+get+Grandpa+to+take+them+there.++While+Bart+and+Lisa+find+their+parents%2C+Grandpa+goes+looking+for+companionship.++Marge+and+Homer+see+the+kids+waiting+for+them+so+they+take+off+again%2C+only+Bart+and+Lisa+are+on+their+trail.++Homer+and+Marge+are+in+Atlantic+City+when+they+spot+the+kids+so+they+go+on+the+run+from+them+in+an+instrumental+musical+montage.++Meanwhile+Abe+has+found+companionship+in+Miami+with+a+man+named+Raoul+who+appreciates+his+rambling+stories.++Homer+and+Marge+finally+find+themselves+in+Niagara+Falls%2C+but+the+kids+are+their+as+well.++Feeling+a+little+guilty+Bart+and+Lisa+decide+to+give+their+parents+their+space+and+go+to+the+amusement+park+only+to+find+their+parents+are+already+there.++Homer+and+Marge+run+from+the+pair+only+to+find+refuge+in+a+giant+inflatable+castle%2C+which+their+lovemaking+antics+cause+to+fall+into+the+Niagara+River.++The+couple+floats+toward+the+falls+and+certain+death+only+to+be+saved+by+their+large+floatation+device.++Later+back+in+Springfield%2C+Ned+and+Rod+Flanders+receive+their+credit+card+bills.%0A","7.6","22");
INSERT INTO `series_episodes` VALUES("55784","0","0","0","Simple+Simpson","19","15","1083448800","71663","Homer+is+intrigued+by+a+commercial+that+talks+about+a+contest+that+will+allow+the+winner%2C+the+finder+of+a+golden+ticket%2C+a+trip+to+%22Farmer+Billy%27s+Bacon+Factory.%22++Homer+buys+a+lot+of+pork+products+but+is+only+able+to+find+a+silver+ticket%2C+which+allows+him+to+judge+the+pig+competition+at+the+county+fair.++When+Homer+sees+an+injustice+being+done+to+Lisa%27s+entry+in+the+place+setting+competition%2C+he+decides+to+take+action.++Remembering+Chief+Wiggum%27s+warning+about+felony+assault%2C+he+disguises+himself+as+%22Pie+Man%22+and+delivers+a+pie+in+the+face+as+revenge.++He+disappears+as+quickly+as+he+came%2C+making+Springfield+wonder+if+they+will+ever+see+him+again.++When+Bart+gets+ripped+off+by+Comic+Book+Guy%2C+%22Pie+Man%22+delivers+some+%22key+lime+justice.%22++The+police+decide+that+%22Pie+Man%22+needs+to+be+stopped+and+they+shoot+him+when+he+makes+his+next+appearance.++He+takes+time+out+from+his+fleeing+to+save+Marge+and+then+kisses+her%2C+even+though+she+tells+him+she%27s+a+married+woman.++Later+at+home%2C+the+wounded+Homer+makes+a+promise+to+Lisa+%28who%27s+figured+out+his+disguise%29+that+he+will+stop+his+pie+avenging.++When+Mr.+Burns+goes+too+far%2C+%22Pie+Man%22+makes+another+appearance%2C+but+his+escape+from+the+plant+is+thwarted+by+his+own+laziness.++Mr.+Burns+turns+him+into+his+personal+hit+man.++Homer+finds+himself+in+a+dilemma+when+Mr.+Burns+wants+him+to+deliver+a+pie+in+the+face+of+Lisa%27s+Buddhist+hero+the+Dalai+Lama.++When+he+comes+clean+in+front+of+a+crowd%2C+no+one+believes+that+he+was+capable+of+being+the+%22Pie+Man%2C%22+only+his+family+believes+in+him.%0A","7.3","22");
INSERT INTO `series_episodes` VALUES("55785","0","0","0","The+Way+We+Weren%27t","20","15","1084053600","71663","Homer+and+Bart+get+into+a+fight+over+using+a+beer+bottle+to+kiss+girls+which+land+them+in+Simpson+family+court%2C+where+Lisa+presides+as+judge.++While+giving+testimony+Marge+tells+the+kids+that+Homer%27s+first+kiss+was+with+her+in+high+school.++He+confesses+that+it+wasn%27t+his+first+kiss.++Back+when+he+was+ten+he+went+to+camp+See-A-Tree+%28for+underprivileged+boys%29.++Here+he+meets+Lenny%2C+Carl+and+Moe.++The+boys+go+to+the+girl%27s+camp+where+they+work+in+the+kitchen.++After+Homer+returns+the+retainer+to+the+girl+who+lost+it+he+gets+the+opportunity+to+meet+her+later+that+night.++He+tells+the+kids+she+was+the+prettiest+girl+he%27d+ever+seen%2C+until+he+later+met+their+mother.++Marge+reveals+that+the+girl+was+her.++Marge+tells+the+story+from+her+perspective.++At+the+girls+camp%2C+Land-A-Man%2C+we+find+Marge%2C+Patty%2C+Selma%2C+Helen+%28Lovejoy%29%2C+Cookie+Kwan.++When+she+met+Homer+that+it+was+she+who+first+kisses+him+and+then+they+have+the+perfect+kiss.++They+agree+to+meet+again+the+following+night%2C+but+Homer+doesn%27t+show.++Marge+says+it+was+years+before+she+could+trust+another+boy.++Homer+explains+why+he+didn%27t+return+for+a+second+date.++After+he+left+her+he+fell+off+a+cliff+into+the+lake+and+drifted+to+the+shores+of+%22Camp+Flab-Away%2C%22+which+featured+Quimby%2C+Wiggum+and+Comic+Book+Guy+as+some+of+the+overweight+campers.++Homer+manages+to+escape+and+gets+to+Marge%27s+camp%2C+but+arrives+after+she%27s+left.++Now+that+Marge+knows+the+truth+Homer+hopes+for+her+forgiveness.++She+doesn%27t+believe+he+really+cared+all+those+years+ago%2C+until+he+pulls+the+other+piece+of+her+broken+heart+out+of+his+memory+box.%0A","7.4","17");
INSERT INTO `series_episodes` VALUES("55786","0","0","0","Bart-Mangled+Banner","21","15","1084658400","71663","It%27s+shot+day+and+Bart+tries+to+evade+the+needle.++Dr.+Hibbert+manages+to+get+the+job+done+but+Bart+suffers+a+side+effect+of+temporary+hearing+loss+from+the+shot+and+he+takes+advantage+of+it+for+all+it%27s+worth.++At+Springfield+Elementary+the+annual+Donkey+basketball+tournament+is+being+held.++During+the+playing+of+The+Star+Spangled+Banner+Bart+has+his+shorts+eaten+by+a+donkey%2C+leaving+his+bare+ass+exposed+towards+the+flag.++Martin+snaps+a+picture+and+everyone+present+is+outraged+at+this+behavior.++As+a+result+the+Simpson+family+becomes+very+unpopular.++They+go+on+a+cable+news+channel+and+only+manage+to+dig+themselves+into+a+deeper+hole+when+the+host+manages+to+twist+Marge%27s+words+into+saying+that+Springfield+hates+America.++The+negative+publicity+causes+Mayor+Quimby+to+change+the+name+of+the+town+to+Liberty-Ville+and+they+make+everything+patriotic.++The+family+is+arrested+under+violation+of+the+%22government+knows+best+act%22+and+they+are+brought+to+a+reeducation+center.++The+last+registered+Democrat+tells+them+how+they+can+escape.++During+their+musical+number+they+escape+through+a+tunnel+but+find+they+were+on+Alcatraz.++They+are+rescued+by+a+passing+French+freighter+and+taken+to+France.++After+being+there+a+while+they+decide+they+miss+their+life+in+America+and+go+back+as+illegal+immigrants.%0A","7","21");
INSERT INTO `series_episodes` VALUES("55787","0","0","0","Fraudcast+News","22","15","1085263200","71663","Lisa+is+going+to+read+a+poem+at+the+town%27s+celebration+of+their+natural+landmark+%22Geezer+Rock%2C%22+but+Homer+who+believes+he+is+doing+the+right+thing+removes+a+bush+from+the+landmark+that+causes+it+to+fall+apart.++Mr.+Burns+is+caught+in+the+landslide+and+Smithers+fears+he+is+lost.++Lisa+is+disappointed+that+no+one+got+to+hear+her+poem+and+Marge+suggests+that+she+get+it+published.++To+Smithers%27+delight%2C+Mr.+Burns+has+survived+the+landslide+by+slithering+his+way+out+however%3B+he+is+annoyed+to+find+out+that+no+one+missed+him+when+they+thought+he+was+lost.++He+decides+to+buy+every+media+outlet+in+town.++Lisa+distributes+the+first+issue+of+her+own+newspaper+the+%22The+Red+Dress+Press%2C%22+which+is+a+success.++Now+she+has+to+get+out+a+second+issue+and+she+enlists+the+help+of+her+fellow+children.++Meanwhile%2C+Mr.+Burns+has+taken+control+of+all+the+media+outlets+in+Springfield%2C+except+one%2C+her+newspaper.++Mr.+Burns+tries+to+seduce+Lisa+into+selling+out+but+she+won%27t+give+up.++Now+Mr.+Burns+starts+to+play+hardball%2C+he+cuts+the+power+to+the+Simpson+home.++Principal+Skinner+offers+Lisa+the+use+of+an+old+mimeograph+machine%2C+which+gets+her+latest+issue+out.++Mr.+Burns+talks+with+Homer+to+get+the+dirt+on+Lisa%2C+that+Homer+readily+supplies+and+Burns+uses+this+information+against+her.++Lisa+is+ready+to+give+up+and+Homer+realizing+what+he%27s+done+responds+by+printing+a+newspaper+of+his+own.++Homer%27s+paper+inspires+others+to+think+to+begin+to+think+for+themselves+and+soon+everyone+is+printing+their+own+newspaper.%0A","7.3","16");
INSERT INTO `series_episodes` VALUES("55788","0","0","0","Treehouse+of+Horror+XV","1","16","1099782000","71663","We+open+with+an+episode+of+%22Keepin%27+It+Kodos%22+with+Kang.++In+this+episode%2C+Kang+and+Kodos+have+the+Simpson+family+for+dinner+with+their+boss.++The+meal+is+a+success+as+Kang+gets+a+hyper-galactic+promotion.+%0A%0Aa%29.+%22The+Ned+Zone%22%0A%0AHomer+knocks+Ned+unconscious+with+his+bowling+ball%2C+when+he+recovers+he+discovers+that+he+was+really+dying+of+a+brain+tumour+%26+the+bowling+ball+lodged+it+out+%28which+give+him+premonitions+of+doom%29.++He+tells+Homer+about+his+new+power+and+Homer+wants+to+know+his+future.++Ned+sees+Homer+being+shot+in+the+back%2C+and+the+shooter+is+he.++Ned+keeps+this+information+to+himself+and+manages+to+not+shoot+Homer.++He+then+finds+out+that+Homer+is+going+to+cause+the+destruction+of+all+of+Springfield+by+destroying+the+plant%27s+nuclear+reactor.++Ned+goes+to+the+power+plant+to+try+to+prevent+the+catastrophe.+Unfortunately%2C+he+had+to+kill+Homer+to+save+everyone+%28but+even+through+that%2C+Homer+accidently+fell+onto+the+nuclear+reactor+button+still+consious+from+the+bullet+%26+killed+everyone+in+the+end%29.+At+least%2C+everyone+is+in+a+better+place.+%0A%0Ab%29.+%22Four+Beheadings+and+a+Funeral%22%0A%0AThe+%22Mutton+Chop+Murderer%22+has+taken+another+victim%2C+and+Eliza+Simpson+and+her+sidekick+Dr.+Bartley+join+with+Inspector+Wiggum+of+Scotland+Yard+to+find+the+killer.++The+dagger+used+is+the+latest+crime+is+found+to+be+one+of+a+set%2C+and+they+find+that+the+set+was+owned+by+C.+Ebenezer+Burns.++They+go+to+the+opium+den+and+find+that+Burns+had+sold+the+daggers+to+a+fat+man+%28Homer%29+to+get+money+for+opium.++The+fat+man+is+caught+and+sentenced+to+death%2C+but+when+Eliza+and+Dr.+Bartley+find+yet+another+body%2C+Eliza+knows+the+fat+man+is+innocent+and+finds+an+important+clue+to+the+real+killer%27s+identity+on+the+latest+murder+weapon.%0A%0Ac%29.+%22In+the+Belly+of+the+Boss%22%0A%0AAt+the+%22New+Invention+Expo%22+Maggie+gets+inside+of+a+new+vitamin+pill+that+is+going+to+be+reduced+by+Prof.+Frink%27s+new+shrink+ray.++The+pill+is+swallowed+by+Mr.+Burns.++The+other+Simpson+family+members+become+bionauts+inside+a+submarine+that+is+miniaturized+and+sent+inside+of+Mr.+Burn%27s+body.++Maggie+is+found%2C+but+there+is+not+enough+power+to+get+everyone+and+the+submarine+out+of+the+body%2C+someone+must+stay+behind%2C+%26+that+person+is+%28drumroll%29+Homer+%28again%29.+Everyone+else+makes+it+out+%26+Frink+announces+that+there+is+still+a+chance+to+save+Homer.+Unfortunately%2C+he+returns+to+normal+size+inside+the+skin+of+Mr.+Burn%27s.%0A%0AThen%2C+everyone+from+all+three+segments+of+the+episode+start+dancing.%0A","7.4","31");
INSERT INTO `series_episodes` VALUES("55789","0","0","0","All%27s+Fair+in+Oven+War","2","16","1100386800","71663","The+house+next+door+is+for+sale+and+Marge+and+Homer+go+inside+to+check+it+out%3B+Marge+falls+in+love+with+the+kitchen.++Back+at+home+Marge+asks+Homer+for+a+new+kitchen.++Rather+than+hire+someone%2C+Homer+decides+to+do+the+renovation+himself.++While+demolishing+the+kitchen%2C+Homer+unleashes+his+old+collection+of+Playdude+magazines.++He+tells+Marge+he+keeps+them+for+the+articles%3B+she+obliges+him+by+cutting+up+the+magazines%2C+keeping+only+the+articles.++Now+that+they+are+useless%2C+Homer+throws+them+away%2C+only+to+have+them+found+by+Bart+and+Milhouse.++Using+these+1970%27s+era+magazines+as+a+model%2C+Bart+decides+to+renovate+the+Treehouse.++After+Homer+has+made+a+mess+of+the+kitchen+remodeling%2C+Marge+is+finally+able+to+hire+a+contractor%2C+who+completes+the+job+%22on-time%22+two+years+later+for+%24100%2C000.++Marge%27s+first+new+dish+out+of+her+kitchen+gets+rave+reviews+and+she+decides+to+enter+the+Ovenfresh+Bakeoff+with+her+Dessert+Dogs.++At+the+bakeoff+Marge+encounters+stiff+and+ruthless+competition%2C+so+ruthless+that+Marge+resorts+to+cheating+to+get+even%2C+much+to+Lisa%27s+dismay.++Chief+Wiggum+and+other+concerned+parents+talk+with+Homer+about+Bart%27s+spreading+the+Playdude+philosophy+to+the+other+children.++Homer+has+a+talk+with+Bart+about+the+facts+of+life%2C+which+a+horrified+Bart+quickly+spreads+to+the+other+children.++Meantime%2C+in+the+finals+for+the+bakeoff+against+Brandine%2C+Marge+admits+to+her+foul+play+and+Lisa%27s+faith+in+her+mother+is+restored.%0A","7.2","42");
INSERT INTO `series_episodes` VALUES("55790","0","0","0","Sleeping+with+the+Enemy","3","16","1100991600","71663","Lisa+has+a+big+butt+and+her+friends+at+school%2C+Sherri%2C+Terri+and+Janie+let+her+know+about+it.++Homer+explains+to+her+about+the+Simpson+butt%2C+it+is+something+she%27ll+have+to+learn+to+live+with.++Bart+comes+home+with+100+on+his+test%2C+and+now+he+wants+to+collect+on+the+party+that+was+promised.++Lisa+is+trying+to+deal+with+her+weight+issue%2C+meanwhile+Bart+gets+his+party%3B+with+his+relatives%2C+Ralph%2C+Martin+and+Milhouse+via+speakerphone.++It%27s+the+worst+party+ever+as+far+as+Bart%27s+concerned.++It%27s+made+worse+when+Lisa+returns+home+only+to+be+confronted+by+her+mother+wanting+her+to+eat+a+big+slice+piece+of+cake%2C+she+runs+out+of+the+room+crying.++Marge+is+bummed+that+the+kids+don%27t+appreciate+her+anymore.++She+finds+Nelson+in+the+park+and+spends+some+quality+time+with+him+and+when+her+kids+continue+to+shun+her%2C+she+adopts+Nelson+as+a+surrogate+child.++Lisa+tries+diet+and+exercise+to+reduce+her+big+bottom.++Marge+brings+Nelson+home+to+do+some+chores+around+their+home%2C+but+Nelson%27s+real+mother+returns+that+money+that+Marge+paid+her+son+and+then+she+leaves+for+Hollywood%2C+leaving+her+son+in+Springfield+and+homeless.++Nelson+goes+to+the+only+place+where+he+can+find+refuge%2C+the+Simpson+home.++Much+to+Bart%27s+dismay+Marge+lets+Nelson+stay+in+his+room.++Late+one+night+Bart+finds+Nelson+singing+for+the+return+of+his+father+and+Lisa+overindulging+in+a+cake+%28she%27d+previously+been+starving+herself%29.++Lisa+gets+help+from+Nelson+to+get+revenge+on+Sherri+and+Terri.++When+the+pair+returns+to+the+Simpson+home+there+is+a+surprise+waiting+for+Nelson%3B+Bart+has+found+his+father.++Nelson+is+reunited+with+his+father+%28and+his+mother+who%27s+returned+from+Hollywood+with+an+acting+job%29.++Lisa+still+hasn%27t+found+a+conclusive+solution+to+her+weight+problem.%0A","7.1","29");
INSERT INTO `series_episodes` VALUES("55791","0","0","0","She+Used+to+Be+My+Girl","4","16","1102201200","71663","Famous+journalist+Chloe+Talbot+comes+to+Springfield+to+cover+a+scandal+involving+Mayor+Quimby.++Chloe+Talbot+comes+from+Springfield+and+she+and+Marge+were+journalism+students+together+in+high+school%3B+Chloe+went+on+to+fame+and+fortune+and+we+all+know+what+happened+to+Marge.++Lisa+becomes+enamored+with+Chloe+and+Marge+becomes+jealous+of+loss+of+her+daughter%27s+attention.++After+a+half+a+glass+of+wine%2C+Marge+goes+cuckoo+bananas+and+gets+into+a+fight+with+Chloe.++When+Marge+won%27t+let+her+go+with+Chloe+to+news+conference%2C+Lisa+sneaks+out+and+into+the+trunk+of+Chloe%27s+car.++Everything+might+have+gone+according+to+plan+if+Chloe+hadn%27t+been+diverted+to+cover+the+eruption+of+a+volcano.++Lisa+and+Chloe+get+into+trouble+and+it+takes+a+mother%27s+love+to+affect+Lisa%27s+rescue%2C+whereas+Chloe%27s+rescue+comes+from+an+old+high+school+boyfriend%2C+Barney+Gumble.%0A","7.3","26");
INSERT INTO `series_episodes` VALUES("55792","0","0","0","Fat+Man+and+Little+Boy","5","16","1102806000","71663","Bart+loses+his+last+baby+tooth+in+a+spitball+fight.++Called+the+money+tooth%2C+Bart+is+suffering+from+what+he+calls+a+midlife+crisis+when+the+tooth+fairy+has+given+a+gift+in+his+name+to+the+United+Way%2C+what+his+mother+calls+a+%22grown-up+gift.%22++Bart+gives+up+on+his+childhood+and+Lisa+suggests+that+he+expresses+his+feelings+in+some+way+and+Bart+chooses+to+put+them+in+the+form+of+slogans+on+a+T-shirt.++When+Goose+Gladwell%2C+a+gag-gift+entrepreneur%2C+sees+the+slogans+he+forms+a+partnership+with+Bart+that+begins+to+make+Bart+a+lot+of+money.++Homer+is+suspended+from+work+without+pay+and+then+decides+to+quit+outright+and+live+off+of+his+son%27s+earnings.++Of+course+he+loses+his+place+in+the+family+as+breadwinner+and+starts+to+lose+his+self+respect.++A+documentary+by+Declan+Desmond+on+lions+inspires+Homer+to+start+focusing+on+his+relationship+with+Lisa.++He+decides+to+help+her+with+her+science+project+about+nuclear+power%2C+which+includes+a+scale+model+of+the+first+nuclear+power+plant.++Homer+improves+on+her+model+by+making+it+functional%2C+something+easily+done+after+finding+the+instructions+on+the+Internet.++He+sneaks+into+the+power+plant+and+get+some+plutonium.++Meanwhile%2C+Goose+Gladwell+has+sold+the+rights+to+Bart%27s+T-Shirts+to+Disney+and+Bart+won%27t+get+a+dime+from+it.++To+get+back+into+his+role+as+the+alpha+male+of+the+family%2C+Homer+makes+use+of+the+working+nuclear+reactor+to+threaten+Gladwell+into+giving+his+son+what+he+deserves+and+few+novelty+items+for+himself.++As+to+whether+the+reactor+actually+works+or+not%2C+Homer+decides+to+leave+that+up+to+the+seagulls+at+the+city+dump+to+figure+it+out.%0A","7.4","28");
INSERT INTO `series_episodes` VALUES("55793","0","0","0","Midnight+Rx","6","16","1105830000","71663","The+power+plant%27s+office+party+is+being+held+at+the+Springfield+Air+and+Space+museum%2C+where+amongst+other+things+we+learn+that+Agnes+Skinner+was+a+wing-walker+back+in+the+1920s.++Mr.+Burns+is+acting+unusually+nice%2C+and+then+he+makes+an+announcement+that+the+employee+prescription+drug+program+has+been+canceled.++Other+companies+follow+suit%2C+the+citizens+of+Springfield++%0AAt+Springfield+Retirement+Castle%2C+due+to+the+high+cost+of+medication%2C+they+cut+their+residents+off+cold+turkey.++Grandpa+goes+to+his+son%27s+home+with+a+plan%3B+he+has+a+friend+that+will+help+them+out.++He+and+Homer+go+to+Canada+where+they+meet+the+friend+that+gives+them+cards+that+will+let+them+get+all+the+drugs+they+can+carry.++They+return+home+and+their+drugs+are+in+high+demand.++Ned+and+Apu+accompany+them+on+their+next+trip+to+Canada%2C+but+an+unfortunate+incident+with+Apu+and+a+hot+cup+of+coffee+gets+their+cover+blown+as+they+try+to+cross+the+border.++They+are+banished+from+ever+returning+to+Canada.++Because+he+can+no+longer+afford+the+medication+he+requires+Smithers%27+thyroid+begins+to+swell+causing+a+concern+for+Mr.+Burns%2C+he+doesn%27t+want+to+have+to+train+anyone+else+on+his+filing+system.++He+provides+the+means%2C+his+old+wooden+plane+The+Plywood+Pelican%2C+for+Homer+to+invoke+his+plan+to+fly+into+Canada.++They+load+up%2C+but+on+the+return+flight+the+plane+encounters+trouble.++Burns+bails+out%2C+leaving+Homer+and+Grandpa+to+crash+land+the+plane+in+Springfield%27s+town+square%2C+where+their+smuggled+drugs+are+hit.++Meanwhile%2C+Mr.+Burns+has+cured+Smithers+and+decides+to+reinstitute+the+drug+program+for+all+his+full+time+employees.++Homer+comes+home+from+work+to+report+that+he+is+now+a+freelance+consultant%2C+complete+with+a+lump+on+his+throat.%0A","7.2","28");
INSERT INTO `series_episodes` VALUES("55794","0","0","0","Mommie+Beerest","7","16","1107039600","71663","The+family+is+celebrating+by+having+brunch+at+a+fancy+restaurant%3B+Homer+has+finally+paid+off+the+mortgage.++Lisa+and+Bart+get+into+a+food+fight%2C+embarrassing+Homer.++Homer+goes+to+Moe%27s%2C+where+a+visit+from+the+health+inspector%2C+results+in+his+death+from+eating+one+of+Moe%27s+pickled+eggs.++The+new+health+inspector+comes+down+hard+and+Moe%27s+is+closed+until+the+violations+are+cleared+up.++The+regulars+hold+an+Irish+wake+for+the+demise+of+Moe%27s.++Homer+decides+to+help+Moe+reopen+his+bar%3B+and+he+gets+a+new+mortgage+for+their+home.++When+Marge+finds+out%2C+as+a+new+co-owner+she+goes+with+Homer+to+the+bar+and+tells+Moe+that+there+are+going+to+be+changes+until+he+pays+them+back.++On+Homer%27s+next+visit%2C+he+finds+Marge+behind+the+bar%2C+protecting+their+investment.++She+sends+him+home+to+take+care+of+the+kids%2C+while+she+sells+Moe+on+the+idea+of+remodeling+the+place+into+an+English+pub.++The+new+place+opens+and+is+a+success%3B+the+kids+tell+Homer+that+they%27ve+noticed+that+Marge+is+spending+more+time+at+Moe%27s+than+he+ever+did.++Homer+becomes+worried%3B+but+Marge+tells+him+there+is+nothing+to+worry+about.++They+go+to+a+movie+together%2C+but+they+are+joined+by+Moe.++Homer+is+more+worried+than+ever%3B+Lenny+and+Carl+tell+Homer+that+Marge+and+Moe+are+having+an+emotional+affair.++When+Marge+and+Moe+are+leaving+to+go+to+a+convention+together+in+Aruba%2C+Homer+makes+a+mad+dash+to+the+airport+and+gets+to+the+airplane+as+it+is+taxing+down+the+runaway.++He+confronts+Moe%2C+but+Moe+makes+him+realize+that+he+really+doesn%27t+know+that+much+about+his+wife.++Homer+concedes+defeat%2C+but+Marge+tells+Moe+that+she+doesn%27t+love+him.++She+tells+Homer+that+she+is+totally+committed+to+him.++In+Aruba%2C+Marge+makes+Moe+realize+that+he+might+be+able+to+make+a+woman+happy+some+day+with+a+few+changes.++Marge+realizes+that+no+one+is+home+watching+the+kids%2C+but+the+kids+