INSERT INTO `series_episodes` VALUES("55795","0","0","0","Homer+and+Ned%27s+Hail+Mary+Pass","8","16","1107644400","71663","The+family+goes+to+run+down+Springfield+Park%2C+where+a+carnival+is+being+held+to+save+it.++Homer+performs+a+wild+crowd-pleasing+dance+at+a+local+carnival%2C+after+beating+Bart%27s+performance+in+a+game.++Ned+Flanders+has+captured+the+performance+on+videotape+and+Comic+Book+Guy+%28Jeff+Albertson%29+puts+it+up+on+the+Internet.++The+video+gets+worldwide+attention%2C+much+to+Homer%27s+embarrassment+but+his+tune+changes+when+a+football+player+wants+to+buy+the+rights+to+use+his+dance+as+his+own+end+zone+celebration.++Homer+turns+the+opportunity+into+a+new+lucrative+occupation%2C+which+prospers+as+other+athletes+come+to+learn+from+him.++Meanwhile+Ned+looks+to+create+his+own+wholesome+entertainment+by+creating+his+own+versions+of+bible+stories%2C+which+get+the+backing+of+Mr.+Burns.++Marge+doesn%27t+like+his+approach%2C+which+eliminates+the+good+aspects+of+the+stories%2C+and+only+concentrates+on+the+violence.++She+threatens+a+boycott%2C+which+gets+Burns+to+remove+his+financial+backing%2C+leaving+Ned+with+no+creative+outlet.++The+commissioner+of+football+%28and+all+the+owners%29+want+to+talk+to+Homer%2C+his+teaching+of+crazy+antics+to+their+players+have+increased+their+ratings.++They+want+him+to+choreograph+the+Superbowl+half-time+show.++Homer+struggles+for+a+show+idea+and+on+the+night+before+the+big+show+he+still+doesn%27t+have+one.++Homer+looks+for+inspiration+at+the+church%2C+but+instead+finds+Flanders%2C+who+is+looking+for+an+outlet+for+his+ideas.++Together+they+bring+the+story+of+Noah+to+the+half-time+show%2C+but+everyone+boos+as+no+one+wanted+to+see+such+a+%22blatant+display+of+religion+and+decency.%22%0A","7.2","24");
INSERT INTO `series_episodes` VALUES("55796","0","0","0","Pranksta+Rap","9","16","1108249200","71663","Homer%27s+lost+the+TV+remote%2C+which+was+swallowed+by+Santa%27s+Little+Helper+and+in+the+chaos+that+follows+Bart+sees+a+commercial+for+a+rap+concert+and+wants+to+go.++Bart+gets+permission+from+Homer%2C+but+when+Marge+finds+out+and+disapproves%2C+Homer+quickly+changes+his+position.++Bart+sneaks+out+and+goes+to+the+show+anyway.++He+is+in+the+front+row+of+the+show+and+when+the+microphone+comes+his+way+he+winds+up+rapping+on+stage+and+holding+his+own.++He+gets+back+home+only+to+find+out+he+is+going+to+be+in+big+trouble%3B+to+prevent+that+he+decides+to+fake+his+own+kidnapping.++The+police+are+on+the+case%3B+meanwhile+Bart+finds+Milhouse+and+hides+out+in+his+dad%27s+bachelor+apartment.++Chief+Wiggum+decides+he+needs+to+do+something+to+improve+his+reputation+as+a+police+officer+and+puts+the+clues+together+to+find+Bart+at+Kirk+Van+Houten%27s+apartment.++Wiggum+is+hailed+as+a+hero+and+Milhouse%27s+father+is+in+jail.++Wiggum+has+been+promoted+to+Police+Commissioner+but+Bart%2C+feeling+guilty+about+getting+his+friend%27s+father+put+in+jail%2C+comes+clean+about+faking+the+kidnapping.++Wiggum+shows+Bart+that+everyone+is+better+off+believing+the+lie%2C+Milhouse%27s+dad+is+being+worshipped+by+prisoner+loving+woman+and+he+gets+three+square+meals+a+day.++Back+at+the+house%2C+Lisa+has+found+a+clue+that+proves+Bart+wasn%27t+kidnapped.++She+tries+to+tell+Homer%2C+but+he+has+sold+the+story+to+Hollywood.++Lisa+goes+to+Principal+Skinner+for+help+and+the+pair+begins+an+investigation+that+will+unravel+the+lie+that+is+benefiting+everyone.++Bart+takes+the+other+conspirators+to+rapper+Alcatraz%27s+crib+to+prevent+Lisa+and+Skinner+from+finding+the+truth.++They+arrive+too+late%2C+only+to+find+out+that+they+know+the+truth.++Bart+and+Homer+try+to+convince+Lisa+to+be+cool+about+living+the+lie+and+a+house+party+ensues.%0A","6.8","22");
INSERT INTO `series_episodes` VALUES("55797","0","0","0","There%27s+Something+About+Marrying","10","16","1108854000","71663","Bart+and+Milhouse+look+for+someone+new+to+play+tricks+on+and+they+find+their+new+victim+in+Howell+Huser%2C+a+yokel+who+just+fell+of+the+turnip+truck.++Their+pranks+get+Howell+Huser+to+stop+smiling+and+he+leaves+town%2C+only+to+turn+up+on+the+Soft+News+Network+reporting+that+Springfield+is+the+only+town+he%27s+been+to+that+he+doesn%27t+like.++The+negative+publicity+affects+tourism.++Mayor+Quimby+calls+for+the+town+to+give+him+ideas+to+promote+tourism+and+Lisa+suggests+they+start+allowing+same+sex+marriages.++The+idea+is+approved+and+Springfield+becomes+the+place+to+be+for+same+sex+couples+to+get+married.++When+Reverend+Lovejoy+won%27t+perform+the+ceremonies%2C+Homer+can%27t+pass+up+the+opportunity+to+make+money+and+he+becomes+a+certified+minister+via+the+Internet.++He+marries+all+the+gay+couples+in+town+and+then+starts+to+marry+anything+to+anything+else.++Patty+requires+Homer%27s+service%3B+she+wants+to+marry+her+partner%2C+Veronica%2C+who+is+a+pro-golfer.++Marge+has+trouble+dealing+with+the+fact+that+her+sister+is+gay.++Marge+discovers+Veronica%27s+secret%2C+that+she+is+really+a+man.++Marge+stops+the+wedding+and+reveals+the+secret%2C+and+when+Leslie+Robin+Swisher+%28Veronica%27s+real+name%29+proposes+that+they+still+get+married%2C+she+sticks+to+her+guns%2C+she+still+likes+only+girls.%0A","7.2","20");
INSERT INTO `series_episodes` VALUES("55798","0","0","0","On+a+Clear+Day+I+Can%27t+See+My+Sister","11","16","1110063600","71663","The+students+of+Springfield+Elementary+are+on+a+field+trip+to+Springfield%27s+Glacier%2C+but+when+they+get+there%2C+the+glacier+is+a+shadow+of+its+former+self%2C+a+huge+pond+with+a+hardly+noticeable+block+of+ice.++Lisa+%28of+course%29+blames+global+warming.+While+Lisa+is+calling+for+action+to+save+the+glacier%2C+her+brother+is+taking+every+opportunity+to+torment+her.%0A%0AMeanwhile%2C+back+in+town+Homer+and+Marge+have+gone+to+Sprawl+Mart+to+do+some+shopping.++When+Grampa+%28Sprawl+Mart%27s+greeter%29+isn%27t+capable+of+doing+his+job%2C+Homer+takes+over+and+does+such+a+great+job+it+gets+him+a+full+time+position+with+no+chance+for+advancement.+%0A%0ALisa+has+vengeance+on+Bart+by+getting+a+restraining+order+against+him%2C+he+must+stay+at+least+20+feet+away+from+her+at+all+times%2C+or+go+to+jail.++Chief+Wiggum+shows+the+family+a+videotape+hosted+by+Gary+Busey+on+how+to+live+with+a+restraining+order.++For+his+part+Homer+constructs+a+20+foot+pole+that+Lisa+can+use+to+help+keep+them+apart.+%0A%0AIt+impacts+Bart%27s+life+at+home+and+school.++At+family+court%2C+after+Bart+points+out+some+obvious+flaws+in+her+character%2C+Judge+Harm+increases+the+distance+to+200+feet.++Having+to+live+at+the+edge+of+their+property%2C+Bart+decides+to+embrace+living+the+natural+way.%0A%0AHomer+finds+out+from+his+fellow+employees+how+to+survive+working+at+Sprawl+Mart.++And+mistakenly+feeling+that+Bart+might+have+changed%2C+Lisa+decides+to+forgive+him+and+burn+up+the+restraining+order.%0A","7.2","15");
INSERT INTO `series_episodes` VALUES("55799","0","0","0","Goo+Goo+Gai+Pan","12","16","1110668400","71663","Mr.+Burns+is+taking+his+driving+test+and+Selma+is+having+hot+flashes.++Dr.+Hibbert+diagnoses+that+she+is+going+through+menopause.++After+seeing+a+video+on+the+topic+hosted+by+Robert+Wagner%2C+Selma+is+disappointed+to+learn+that+she%27ll+never+be+able+to+have+children.++Patty+suggests+that+she+try+adoption+and+Lisa+suggests+China.++Only+to+qualify%2C+Selma+needs+a+husband+who+must+go+with+her+to+China+to+collect+their+child.++She+fills+out+the+form+with+the+name%3A+Homer+Simpson.++Selma+flies+the+Simpson+family+to+China.++At+Marge%27s+request%2C+Homer+goes+along+with+the+charade.++Under+the+supervision+of+Madam+Wu%2C+a+Chinese+functionary%2C+the+family%2C+with+Marge+as+the+children%27s+nanny+takes+a+tour+of+the+sites.++For+his+occupation%2C+Homer+tells+Madam+Wu+that+he+is+a+Chinese+acrobat%2C+and+of+course+later+his+services+in+that+capacity+are+called+into+action.++Selma+gets+her+child%2C+a+daughter+named+Ling+Bouvier%2C+only+to+have+her+taken+away+after+Madam+Wu+sees+Marge+snuggling+with+Homer.++At+the+airport%2C+Lisa+comes+up+with+a+plan+to+get+Ling+back.++Homer+poses+as+a+Buddha+statue+to+get+inside+the+orphanage.++Only+Madam+Wu+stops+them+with+a+tank+in+Tien+An+Men+Square.++Selma+appeals+to+Madam+Wu%2C+bureaucrat+to+bureaucrat+and+it+works.++Selma%2C+her+new+daughter+and+the+family+are+allowed+to+leave+China+via+a+junk.%0A","6.9","18");
INSERT INTO `series_episodes` VALUES("55800","0","0","0","Mobile+Homer","13","16","1111273200","71663","Marge+takes+the+kids+on+a+Sunday+drive+while+Homer+is+at+home+attempting+to+clean+out+the+garage.++After+Homer+suffers+a+garage-door-to-the-throat+incident%2C+Marge+wants+them+to+buy+life+insurance.++Homer+however+is+deemed+uninsurable.++Fearing+that+with+no+insurance+for+Homer+they+will+go+broke%2C+Marge+starts+cost-cutting+measures.++Homer+is+against+these+new+measures+and+takes+the+nest+egg+that+Marge+has+made+and+spends+it+on+the+down+payment+for+a+new+motor+home.++Marge+tells+him+to+enjoy+being+the+king+of+his+new+castle%2C+because+she+is+no+longer+speaking+to+him.++Homer+is+now+living+in+the+RV+in+the+backyard+and+he+and+Marge+try+to+entice+Bart+and+Lisa+to+come+and+stay+with+them.++Homer+then+opens+up+the+backyard+as+a+RV+park%2C+until+Marge+puts+an+end+to+it+and+they+get+into+a+big+fight%2C+which+makes+Bart+and+Lisa+take+action.++Bart+decides+they+need+to+take+the+RV+back+to+the+dealer.++Homer+and+Marge+try+to+stop+the+pair+who+has+managed+to+get+the+RV+onto+the+freeway.++The+RV+crashes+onto+a+Turkish+container+ship%2C+which+is+leaving+port.++With+the+right+enticement%2C+mushroom+soup%2C+Marge+gets+the+ship+to+turn+around%2C+saving+the+children+and+what+is+left+of+the+RV.++The+RVs+fate+is+determined+when+Homer+try+to+put+it+on+the+dock.%0A","7.3","22");
INSERT INTO `series_episodes` VALUES("55801","0","0","0","The+Seven-Beer+Snitch","14","16","1112479200","71663","The+family+visits+Shelbyville+and+are+appalled+at+the+perception+those+citizens+have+of+the+inhabitants+of+Springfield.++Back+in+town%2C+Marge+brings+it+to+the+attention+of+the+Springfield+Cultural+Advisory+Board+and+then+asks+architect+Frank+Gehry+to+design+and+build+a+new+Springfield+cultural+center.++He+sees+inspiration+in+her+request+and+submits+a+design+that+is+approved+by+the+town.++%2430+million+dollars+later%2C+the+project+is+built+and+it+opens+and+closes+quickly+as+nobody+in+town+really+cares+for+classical+music.++Mr.+Burns+agree+to+take+over+the+space%2C+with+his+plan+to+turn+it+into+a+state+prison.++Homer+applies+for+a+job+as+a+guard%2C+but+fails+the+drug+test+after+Otto+switches+their+samples.++Meanwhile%2C+Bart+and+Lisa+follow+Snowball+II%2C+when+they+believe+the+reason+she+is+so+fat+is+that+she+is+getting+food+from+elsewhere%3B+after+following+her+they+discover+she+has+another+family.++Burns+needs+convicts+for+his+prison+and+Chief+Wiggum+blows+the+dust+of+some+old+forgotten+laws.++Homer+is+arrested+for+illegally+transporting+litter+%28kicking+a+can+5+times+in+a+row%29.++In+prison+Homer+inadvertently+squeals+on+Snake%27s+escape+attempt+and+is+drafted+to+becoming+a+snitch+and+he+begins+enjoy+the+perks+that+go+along+with+it.++Snowball+II+%28%22Smoky%22%29+enjoys+life+with+her+new+family+and+Bart+gets+into+the+home+to+find+out%3B+there+is+plenty+of+good+eating+to+be+found+there.++Fat+Tony+and+his+boys+try+to+find+out+who+the+snitch+is.++They+feed+Homer+information+regarding+a+breakout.++While+all+the+guards+are+outside+waiting+for+the+breakout%2C+the+prisoners+are+taking+care+of+their+snitch+and+a+riot+ensues.++The+riot+is+stopped+and+Homer+snitches+on+the+conditions+of+the+prison.%0A","7.1","23");
INSERT INTO `series_episodes` VALUES("55802","0","0","0","Future-Drama","15","16","1113688800","71663","Bart+and+Lisa+find+themselves+in+Prof.+Frink%27s+basement+and+he+uses+the+science+of+astrology+on+his+new+computer+to+show+them+their+future%2C+eight+years+from+next+Tuesday.++In+this+future%2C+Maggie+is+away+on+a+trip+to+Alaska%3B+Homer+and+Marge+have+separated+and+Bart+and+Lisa+are+getting+ready+for+prom.++Lisa%27s+date+is+Milhouse%2C+who+and+Bart+is+dating+a+skateboard+chick+named+Jenda.++Lisa+is+graduating+2+years+early+and+is+going+to+Yale+%28now+owned+by+McDonalds%29+on+a+scholarship+funded+by+Mr.+Burns+as+punishment+for+stealing+Christmas.++Bart+is+also+graduating+and+is+ready+to+move+to+the+next+level+of+his+relationship+with+Jenda%2C+he+wants+to+marry+her+but+his+vision+of+their+future+together+makes+her+break+it+off.++Working+his+part-time+job+at+the+Kwik-E-Mart%2C+Bart+winds+up+saving+Mr.+Burns+life+while+delivering+groceries.++As+a+reward+Mr.+Burns+gives+him+the+scholarship+that+Lisa+was+to+receive.++Bart+is+back+with+Jenda%2C+now+that+he+has+a+future%2C+but+Bart+finds+his+way+back+in+Prof.+Frink%27s+old+basement+and+sees+Lisa%27s+bleak+future+with+Milhouse.++He+does+the+right+thing+and+keeps+her+from+destroying+her+life.%0A","7.2","24");
INSERT INTO `series_episodes` VALUES("55803","0","0","0","Don%27t+Fear+the+Roofer","16","16","1114898400","71663","Springfield+is+experiencing+an+unusually+strong+thunderstorm%2C+and+the+rain+is+causing+roofs+to+leak+all+over+town.++Homer+devises+a+unique+solution+for+getting+the+rain+water+out+of+their+house+that+ultimately+fails+and+sends+him+dejected+off+to+Moe%27s%2C+where+he+ruins+Lenny%27s+surprise+party.++Homer+goes+off+wandering+and+finds+himself+at+a+bar+called+Knockers%2C+where+he+makes+a+new+friend+named+Ray%2C+who+is+a+licensed+and+bonded+roofer.++Marge+takes+the+kids+on+some+errands+while+Homer+and+Ray+almost+begin+the+roof+repairs%3B+they+screw+around+and+never+get+around+to+doing+any+work+until+he+gets+called+away.++Marge+wants+Homer+to+fix+the+roof+by+himself.++Homer+runs+into+Ray+at+the+Builder%27s+Barn+and+Ray+promises+to+stop+by+later+and+help+him+with+the+roof.++Homer+waits+for+him%2C+but+Marge+is+skeptical+that+Ray+even+exists+when+Ray+never+shows+up.++Marge+has+Homer+placed+in+the+mental+ward+of+the+hospital+and+she+and+no+one+else+can+confirm+that+Ray+really+exists.++Dr.+Hibbert+recommends+and+gives+Homer+electro-shock+therapy.++Six+weeks+later+Homer%27s+treatments+are+over+and+to+everyone%27s+surprise+Ray+turns+up+at+the+hospital+to+celebrate+Homer%27s+release.++Plausible+explanations%2C+even+one+by+Stephen+Hawking%2C+are+given+to+explain+why+no+one+had+ever+seen+Ray+before.%0A","7.5","22");
INSERT INTO `series_episodes` VALUES("55804","0","0","0","The+Heartbroke+Kid","17","16","1114898400","71663","At+Springfield+Elementary+the+new+vending+machine+contract+is+awarded+to+a+company+that+promises+to+give+half+the+profits+to+the+school+and+it+is+of+little+consequence+whether+the+snacks+are+healthy+for+the+children+or+not.++Bart+begins+taking+all+of+his+meals+from+the+vending+machine+and+three+weeks+later+has+gained+a+lot+of+weight%2C+so+much+so+that+he+has+heart+attack+symptoms+as+a+result.++The+X-Ray+shows+that+malted+milk+balls+have+blocked+his+arteries.++Despite+it+all+Bart+continues+to+eat+junk+food.++Marge+has+no+choice+and+holds+an+intervention%2C+which+Bart+escapes+from%2C+right+into+the+hands+of+representatives+of+a+maximum+security+fat+camp+who+take+him+away.++Bart+finds+himself+Serenity+Ranch+with+Kent+Brockman%2C+Apu+and+Rainer+Wolfcastle.++The+first+bill+from+the+ranch+arrives+and+Marge+decides+they+need+to+find+a+way+to+pay+for+it.++They+open+their+house+up+as+youth+hostel+to+German+tourists.++Having+a+hard+time+getting+through+to+Bart%2C+Tab+Spangler+takes+him+home+and+shows+the+horrors+his+family+is+enduring+on+his+behalf.++Bart+finally+gets+the+message+and+rages+against+the+vending+machines+and+is+cured+of+his+junk+food+addiction%2C+there+are+three+non-refundable+weeks+of+fat+camp+available+for+a+family+member+to+use.+Homer%2C+the+obvious+choice%2C+is+elected+to+go.%0A","7.5","21");
INSERT INTO `series_episodes` VALUES("55805","0","0","0","A+Star+Is+Torn","18","16","1115503200","71663","The+family+tries+to+eat+a+total+vegetarian+meal+and+everyone+except+Lisa+gets+sick+from+eating+the+healthy+meal.++As+they+moan+from+the+sickness+Lisa+sings+them+to+sleep.++The+next+morning+they%27ve+recovered+enough+to+go+back+to+their+old+dietary+habits.++On+television+a+commercial+airs+for+a+Krusty-sponsored+%22Li%27l+Starmaker%22+competition+and+Lisa%27s+singing+voice+seems+a+natural+for+the+competition.++Of+course%2C+Lisa+and+every+other+child+in+Springfield+signs+up.++When+Clarissa%2C+one+of+the+competitors+sings+the+same+song+that+Lisa+was+going+to+sing%2C+and+does+it+much+better+than+Lisa+believes+she+will+be+able+to%2C+Homer+reassures+her+that+he+will+write+her+a+can%27t+lose+song.++Lisa+sings+the+song+and+makes+it+into+the+final+competition.++Homer+takes+charge+of+her+career+and+writes+her+more+songs+that+take+her+into+the+finals+of+the+competition%3B+it%27s+Lisa+versus+Cameron%2C+a+boy+all+the+girls+go+crazy+over.++When+Homer+oversteps+his+bounds+with+his+obnoxiousness%2C+Lisa+fires+him.++Homer+retaliates+by+getting+himself+a+new+client%2C+Cameron.++The+final+competition+begins+and+Lisa%27s+sings+a+song+she+wrote+on+her+own%2C+a+song+about+her+relationship+with+her+father.++Homer+tells+her+that+he+was+always+in+her+corner+and+that+Cameron+is+learning+the+greatest+lesson+he+can+ever+learn+in+the+music+business%2C+don%27t+trust+people+in+the+music+business.%0A","7.1","22");
INSERT INTO `series_episodes` VALUES("55806","0","0","0","Thank+God%2C+It%27s+Doomsday","19","16","1115503200","71663","Bart+and+Lisa+want+to+start+getting+their+hair+cut+at+the+mall.++They+go+to+the+mall+with+Homer+and+while+getting+their+haircut+they+get+into+a+fight%2C+which+results+in+them+each+getting+really+bad+haircuts.++Out+in+the+mall+they+are+spotted+by+fellow+school+students+who+have+cameras+in+hand.++They+find+Homer+and+go+on+the+run%3B+they+sneak+into+the+back+entrance+of+a+movie+theater+and+see+the+film+%22Left+Below%2C%22+which+is+a+movie+about+the+apocalypse.++The+images+in+the+movie+are+disturbing+to+Homer%2C+who+fears+the+worst.++Marge+assures+him+that+there+needs+to+be+some+ominous+signs+before+the+rapture+will+come.++When+Homer+is+out+driving%2C+he+sees+what+he+believes+to+be+the+signs.++Homer+gathers+some+books+on+the+subject+and+he+calculates+that+the+%22rapture+is+nigh%22+at+3%3A15+PM+on+May+18th%2C+seven+days+from+now.++He+starts+to+spread+the+word+and+tells+everyone+on+television+a+passage+from+Revelations+6%3A13+that+says+before+the+rapture+%22the+stars+will+fall+to+Earth.%22++At+the+Springfield+Stadium%2C+there+is+a+celebrity+filled+blimp+accident+that+causes+the+stars+on+board+to+fall+to+the+Earth+and+Homer+gains+instant+credibility.++He+gets+a+bus+full+of+people+to+join+him+at+Springfield+Mesa.++When+the+appointed+time+comes+and+goes%2C+Homer+loses+credibility+and+everyone+return+back+to+their+normal+lives.++Homer+later+realizes+that+he+made+a+mistake+in+his+calculation+and+the+new+time+is+only+30+minutes+away.++When+no+one+in+his+family+will+join+him+Homer+goes+to+the+Mesa+on+his+own.++The+rapture+comes+and+Homer+goes+to+heaven%2C+but+despite+all+that+heaven+has+to+offer%2C+Homer+needs+his+family.++He+gets+an+audience+with+God%2C+but+when+God+won%27t+grant+his+request+to+have+his+family+join+him%3B+Homer+begins+raising+hell+in+heaven.++To+put+a+stop+to+it%2C+God+agrees+to+turn+back+time+and+put+off+the+rapture.%0A","7.3","24");
INSERT INTO `series_episodes` VALUES("55807","0","0","0","Home+Away+from+Homer","20","16","1116108000","71663","Lisa+wins+4+tickets+to+see+a+foreign+film+and+Homer+gets+Flanders+to+baby-sit+Maggie.++Flanders+doesn%27t+take+any+money+for+his+effort%2C+but+he+does+need+to+earn+some+extra+money%3B+Marge+suggests+that+he+rent+out+his+spare+room.++Flanders+rents+the+room+to+two+college+age+women%2C+who+turn+the+room+into+the+set+for+their+live+webcam+at+www.SexySlumberParty.com.++Flanders+is+unaware+of+what+is+going+on+in+is+his+home%2C+and+when+Homer+finds+out+he+makes+sure+that+every+man+in+Springfield+knows+about+it.++When+Marge+finds+out+she+makes+Homer+tell+Ned+and+then+he+finds+out+that+Homer+has+made+him+the+laughingstock+of+Springfield.++Flanders+decides+to+move+to+Humbleton%2C+PA.%2C+where+his+favorite+figurines+are+made.++Homer+mourns+the+loss+of+his+favorite+neighbor+and+tries+to+make+friends+with+the+new+neighbor+that+has+moved+in%2C+Clay+Roberts%2C+but+this+new+neighbor+is+obnoxious.++Meanwhile+in+Humbleton%2C+Ned+seems+in+heaven%2C+only+for+him+to+live+and+work+there%2C+he+must+remove+his+mustache.++Ned+refuses+and+is+making+waves+in+his+new+community.++When+Homer+arrives+on+his+doorstep%2C+pleading+for+him+to+come+back+to+Springfield%2C+Flanders+decides+to+return.%0A","7.4","24");
INSERT INTO `series_episodes` VALUES("55808","0","0","0","The+Father%2C+the+Son+%26+the+Holy+Guest+Star","21","16","1116108000","71663","Bart+is+given+the+role+of+a+cooper+in+the+school%27s+medieval+festival%2C+while+Lisa+is+the+queen.++Bart+is+blamed+and+expelled+when+rats+come+out+of+large+pie+that+is+presented+to+the+queen.++Marge+looks+for+a+new+school+for+Bart+and+decides+to+try+out+a+Catholic+school.++In+his+first+day+at+school+Bart+encounters+a+tough+nun+and+Father+Sean.++Bart+takes+a+liking+to+Father+Sean+and+begins+to+embrace+the+Catholic+faith%2C+which+concerns+Homer+and+Marge.++Homer+goes+to+the+school+with+the+purpose+of+taking+Bart+out+of+school%2C+only+to+himself+being+converted+before+the+night+is+through.++With+her+husband+and+son+gone+Marge+finds+herself+alone+at+church.++Reverend+Lovejoy+tells+her+that+when+they+die+she+and+Homer+will+be+going+to+different+heavens.++Marge%2C+Ned+and+Reverend+Lovejoy+go+to+Homer+and+Bart%27s+first+communion+class+to+at+the+very+least+liberate+Bart+from+becoming+Catholic.++To+bring+Bart+back+to+his+old+religion+they+take+him+to+a+religious+festival.++Father+Sean+and+Homer+arrive+hoping+to+take+Bart+back%2C+but+Bart+in+one+his+rare+moments+of+insight+brings+both+sides+together%2C+that+is+until+1%2C000+years+later.%0A","7.4","23");
INSERT INTO `series_episodes` VALUES("302862","0","0","0","The+Bonfire+of+the+Manatees","1","17","1126389600","71663","Homer+gets+into+trouble+with+football+gambling+debts.+As+compensation%2C+Fat+Tony+wants+to+use+the+Simpson+home+for+shooting+the+adult+film+%E2%80%9CLemony+Lickit%3A+A+Series+of+Horny+Events.%E2%80%9D+Homer+gets+Marge+and+the+kids+to+leave+the+house+by+sending+them+off+to+%E2%80%9CSanta%E2%80%99s+Village.%E2%80%9D+Marge+and+the+kids+return+home+to+find+the+production+is+still+underway.+Marge%2C+outraged+by+Homer%E2%80%99s+latest+bit+of+idiocy%2C+leaves.+Homer%2C+home+alone+with+the+kids+tries+to+figure+out+what+to+do+next.+Just+when+Marge+is+about+ready+to+reconcile+with+Homer%2C+she+encounters+Caleb+Thorn%2C+a+good+looking+scientist+with+a+passion+for+saving+the+endangered+manatee.+Homer+and+the+kids+go+on+a+quest+to+find+Marge+and+they+stop+and+stay+with+some+%E2%80%9Ccountry+cousins%2C%E2%80%9D+meanwhile+Marge+is+finding+herself+while+helping+to+save+manatees.+Homer+tries+to+win+Marge+back+by+save+a+herd+of+manatees+from+a+gang+of+jet+skiers.+His+effort+pays+off+as+Marge+takes+home+the+endangered+species+of+her+own%2C+the+endangered+devoted+husband.+The+family+decides+to+take+a+mini-vacation+and+Homer+gets+a+manatee+sent+to+the+power+plant+to+fill+in+for+his+job+for+the+next+few+days.","7.1","31");
INSERT INTO `series_episodes` VALUES("302863","0","0","0","The+Girl+Who+Slept+Too+Little","2","17","1126994400","71663","The+noise+of+early+morning+construction+next+door+is+keeping+the+family+awake%3B+there+is+a+new+stamp+museum+under+construction.+The+family+successfully+leads+a+protest+that+gets+the+stamp+museum+moved+to+the+site+of+the+old+graveyard%3B+the+old+graveyard+in+turn+is+relocated+next+to+the+Simpson+home.+The+site+of+the+graveyard+outside+her+window+makes+Lisa+uncomfortable+and+scared+late+one+night+she+runs+to+her+parent%E2%80%99s+bed+for+comfort.+They+try+to+get+her+back+into+her+own+bed%2C+by+showing+her+that+they+can+sleep+in+her+bed.+When+that+doesn%E2%80%99t+work%2C+they+resort+to+the+help+of+a+psychiatrist+and+she+offers+them+some+costly+advice.++Meanwhile+Lisa%2C+who+has+always+had+to+fend+for+her+self%2C+decides+to+spend+the+night+in+the+cemetery+and+conquer+her+fears.+Lisa+gets+knocked+unconscious+and+has+a+hallucination+helps+her+to+deal+with+fear.","7.2","32");
INSERT INTO `series_episodes` VALUES("302864","0","0","0","Milhouse+of+Sand+and+Fog","3","17","1127599200","71663","When+Maggie+is+showing+signs+of+being+ill%2C+the+family+goes+to+%E2%80%9Cthe+more+boisterous+house+of+worship%E2%80%9D+in+town+to+find+Dr.+Hibbert%2C+who+tells+them+that+Maggie+is+developing+the+chicken+pox.++After+Maggie+develops+the+disease%2C+Marge+tries+to+keep+Homer+away+from+her%2C+since+he+has+never+had+them.++After+Flanders+expresses+an+interest+in+getting+his+kids+infected%2C+Homer+and+Marge+open+up+the+house+for+a+%E2%80%9Cpox+party.%E2%80%9D++Milhouse%E2%80%99s+divorced+parents+are+both+at+the+party+and+after+some+%E2%80%9CMargerita%E2%80%99s%E2%80%9D+are+consumed%2C+find+themselves+getting+back+together.++Meanwhile%2C+Homer+has+developed+the+chicken+pox+and+Marge+tries+to+keep+him+from+scratching.++Milhouse+likes+the+idea+of+his+parents+getting+back+together%2C+but+then+begins+to+hate+it+when+he+has+trouble+getting+either+of+them+to+pay+any+attention+to+him.++After+seeing+an+episode+of+The+O.C.+Milhouse+and+Bart+come+up+with+a+plan+to+get+his+parent%E2%80%99s+separated+again%2C+they+plant+one+of+Marge%E2%80%99s+bras+in+Kirk+%26+Luann%E2%80%99s+bed.++They+don%E2%80%99t+succeed+in+breaking+them+up%3B+rather+they+break+up+Homer+and+Marge.++Even+after+Bart+confesses+his+guilt%2C+Marge+doesn%E2%80%99t+want+anything+to+do+with+Homer%2C+since+he+obviously+doesn%E2%80%99t+trust+him+anymore.++Bart+concocts+an+outrageous+scheme+to+get+them+back+together%2C+but+it+goes+terribly+wrong+and+both+he+and+Homer+find+themselves+in+the+river+heading+toward+the+falls+needing+to+place+their+trust+in+Marge.%0A","7.2","33");
INSERT INTO `series_episodes` VALUES("302865","0","0","0","Treehouse+of+Horror+XVI","4","17","1131231600","71663","It+is+game+six+of+the+World+Series+and+Kang+and+Kodos+decide+to+speed+up+the+play+of+the+game+and+they+fire+the+acceleray.++They+shatter+the+fabric+of+the+universe+and+everything+is+destroyed.%0A%0Aa%29.+%22B.I.%3A+Bartificial+Intelligence%22%0A%0ABart+falls+into+a+deep+coma+from+which+he+will+never+emerge.++Well+Bart+does+wakes+from+his+coma+only+to+find+that+his+family+has+replaced+him+with+David%2C+a+newly+developed+artificial+robot+son.++Bart+struggles+to+fit+back+in+with+his+family+and+Homer+and+Marge+decide+they+must+get+rid+of+one+of+their+sons.++They+abandoned+Bart%2C+but+harvesting+parts+from+some+abandoned+robots+he+gets+his+revenge.++The+robot+nightmare+only+turns+out+to+be+a+dream+when+it+is+revealed+that+Homer+has+actually+been+possessed+by+the+devil.%0A%0Ab%29.+%22Survival+of+the+Fattest%22%0A%0AHomer+and+others+are+invited+by+Mr.+Burns+to+his+estate+for+%E2%80%9CA+Most+Dangerous+Game.%E2%80%9D++It+turns+out+that+they+are+participants+on+%E2%80%9CThe+World+Series+of+Manslaughter%E2%80%9D+featuring+guest+analyst+Terry+Bradshaw+where+they+are+the+quarry+and+Mr.+Burns+is+their+hunter.++Surprisingly+Homer+is+the+last+contestant+left+standing%2C+but+it+takes+Marge%E2%80%99s+intervention+to+even+the+score.%0A%0Ac%29.+%22I%E2%80%99ve+Grown+a+Costume+on+Your+Face%22%0A%0AIt%E2%80%99s+the+Springfield+Semi-Annual+Halloween+Party+but+the+costume+contest+goes+awry+when+a+real+hideous+witch+turns+everyone+into+real-life+versions+of+their+costumes.++Lisa%2C+as+Einstein%2C+searches+for+a+solution+to+their+problem%3B+but+it+is+up+to+Maggie%2C+who+was+dressed+as+a+witch%2C+as+the+only+one+with+the+power+to+reverse+the+spell.%0A","7.2","38");
INSERT INTO `series_episodes` VALUES("302866","0","0","0","Marge%27s+Son+Poisoning","5","17","1131836400","71663","The+family+is+at+Paradise+Pier%2C+where+Marge+was+looking+forward+to+riding+the+Ferris+wheel+all+her+life%2C+only+to+find+out+that+it+is+being+dismantled+with+some+of+its+equipment+being+sold.++Homer+purchases+a+dumbbell+while+Marge+gets+a+tandem+bicycle.++When+Marge+wants+to+take+the+bike+for+a+ride%2C+she+finds+that+Homer+is+a+less+than+willing+participant.%0A%0AShe+tries+it+on+her+own+and+falls.++Realizing+that+his+mother+might+actually+be+lonely%2C+Bart+offers+to+go+for+a+ride+with+her.++They+ride+into+an+unincorporated+part+of+the+county+and+come+upon+a+small+village+that+features+a+tea+house.++Later+the+tea+house+closes+forever+causing+Bart+to+invite+his+mother+to+his+treehouse+for+tea.%0A%0AMarge+redecorates+the+treehouse+and+the+pair+goes+off+to+get+a+new+tea+service+where+he+gets+a+Krusty+Teapot.++Outside+the+store+the+bullies+accuse+Bart+of+being+a+%E2%80%9CMomma%E2%80%99s+Boy%2C%E2%80%9D+which+causes+Bart+to+rebel.++Marge+goes+into+a+depression+and+eventually+sells+the+bike.%0A%0AFeeling+bad%2C+Bart+offers+to+compete+with+her+in+a+karaoke+contest.++While+seeing+Skinner+and+his+mother+perform%2C+Marge+has+visions+of+a+terrible+future+for+Bart+and+she+stops+the+show+to+let+Bart+know+that+he+shouldn%E2%80%99t+worry+about+her%2C+it%E2%80%99s+her+job+to+worry+about+him.%0A%0AMeanwhile+at+Moe%E2%80%99s+Homer+shows+off+the+strength+in+one+of+his+arms+he%E2%80%99s+gained+from+working+with+the+dumbbell+and+Moe+has+an+idea+on+how+to+capitalize+on+it.++Moe+takes+Homer+to+the+arm+wrestling+championships%2C+where+Homer+readily+wins%2C+but+finds+that+he+really+misses+his+wife.%0A","7.1","35");
INSERT INTO `series_episodes` VALUES("302867","0","0","0","See+Homer+Run","6","17","1132441200","71663","Homer+is+ready+for+everyone+to+shower+him+with+gifts+on+Father%E2%80%99s+Day+and+Marge+and+the+kids+go+to+the+mall+to+obtain+the+presents.++Lisa+decides+she+is+going+to+make+something+for+her+father%2C+while+Bart+purchases+the+Leather+Buddy+multi-function+knife.++Lisa%E2%80%99s+heartfelt+gift+doesn%E2%80%99t+go+over+as+well+as+Bart%E2%80%99s+knife+and+Homer+doesn%E2%80%99t+immediately+do+anything+to+make+Lisa+feel+any+better.++Bart+sees+a+street+sign+with+his+name+on+it+and+the+bullies+entice+him+into+stealing+it.++Homer+makes+a+lame+attempt+at+making+up+to+Lisa.++At+school+Lisa+goes+on+a+rampage.++Citing+her+father+as+the+cause%2C+Principal+Skinner+and+the+school+psychologist+talk+with+Homer+and+Marge+about+what+they+can+do+to+prevent+Lisa+from+growing+up+to+hate+men.++Homer+becomes+the+school+safety+salamander.++His+initial+pathetic+attempts+at+safety+don%E2%80%99t+change+her+feelings+for+her+father%2C+until+an+accident+at+the+intersection+of+Evergreen+Terrace+and+the+unsigned+Bart+Blvd.++The+safety+salamander+rescues+all+the+victims+of+the+accident+and+Homer+is+awarded+the+keycard+to+the+city.++Then+the+mayor+comes+under+fire+for+the+many+disasters+under+his+administration+and+it+is+decided+that+a+recall+election+is+going+to+be+held.++With+a+number+of+ridiculous+candidates+running%2C+Lisa+decides+that+her+father%2C+with+his+popularity+as+the+safety+salamander%2C+would+be+the+ideal+choice.++With+Lisa+as+his+campaign+manager%2C+everything+is+going+well%2C+until+Marge+washes+his+salamander+suit.++When+it+shrinks+and+tears+apart+is+reveals+the+man+underneath%2C+whom+nobody+is+interested+in+voting+for%2C+but+at+least+Homer+and+Lisa+strengthen+their+relationship.++Finally+when+none+of+the+candidates+garner+enough+votes+to+take+over+as+mayor%2C+it%E2%80%99s+business+as+usual+in+Springfield+government.%0A","7.2","24");
