INSERT INTO `series_episodes` VALUES("302869","0","0","0","The+Italian+Bob","8","17","1134255600","71663","After+being+humiliated+by+Mrs.+Krabappel%27s+class%2C+Mr.+Burns+finally+decides+to+buy+a+new+car%2C+so+he+orders+a+Lamborgotti+Fasterossa.++He+sends+Homer+and+his+family+to+the+factory+in+Italy+to+pick+the+car+up.++The+family+takes+a+tour+of+Italy+in+the+new+car%2C+but+an+accident+with+the+car+and+a+cheese+truck+has+the+family+pushing+the+car+into+the+town+of+Salsiccia.++They+find+out+that+only+one+person+in+the+town+speaks+English+and+it+happens+to+be+their+mayor.++The+family+goes+to+meet+the+mayor+and+they+are+surprised+to+see+that+it+is+Sideshow+Bob%2C+and+he+is+equally+surprised+to+see+them.++Sideshow+Bob+tells+them+how+he+came+to+Italy%2C+become+mayor+and+started+a+family+with+his+wife+%28Francesca%29+and+son+%28Gino%29.++He+hopes+that+the+Simpsons+will+keep+the+secret+of+his+criminal+past%2C+but+Lisa%E2%80%99s+first+exposure+to+drinking+wine+leads+to+loose+lips%2C+which+sinks+his+ship.++Sideshow+Bob%2C+being+no+longer+welcome+in+his+new+home%2C+swears+a+vendetta+on+the+Simpson+family.++The+Simpsons+go+on+the+run+from+Sideshow+Bob%2C+who+is+joined+by+his+wife+and+son+as+the+vendetta+affects+their+entire+family.++In+Rome%2C+the+family+discovers+that+Krusty+is+preparing+to+perform+the+lead+in+%E2%80%9CI+Pagliacci.%E2%80%9D++The+Simpsons+hide+as+extras+within+the+show%2C+but+Krusty+gets+tossed+off-stage+only+to+be+replaced+by+Sideshow+Bob%2C+whose+family+has+the+Simpsons+surrounded.++Krusty+and+his+limo+save+the+day%2C+while+Sideshow+Bob+and+his+family+adjust+to+their+unresolved+vendetta.%0A","7.2","23");
INSERT INTO `series_episodes` VALUES("302870","0","0","0","Simpsons+Christmas+Stories","9","17","1134860400","71663","When+Reverend+Lovejoy+and+Ned+Flanders+are+unable+to+deliver+the+Christmas+sermon%2C+Homer+steps+in+and+tells+the+story+of+the+birth+of+the+baby+Jesus+%28Bart%29%2C+King+Harod%E2%80%99s+%28Mr.+Burns%E2%80%99%29+attempt+to+have+the+baby+killed+and+the+creation+of+the+first+Christmas+tree.%0A%0AGrandpa+relates+to+Bart+and+Lisa+the+story+of+how+in+the+Navy+he+and+his+older+brother+Cyrus+were+fighting+in+the+Pacific+in+World+War+II.++During+a+battle+Cyrus%E2%80%99s+plane+is+lost+and+Abe+and+Mr.+Burns+%28his+co-pilot%29+crash+land+their+own+plane.++At+Christmastime+while+awaiting+rescue%2C+Burns%2C+anxious+to+shoot+at+something%2C+shoots+down+Santa+Claus.++Abe+and+Burns+help+Santa+to+rebuild+his+sleigh+%28only+for+Burns+to+later+steal.%29++After+Abe+gets+it+back%2C+Santa+promises+to+come+back+for+a+follow-up+rescue%2C+but+never+does.++After+Abe+has+finished+relating+the+story+to+the+kids%2C+Santa+makes+his+overdue+appearance+and+takes+Abe+to+Tahiti+to+be+reunited+with+his+brother.%0A%0AThe+kids+at+Springfield+Elementary+perform+%E2%80%9CPerhaps+the+worst+version+ever%E2%80%9D+rendition+of+%E2%80%9CThe+Nutcracker%E2%80%9D+ballet+according+to+Superintendent+Chalmers.++When+it+is+revealed+that+you+don%E2%80%99t+have+to+pay+for+the+music+rights+it+leads+to+a+montage+of+citizens+of+Springfield+going+about+their+usual+Christmas+activities+to+the+more+familiar+pieces+of+music+from+%E2%80%9CThe+Nutcracker%2C%E2%80%9D+including+a+sequence+where+Moe+tries+to+kill+himself%2C+and+Homer+%28forgetting+as+usual%29+tries+to+get+Marge+her+present+at+the+last+minute.%0A","7.2","29");
INSERT INTO `series_episodes` VALUES("302871","0","0","0","Homer%27s+Paternity+Coot","10","17","1136674800","71663","The+result+of+Marge%27s+anger+against+Quimby%E2%80%99s+new+toll+road+leads+to+the+discovery+of+a+frozen+mailman+and+his+40-year-old+mail.+The+old+mail+is+delivered+to+the+recipients%2C+including+one+to+Grampa+Simpson%27s+deceased+wife%2C+and+it+reveals+a+secret+love+affair+and+who+the+real+father+of+her+baby+Homer+might+be.++Confused+and+emotional%2C+Homer+finds+Mason+Fairbanks%2C+his+wealthy+and+much+improved+paternal+dad%2C+and+happily+establishes+a+father-son+relationship+with+him+while+rejecting+Abe%2C+his+surrogate+father+of+40+years%2C+especially+after+a+DNA+test+reveals+that+Mason+is+indeed+his+real+father.++Homer+joins+Mason+on+an+undersea+treasure+hunt+and+when+Homer%E2%80%99s+life+is+in+mortal+danger+he+reflects+upon+his+childhood+and+realizes+who+his+true+father+is.++When+he+confesses+that+to+Abe%2C+Abe+has+a+confession+of+his+own.%0A","6.8","31");
INSERT INTO `series_episodes` VALUES("302872","0","0","0","We%27re+on+the+Road+to+D%27ohwhere","11","17","1138489200","71663","Bart+obtains+the+key+to+the+steam+tunnels+under+the+school+and+with+Milhouse+they+go+down+to+check+them+out.+When+Bart+turns+just+one+of+the+little+valves+they+find+in+the+valve+room+the+chain+reaction+causes+chaos+throughout+the+school.+Bart+is+caught+and+Skinner+wants+to+send+him+to+a+discipline+camp+in+Oregon.+When+Bart+can%E2%80%99t+fly+there+alone%2C+Homer+has+to+drive+him+there+himself+and+that+is+going+to+cause+him+to+miss+the+trip+to+Las+Vegas+that+Moe+is+sponsoring+for+all+his+regular+customers.+While+the+boys+are+gone%2C+Marge+and+Lisa+take+some+of+the+boys%27+old+stuff+and+hold+a+yard+sale%2C+but+the+only+things+that+sell+well+are+their+old+medications+and+that+gets+her+into+bit+of+trouble.%0A","7.1","28");
