INSERT INTO `series_episodes` VALUES("307096","0","0","0","Girls+Just+Want+to+Have+Sums","19","17","1146348000","71663","The+family+attends+%22Stab-A-Lot%3A+The+Itchy+and+Scratchy+Musical.%22++The+musical%27s+director+is+a+graduate+of+Springfield+Elementary+and+Principal+Skinner+puts+his+foot+in+mouth+when+he+makes+sexist+comments+about+her+education+and+that+of+women+in+general.++He+tries+to+make+the+situation+better%2C+but+only+buries+himself+deeper+and+deeper+until+he+is+fired+and+replaced+by+Women%27s+Educational+Expert+Melanie+Upfoot.++The+first+thing+she+does+is+split+the+school+into+girls+and+the+boys.++Lisa+dislikes+the+way+girls+are+being+taught+math+and+she+ventures+over+to+the+boy%27s+side+of+the+school+in+search+of+a+challenge.++Disguising+herself+as+Jake+Boyman+she+starts+attending+the+boy%27s+school+but+while+she+finds+the+math+problems+more+interesting%2C+it+is+being+a+boy+that+is+a+greater+challenge.%0A","7.1","29");
