INSERT INTO `series_episodes` VALUES("2347531","0","0","0","Is+There+a+Creator%3F","1","1","1276034400","168571","It%27s+perhaps+the+biggest%2C+most+controversial+mystery+in+the+cosmos.+Did+our+Universe+just+come+into+being+by+random+chance%2C+or+was+it+created+by+a+God+who+nurtures+and+sustains+all+life%3F+The+latest+science+is+showing+that+the+four+forces+governing+our+universe+are+phenomenally+finely+tuned.+So+finely+that+it+had+led+many+to+the+conclusion+that+someone%2C+or+something%2C+must+have+calibrated+them%3B+a+belief+further+backed+up+by+evidence+that+everything+in+our+universe+may+emanate+from+one+extraordinarily+elegant+and+beautiful+design+known+as+the+E8+Lie+Group.+While+skeptics+hold+that+these+findings+are+neither+conclusive+nor+evidence+of+a+divine+creator%2C+some+cutting+edge+physicists+are+already+positing+who+this+God+is%3A+an+alien+gamester+who%27s+created+our+world+as+the+ultimate+SIM+game+for+his+own+amusement.+It%27s+an+answer+as+compelling+as+it+is+disconcerting.","7.5","34");
INSERT INTO `series_episodes` VALUES("2369351","0","0","0","The+Riddle+of+Black+Holes","2","1","1276639200","168571","They+are+the+most+powerful+objects+in+the+universe.+Nothing%2C+not+even+light%2C+can+escape+the+gravitational+pull+of+a+black+hole.+Astronomers+now+believe+there+are+billions+of+them+out+in+the+cosmos%2C+swallowing+up+planets%2C+even+entire+stars+in+violent+feeding+frenzies.+New+theoretical+research+into+the+twisted+reality+of+black+holes+suggests+that+three-dimensional+space+could+be+an+illusion.+That+reality+actually+takes+place+on+a+two-dimensional+hologram+at+the+edge+of+the+universe.","7.8","37");
INSERT INTO `series_episodes` VALUES("2396201","0","0","0","Is+Time+Travel+Possible%3F","3","1","1277244000","168571","Einstein%27s+Theory+of+Relativity+says+that+time+travel+is+perfectly+possible+%E2%80%94+if+you%27re+going+forward.+Finding+a+way+to+travel+backwards+requires+breaking+the+speed+of+light%2C+which+so+far+seems+impossible.+But+now%2C+strange-but-true+phenomena+such+as+quantum+nonlocality%2C+where+particles+instantly+teleport+across+vast+distances%2C+may+give+us+a+way+to+make+the+dream+of+traveling+back+and+forth+through+time+a+reality.+Step+into+a+time+machine+and+rewrite+history%2C+bring+loved+ones+back+to+life%2C+control+our+destinies.+But+if+we+succeed%2C+what+are+the+consequences+of+such+freedom%3F+Will+we+get+trapped+in+a+plethora+of+paradoxes+and+multiple+universes+that+will+destroy+the+fabric+of+the+universe%3F","7.7","27");
INSERT INTO `series_episodes` VALUES("2396211","0","0","0","What+Happened+Before+the+Beginning%3F+","4","1","1277848800","168571","Every+cosmologist+and+astronomer+agrees%3A+our+Universe+is+13.7+billion+years+old.+Using+cutting-edge+technology%2C+scientists+are+now+able+to+take+a+snapshot+of+the+Universe+a+mere+heartbeat+after+its+birth.+Armed+with+hypersensitive+satellites%2C+astronomers+look+back+in+time+to+the+very+moment+of+creation%2C+when+all+the+matter+in+the+Universe+exploded+into+existence.+It+is+here+that+we+uncover+an+unsolved+mystery+as+old+as+time+itself+%E2%80%94+if+the+Universe+was+born%2C+where+did+it+come+from%3F+Meet+the+leading+scientists+who+have+now+discovered+what+they+believe+to+be+the+origin+of+our+Universe%2C+and+a+window+into+the+time+before+time.","7.6","27");
INSERT INTO `series_episodes` VALUES("2396221","0","0","0","How+Did+We+Get+Here%3F+","5","1","1278280800","168571","Everywhere+we+look%2C+life+exists+in+both+the+most+hospitable+of+environments+and+in+the+most+extreme.+Yet+we+have+only+ever+found+life+on+our+planet.+How+did+the+stuff+of+stars+come+together+to+create+life+as+we+know+it%3F+What+do+we+really+mean+by+%27life%27%3F+And+will+unlocking+this+mystery+help+us+find+life+elsewhere%3F","7.6","24");
INSERT INTO `series_episodes` VALUES("2396231","0","0","0","Are+We+Alone%3F+","6","1","1279058400","168571","Aliens+almost+certainly+do+exist.+So+why+haven%27t+we+yet+met+E.T.%3F+It+turns+out+we%27re+only+just+developing+instruments+powerful+enough+to+scan+for+them%2C+and+science+sophisticated+enough+to+know+where+to+look.+As+a+result%2C+race+is+on+to+find+the+first+intelligent+aliens.+But+what+would+they+look+like%2C+and+how+would+they+interact+with+us+if+we+met%3F+The+answers+may+come+to+us+sooner+than+we+imagine%2C+for+one+leading+astronomer+believes+she+may+already+have+heard+a+hint+of+their+first+efforts+to+communicate.","7.5","18");
INSERT INTO `series_episodes` VALUES("2396241","0","0","0","What+Are+We+Really+Made+of%3F+","7","1","1279663200","168571","Our+understanding+of+the+universe+and+the+nature+of+reality+itself+has+drastically+changed+over+the+last+100+years%2C+and+it%27s+on+the+verge+of+another+seismic+shift.+In+a+17-mile-long+tunnel+buried+570+feet+beneath+the+Franco-Swiss+border%2C+the+world%27s+largest+and+most+powerful+atom+smasher%2C+the+Large+Hadron+Collider%2C+is+powering+up.+Its+goal+is+nothing+less+than+recreating+the+first+instants+of+creation%2C+when+the+universe+was+unimaginably+hot+and+long-extinct+forms+of+matter+sizzled+and+cooled+into+stars%2C+planets%2C+and+ultimately%2C+us.+These+incredibly+small+and+exotic+particles+hold+the+keys+to+the+greatest+mysteries+of+the+universe.+What+we+find+could+validate+our+long-held+theories+about+how+the+world+works+and+what+we+are+made+of.+Or%2C+all+of+our+notions+about+the+essence+of+what+is+real+will+fall+apart.","7.7","22");
INSERT INTO `series_episodes` VALUES("2396251","0","0","0","Beyond+the+Darkness+","8","1","1280268000","168571","What+is+the+universe+made+of%3F+If+you+answered+stars%2C+planets%2C+gas+and+dust%2C+you%27d+be+dead+wrong.+Thirty+years+ago%2C+scientists+first+realized+that+some+unknown+dark+substance+was+affecting+the+way+galaxies+moved.+Today%2C+they+think+there+must+be+five+times+as+much+dark+matter+as+regular+matter+out+there.+But+they+have+no+idea+what+it+is+%E2%80%94+only+that+it%27s+not+made+of+atoms%2C+or+any+other+matter+we+are+familiar+with.+And+Dark+Matter+is+not+the+only+strange+substance+in+the+Universe+%E2%80%94+a+newly+discovered+force%2C+called+Dark+Energy%2C+seems+to+be+pushing+the+very+fabric+of+the+cosmos+apart.","7.6","19");
INSERT INTO `series_episodes` VALUES("4108722","0","0","0","Is+There+Life+After+Death%3F","1","2","1307484000","168571","In+the+premiere+episode+of+the+second+season%2C+Morgan+Freeman+dives+deep+into+this+provocative+question+that+has+mystified+humans+since+the+beginning+of+time.+Modern+physics+and+neuroscience+are+venturing+into+this+once+hallowed+ground%2C+and+radically+changing+our+ideas+of+life+after+death.+Freeman+serves+as+host+to+this+polarized+debate%2C+where+scientists+and+spiritualist+attempt+to+define+%27what+is+consciousness%2C%27+while+cutting+edge+quantum+mechanics+could+provide+the+answer+to+what+happens+when+we+die.","7.4","15");
INSERT INTO `series_episodes` VALUES("4108723","0","0","0","Is+There+an+Edge+to+the+Universe%3F","2","2","1308088800","168571","It+is+commonly+theorized+that+the+universe+began+with+the+Big+Bang+13.7+billion+years+ago.+But+since+we+can+only+see+as+far+as+light+has+traveled+in+that+time%2C+we+can%27t+actually+make+out+the+edge+of+the+universe.+Could+it+be+that+the+universe+is+infinite%3F+Is+there+any+way+to+find+out+what+the+shape+of+the+universe+really+is%3F+Can+we+find+the+edge%2C+discover+what+might+lie+beyond+it%2C+and+perhaps+even+discover+a+universe+next+to+ours%3F","7.7","19");
INSERT INTO `series_episodes` VALUES("4112392","0","0","0","Does+Time+Really+Exist%3F","3","2","1308693600","168571","It+is+a+question+that+has+vexed+philosophers+and+scientists+for+centuries%3B+%27What+is+Time%3F%27+Exactly+how+is+our+past%2C+present%2C+and+future+connected+by+that+arrow+of+cause+and+effect+that+we+call+Time%3F+Is+time+simply+another+dimension%2C+just+like+the+dimensions+of+space+we+know%3F+Can+you+run+time+backwards+just+as+easily+as+it+runs+forward%2C+just+as+left-to-right+can+swap+for+right-to-left%3F+If+other+universes+exist%2C+then+what+is+time+like+in+them%3A+could+their+Time+be+different+from+ours%3F+And+we%27ll+probe+the+biggest+question+about+time%3A+Is+our+future+determined%3F+Do+we+exercise+free+will%3F+Or%2C+is+time+merely+a+dream%3F","7.6","18");
INSERT INTO `series_episodes` VALUES("4112393","0","0","0","Are+There+More+Than+3+Dimensions%3F","4","2","1309298400","168571","We+move+and+live+in+three+dimensions%3A+length%2C+width%2C+and+height.+However%2C+Einstein+revealed+what+was+once+unimaginable%3A+time+is+actually+a+dimension+and+linked+with+space+itself.+To+reconcile+the+massive+cosmic+and+miniscule+quantum+worlds%2C+physicists+are+realizing+four+dimensions+may+not+be+enough.+They%27re+unraveling+up+to+eleven+dimensions.+How+could+this+be+true%3F+Where+could+these+dimensions+be%3F","7.6","16");
