INSERT INTO `series_episodes` VALUES("4891423","0","0","0","Will+We+Become+God%3F","8","5","1404856800","168571","Humanity%E2%80%99s+potential+seems+limitless.+But+could+we+become+as+powerful+as+God%3F+Scientific+breakthroughs+grant+our+species+seemingly+divine+abilities.+Biologists+tinkering+with+DNA+are+figuring+out+ways+to+grow+new+life+forms%2C+while+neuroscientists+try+to+create+artificial+consciousness.+Statisticians+around+the+world+are+using+big+data+to+predict+the+future+and+computer+scientists+have+discovered+a+%E2%80%9CGod+algorithm%E2%80%9D+that+could+solve+any+global+problem+in+an+instant.+But+to+truly+become+God%2C+we+not+only+have+to+be+all+knowing%2C+but+all+being.+Quantum+physicists+are+figuring+out+how+to+teleport+matter+at+the+speed+of+light%21","7","1");
INSERT INTO `series_episodes` VALUES("4891422","0","0","0","Is+There+A+Shadow+Universe%3F","9","5","1405461600","168571","When+we+look+up+into+the+sky+it+appears+we+live+in+a+universe+that+is+filled+with+light.+But+scientists+are+now+certain+there+is+far+more+matter+in+the+dark+portions+of+our+universe+that+we+can%E2%80%99t+see+or+touch.+There%E2%80%99s+something+hiding+in+the+shadows.+Cosmologists+agree+that+%E2%80%9Cdark+matter%E2%80%9D+has+helped+shape+our+Universe%2C+but+now+they+need+to+figure+out+what+dark+matter+is.+What%E2%80%99s+going+on+in+this+hidden+world%3F+Could+it+have+formed+its+own+dark+stars%2C+planets%2C+and+even+life+forms%3F+Could+this+Shadow+Universe+threaten+our+world+of+light%3F","8","1");
INSERT INTO `series_episodes` VALUES("4817495","0","0","0","When+Did+Time+Begin%3F","10","5","1406066400","168571","We+float+along+the+river+of+time.+But+does+that+river+have+a+source%3F+Where+did+time+come+from%3F+Some+believe+time+and+space+are+one+thing%2C+and+the+Big+Bang+started+the+cosmic+clock.+Others+believe+the+universe+existed+for+almost+half+a+million+%22years%22+before+light+could+move+and+time+began.+Still+others+say+time+is+older+than+our+universe.+But+what+if+time+itself+is+an+illusion%3F+Incredible+new+experiments+may+hold+the+answer.+One+groundbreaking+experiment+gives+us+the+power+to+punch+holes+in+time%E2%80%A6and+another+may+create+a+machine+that+operates+outside+time%E2%80%99s+boundaries%21","0","0");
