INSERT INTO `series_series` VALUES("75760","%7CJosh+Radnor%7CNeil+Patrick+Harris%7CAlyson+Hannigan%7CJason+Segel%7CCobie+Smulders%7CBob+Saget%7CCristin+Milioti%7CDavid+Henrie%7CLyndsy+Fonseca%7C","TV-PG","2005-09-19","|Comedy|Romance|","tt0460649","CBS","The+year+is+2030.+Ted+Mosby+is+relaying+the+story+of+how+he+met+his+wife+to+his+daughter+and+son.+The+story+starts+in+the+year+2005%2C+when+then+twenty-seven+year+old+architect+Ted+was+spurred+on+to+want+to+get+married+after+his+best+friends+from+his+college+days+at+Wesleyan%2C+lawyer+Marshall+Eriksen%2C+who+was+his+roommate+at+the+time+and+kindergarten+teacher+Lily+Aldrin%2C+got+engaged+after+nine+years+of+dating+each+other.+Ted%27s+new+quest+in+life+was+much+to+the+dismay+of+his+womanizing+friend%2C+Barney+Stinson.+But+soon+after+Marshall+and+Lily%27s+engagement%2C+Ted+believed+that+his+life+mate+was+going+to+be+news+reporter+and+aspiring+news+anchor+Robin+Scherbatsky%2C+who%2C+despite+having+had+a+romantic+relationship+with+her+after+this+time%2C+ended+up+being+who+the+kids+know+as+their+%22Aunt%22+Robin.+As+Ted+relays+the+story+to+his+kids%2C+the+constants+are+that+their+Uncle+Marshall%2C+Aunt+Lily%2C+Uncle+Barney+and+Aunt+Robin+are+always+in+the+picture+and+thus+have+something+to+do+with+how+he+got+together+with+their+mother.","9","0","30","How+I+Met+Your+Mother","Ended","graphical/75760-g2.jpg","fanart/original/75760-59.jpg","1435457972","posters/75760-42.jpg","1","1","1","1435597203");
