INSERT INTO `series_series` VALUES("94551","%7CLauren+Graham%7CBonnie+Bedelia%7CCraig+T.+Nelson%7CDax+Shepard%7CMonica+Potter%7CErika+Christensen%7CJoy+Bryant%7CTyree+Brown%7CMae+Whitman%7CSarah+Ramos%7CSavannah+Paige+Rae%7CPeter+Krause%7CSam+Jaeger%7CMiles+Heizer%7CMax+Burkholder%7CXolo+Maridue%C3%B1a%7C","TV-PG","2010-03-02","|Drama|","tt1416765","NBC","From+writer%2Fexecutive+producer+Jason+Katims%2C+this+contemporary+re-imagining+of+the+blockbuster+1989+film+depicts+the+colorful+and+imperfect+Braverman+family+--+four+grown+siblings+sharing+the+headaches%2C+heartaches+and+joy+of+being+parents.%0AWhen+Sarah+Braverman%2C+a+financially+strapped+single+mother%2C+returns+home+to+her+parents+and+siblings+in+Berkeley%2C+California+after+packing+up+her+Fresno+apartment+and+uprooting+her+two+inconvenienced+kids%2C+Amber+and+Drew%2C+she+is+greeted+by+her+opinionated+father%2C+Zeek%2C+and+strong+mother%2C+Camille%2C+who+are+privately+dealing+with+their+own+marital+issues.+As+Sarah+is+reunited+with+her+siblings+--+sister+Julia+and+brothers+Crosby+and+Adam+--+all+struggling+with+issues+of+their+own%2C+it%27s+clear+that+the+Braverman+reunion+is+just+what+they+need+to+face+the+everyday+challenges+of+modern+family+life.","8.2","0","60","Parenthood+%282010%29","Ended","graphical/94551-g4.jpg","fanart/original/94551-10.jpg","1435305414","posters/94551-1.jpg","1","0","2","1435556865");
