INSERT INTO `series_series` VALUES("95461","%7CAlex+O%27Loughlin%7CKatherine+Moennig%7CDaniel+Henney%7CJustina+Machado%7CAlfre+Woodard%7CChristopher+J.+Hanke%7CKatija+Pevec%7C","","2009-10-04","|Drama|","tt1440346","CBS","Three+Rivers+is+a+medical+drama+that+goes+inside+the+emotionally+complex+lives+of+organ+donors%2C+the+recipients+and+the+surgeons+at+the+preeminent+transplant+hospital+in+the+country+where+every+moment+counts.+However%2C+dealing+with+donor+families+in+their+darkest+hour+and+managing+the+fears+and+concerns+of+apprehensive+recipients+takes+much+more+than+just+a+sharp+scalpel.+Leading+the+elite+team+is+Dr.+Andy+Yablonski+%28Alex+O%27Loughlin%29%2C+the+highly-skilled+workaholic+lead+organ+transplant+surgeon%2C+whose+good-natured+personality+and+sarcastic+wit+makes+him+popular+with+his+patients+and+colleagues.+His+colleagues+include+Dr.+Miranda+Foster+%28Katherine+Moennig%29%2C+a+surgical+fellow+with+a+rebellious+streak+and+fiery+temper+who+strives+to+live+up+to+her+deceased+father%27s+excellent+surgical+reputation%3B+Dr.+David+Lee+%28Daniel+Henney%29%2C+a+womanizing+surgical+resident+who%27s+broken+as+many+hearts+as+he%27s+replaced%3B+Ryan+Abbott+%28Christopher+J.+Hanke%29%2C+the+inexperienced+new+transplant+coordinator+who+arranges+the+intricately+choreographed+process+of+quickly+and+carefully+transporting+organs+from+donor+to+patient%3B+Dr.+Sophia+Jordan+%28Julia+Ormond%2C+unaired+pilot%29%2C+the+head+of+surgery+and+a+dedicated+medical+professional%3B+and+Pam+Acosta+%28Justina+Machado%29%2C+Andy%27s+no-nonsense+operating+assistant+and+best+friend.+In+this+high+stakes+arena%2C+in+which+every+case+is+a+race+against+the+clock%2C+these+tenacious+surgeons+and+medical+professionals+are+the+last+hope+for+their+patients.","7","0","60","Three+Rivers","Ended","graphical/95461-g.jpg","fanart/original/95461-2.jpg","1426024256","posters/95461-1.jpg","1","0","2","1435518003");
INSERT INTO `series_series` VALUES("80348","%7CZachary+Levi%7CYvonne+Strahovski%7CAdam+Baldwin%7CBonita+Friedericy%7CJulia+Ling%7CVik+Sahay%7CRyan+McPartlin%7CScott+Krinsky%7CMark+Christopher+Lawrence%7CSarah+Lancaster%7CJoshua+Gomez%7CMekenna+Melvin%7CLinda+Hamilton%7CBrandon+Routh%7CMatthew+Bomer%7C","TV-PG","2007-09-24","|Action|Adventure|Comedy|Drama|","tt0934814","NBC","This+high-concept+action+comedy+follows+Chuck+Bartowski+as+the+Buy+More+computer+geek+turned+secret+agent.+When+Chuck+unwittingly+downloads+a+database+of+government+information+and+deadly+fighting+skills+into+his+head%2C+he+becomes+the+CIA%27s+most+vital+secret.+This+sets+Chuck+on+a+path+to+become+a+full-fledged+spy%2C+assisted+by+the+stoic+Colonel+John+Casey%3B+Chuck%27s+best+friend%2C+Morgan+Grimes%3B+and+the+CIA%27s+top+agent+%28now+Chuck%27s+wife%29+Sarah+Walker.+With+the+help+of+this+unlikely+team+and+his+unorthodox+techniques%2C+Chuck+is+ready+to+take+Operation+Bartowski+freelance.+Chuck%27s+spy+abilities+will+be+put+to+a+new+test+when+he+and+his+team+must+save+mankind+without+the+help+of+the+CIA.+Instead%2C+they%27ll+use+the+cover+of+the+Buy+More+electronics+store+to+fund+their+own+operations%2C+leading+to+new+missions%2C+new+stakes+and+new+obstacles.+With+Chuck+and+Sarah+as+newlyweds+and+his+family+in+on+his+secret%2C+it+has+never+been+harder+for+Chuck+to+separate+his+spy+life+from+his+personal+life.","8.7","0","60","Chuck","Ended","graphical/80348-g26.jpg","fanart/original/80348-48.jpg","1435490923","posters/80348-16.jpg","1","0","1","1435608002");
