INSERT INTO `series_series` VALUES("85427","%7CKatie+Cassidy%7CStephanie+Jacobsen%7CSean+Sippos%7CMichael+Rady%7CAshlee+Simpson-Wentz%7CJessica+Lucas%7CBrooke+Burns%7CHeather+Locklear%7CNicholas+Gonzalez%7C","TV-14","2009-09-08","|Drama|","tt1388782","The CW","In+an+elegant+Spanish-style+apartment+building+in+the+trendy+Melrose+neighborhood+of+Los+Angeles%2C+a+diverse+group+of+20-somethings+have+formed+a+close-knit+surrogate+family.+Sydney+Andrews+%28Laura+Leighton%2C+the+original+%22Melrose+Place%22%29+is+the+landlady%2C+still+beautiful+at+40%2C+and+a+central+figure+in+the+lives+of+all+her+tenants%2C+especially+handsome+and+rebellious+David+Breck+%28Shaun+Sipos%2C+%22Shark%22%29.+Sydney+started+an+affair+with+David+despite+her+turbulent+history+with+his+estranged+father%2C+Dr.+Michael+Mancini+%28Thomas+Calabro%2C+the+original+%22Melrose+Place%22%29.+Both+father+and+son+learned+through+experience+that+Sydney+was+not+above+using+blackmail+to+control+people.+Another+tenant%2C+high-powered+publicist+Ella+Simms+%28Katie+Cassidy%2C+%22Supernatural%22%29%2C+once+considered+Sydney+her+mentor%2C+but+their+friendship+was+destroyed+by+betrayal%2C+and+Sydney+threatened+to+evict+Ella+and+ruin+her+career.+Sydney+also+played+a+pivotal+role+in+the+career+of+Auggie+Kirkpatrick+%28Colin+Egglesfield%2C+%22All+My+Children%22%29.+After+they+met+at+an+AA+meeting%2C+she+became+Auggie%27s+sponsor+and+encouraged+his+dream+to+become+a+chef.+Now+a+successful+sous+chef+at+the+trendy+restaurant+Coal%2C+Auggie+has+been+avoiding+Sydney+since+she+began+drinking+again.+The+other+tenants+include+Lauren+Yung+%28Stephanie+Jacobsen%2C+%22Terminator%3A+The+Sarah+Connor+Chronicles%22%29%2C+a+medical+student+in+desperate+need+of+money+to+pay+her+student+loans%2C+and+Jonah+Miller+%28Michael+Rady%2C+%22Swingtown%22%29%2C+an+aspiring+filmmaker+who+has+just+proposed+to+his+live-in+girlfriend+Riley+Richmond+%28Jessica+Lucas%2C+%22Cloverfield%22%29%2C+a+first-grade+teacher.+The+newest+tenant%2C+18-year-old+Violet+Foster+%28Ashlee+Simpson-Wentz%2C+%227th+Heaven%22%29%2C+has+just+arrived+in+LA+with+her+own+secret+connection+to+Sydney.+When+a+bloody+body+is+found+floating+in+the+courtyard+pool%2C+David+is+the+leading+suspect.+However%2C+as+the+police+are+soon+to+discover%2C+almost+everyone+living+at+Melrose+Place+had+a+reason+to+want+the+deceased+out+of+the+way.","7.5","0","60","Melrose+Place+%282009%29","Ended","graphical/85427-g.jpg","fanart/original/85427-3.jpg","1429978991","posters/85427-1.jpg","1","1","2","1435604404");
