INSERT INTO `series_series` VALUES("248742","%7CMichael+Emerson%7CJim+Caviezel%7CAmy+Acker%7CKevin+Chapman%7CSarah+Shahi%7CTaraji+P.+Henson%7CPaige+Turco%7CJohn+Nolan%7CEnrico+Colantoni%7C","TV-14","2011-09-22","|Action|Adventure|Drama|Mystery|Thriller|","tt1839578","CBS","Person+of+Interest+is+an+American+science+fiction+crime+drama+television+series+created+for+CBS+by+Jonathan+Nolan%2C+who+serves+as+an+executive+producer+alongside+J.J.+Abrams%2C+Bryan+Burk%2C+and+Greg+Plageman.+The+series+stars+Jim+Caviezel+as+John+Reese%2C+a+presumed+dead+former+CIA+agent+who+is+approached+by+a+mysterious+billionaire+named+Harold+Finch+%28Michael+Emerson%29+to+prevent+violent+crimes+before+they+happen+by+using+an+advanced+surveillance+system+dubbed+%22The+Machine%22.+Their+unique+brand+of+vigilante+justice+attracts+the+attention+of+two+NYPD+officers%2C+Joss+Carter+%28Taraji+P.+Henson%29+and+Lionel+Fusco+%28Kevin+Chapman%29%2C+whom+Reese+uses+to+his+advantage+as+he+investigates+persons+of+interest.+Reese+and+Finch+are+later+aided+by+Samantha+%22Root%22+Groves+%28Amy+Acker%29%2C+a+highly+intelligent+computer+hacker+and+contract+killer+who+the+Machine+later+identifies+as+its+%22analog+interface%22+and+Sameen+Shaw+%28Sarah+Shahi%29%2C+a+former+ISA+assassin+who+unknowingly+dealt+with+the+%22relevant%22+numbers+found+by+the+Machine.","8.9","0","60","Person+of+Interest","Continuing","graphical/248742-g11.jpg","fanart/original/248742-21.jpg","1435522772","posters/248742-15.jpg","0","0","3","1435564803");
INSERT INTO `series_series` VALUES("258823","%7CTracy+Spiridakos%7CBilly+Burke%7CDavid+Lyons%7CMark+Pellegrino%7CStephen+Collins%7CJD+Pardo%7CZak+Orth%7CMaria+Howell%7CDaniella+Alonso%7CGraham+Rogers%7CElizabeth+Mitchell%7CTim+Guinee%7CGiancarlo+Esposito%7C","TV-14","2012-09-17","|Action|Adventure|Drama|Science-Fiction|","tt2070791","NBC","Our+entire+way+of+life+depends+on+electricity.+So+what+would+happen+if+it+just+stopped+working%3F+Well%2C+one+day%2C+like+a+switch+turned+off%2C+the+world+is+suddenly+thrust+back+into+the+dark+ages.+Planes+fall+from+the+sky%2C+hospitals+shut+down%2C+and+communication+is+impossible.+And+without+any+modern+technology%2C+who+can+tell+us+why%3F+Now%2C+15+years+later%2C+life+is+back+to+what+it+once+was+long+before+the+industrial+revolution%3A+families+living+in+quiet+cul-de-sacs%2C+and+when+the+sun+goes+down+lanterns+and+candles+are+lit.+Life+is+slower+and+sweeter.+Or+is+it%3F+On+the+fringes+of+small+farming+communities%2C+danger+lurks.+And+a+young+woman%27s+life+is+dramatically+changed+when+a+local+militia+arrives+and+kills+her+father%2C+who+mysteriously+-+and+unbeknownst+to+her+-+had+something+to+do+with+the+blackout.+This+brutal+encounter+sets+her+and+two+unlikely+companions+off+on+a+daring+coming-of-age+journey+to+find+answers+about+the+past+in+the+hopes+of+reclaiming+the+future.","7.5","0","60","Revolution","Ended","graphical/258823-g10.jpg","fanart/original/258823-2.jpg","1435344580","posters/258823-10.jpg","0","0","3","1435575603");
