INSERT INTO `series_series` VALUES("281588","%7CCristin+Milioti%7CBen+Feldman%7CLenora+Crichlow%7CHenry+Zebrowski%7CChristina+Kirk%7C","TV-14","2014-10-02","|Comedy|","tt3216682","NBC","This+is+the+A-to-Z+story+of+Andrew+and+Zelda+-+a+pair+that+almost+wasn%E2%80%99t+-+and+all+that+happened+from+the+day+they+met.+Andrew+has+always+been+a+secret+romantic+%E2%80%A6+not+above+crooning+to+Celine+Dion+while+driving+to+work%2C+with+dreams+of+finding+%E2%80%9Cthe+one.%E2%80%9D+He+imagines+her+to+be+just+like+that+shimmering+beauty+he+spotted+that+night+in+that+silver+dress+at+that+concert+two+years+ago.+Zelda%2C+having+grown+up+with+a+hippie+mom+who+believed+the+universe+would+provide+for+everything%2C+rebelled+into+a+no-nonsense+practical+lawyer+who+prefers+the+control+of+online+dating.+But+when+a+computer+glitch+sends+her+a+total+mismatch%2C+she%E2%80%99s+asked+to+come+in+for+an+interview+at+the+Internet+dating+site+where+Andrew+works%2C+and+this+is+where+it+all+begins.+Andrew+and+Zelda+meet+for+the+first+time+and+despite+their+differences%2C+sparks+fly.+She+thinks+it%E2%80%99s+chance.+He+thinks+it%E2%80%99s+fate.+After+all%2C+he%E2%80%99s+convinced+she%E2%80%99s+the+shimmering+girl+in+the+silver+dress.+Is+it+true+love+forever+or+just+a+detour+in+destiny%3F","7.4","0","30","A+to+Z","Ended","graphical/281588-g2.jpg","fanart/original/281588-3.jpg","1430918002","posters/281588-3.jpg","0","0","1","1435586403");
